INSERT INTO `movies` VALUES (1000001,'Barbie',2023,'She\'s everything. He\'s just Ken.','Barbie and Ken are having the time of their lives in the colorful and seemingly perfect world of Barbie Land. However, when they get a chance to go to the real world, they soon discover the joys and perils of living among humans.',114,3.86),(1000002,'Parasite',2019,'Act like you own the place.','All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.',133,4.56),(1000003,'Everything Everywhere All at Once',2022,'The universe is so much bigger than you realize.','An aging Chinese immigrant is swept up in an insane adventure, where she alone can save what\'s important to her by connecting with the lives she could have led in other universes.',140,4.3),(1000004,'Fight Club',1999,'Mischief. Mayhem. Soap.','A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.',139,4.27),(1000005,'La La Land',2016,'Here\'s to the fools who dream.','Mia, an aspiring actress, serves lattes to movie stars in between auditions and Sebastian, a jazz musician, scrapes by playing cocktail party gigs in dingy bars, but as success mounts they are faced with decisions that begin to fray the fragile fabric of their love affair, and the dreams they worked so hard to maintain in each other threaten to rip them apart.',129,4.09),(1000006,'Oppenheimer',2023,'The world forever changes.','The story of J. Robert Oppenheimer\'s role in the development of the atomic bomb during World War II.',181,4.23),(1000007,'Interstellar',2014,'Mankind was born on Earth. It was never meant to die here.','The adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.',169,4.35),(1000008,'Joker',2019,'Put on a happy face.','During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.',122,3.85),(1000009,'Dune',2021,'Beyond fear, destiny awaits.','Paul Atreides, a brilliant and gifted young man born into a great destiny beyond his understanding, must travel to the most dangerous planet in the universe to ensure the future of his family and his people. As malevolent forces explode into conflict over the planet\'s exclusive supply of the most precious resource in existence-a commodity capable of unlocking humanity\'s greatest potential-only those who can conquer their fear will survive.',155,3.9),(1000010,'Pulp Fiction',1994,'Just because you are a character doesn\'t mean you have character.','A burger-loving hit man, his philosophical partner, a drug-addled gangster\'s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.',154,4.26),(1000011,'Spider-Man: Into the Spider-Verse',2018,'More than one wears the mask.','Struggling to find his place in the world while juggling school and family, Brooklyn teenager Miles Morales is unexpectedly bitten by a radioactive spider and develops unfathomable powers just like the one and only Spider-Man. While wrestling with the implications of his new abilities, Miles discovers a super collider created by the madman Wilson \"Kingpin\" Fisk, causing others from across the Spider-Verse to be inadvertently transported to his dimension.',117,4.42),(1000012,'Whiplash',2014,'The road to greatness can take you to the edge.','Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.',107,4.43),(1000013,'The Batman',2022,'Unmask the truth.','In his second year of fighting crime, Batman uncovers corruption in Gotham City that connects to his own family while facing a serial killer known as the Riddler.',177,3.98),(1000014,'Get Out',2017,'Just because you\'re invited, doesn\'t mean you\'re welcome.','Chris and his girlfriend Rose go upstate to visit her parents for the weekend. At first, Chris reads the family\'s overly accommodating behavior as nervous attempts to deal with their daughter\'s interracial relationship, but as the weekend progresses, a series of increasingly disturbing discoveries lead him to a truth that he never could have imagined.',104,4.16),(1000015,'Knives Out',2019,'Hell, any of them could have done it.','When renowned crime novelist Harlan Thrombey is found dead at his estate just after his 85th birthday, the inquisitive and debonair Detective Benoit Blanc is mysteriously enlisted to investigate. From Harlan\'s dysfunctional family to his devoted staff, Blanc sifts through a web of red herrings and self-serving lies to uncover the truth behind Harlan\'s untimely death.',131,3.99),(1000016,'Midsommar',2019,'Let the festivities begin.','Several friends travel to Sweden to study as anthropologists a summer festival that is held every ninety years in the remote hometown of one of them. What begins as a dream vacation in a place where the sun never sets, gradually turns into a dark nightmare as the mysterious inhabitants invite them to participate in their disturbing festive activities.',147,3.78),(1000017,'The Dark Knight',2008,'Why So Serious?','Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.',152,4.47),(1000018,'Inception',2010,'Your mind is the scene of the crime.','Cobb, a skilled thief who commits corporate espionage by infiltmovie_rating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.',148,4.2),(1000019,'Saltburn',2023,'We\'re all about to lose our minds.','Struggling to find his place at Oxford University, student Oliver Quick finds himself drawn into the world of the charming and aristocratic Felix Catton, who invites him to Saltburn, his eccentric family\'s sprawling estate, for a summer never to be forgotten.',131,3.43),(1000020,'Poor Things',2023,'She\'s like nothing you\'ve ever seen.','Brought back to life by an unorthodox scientist, a young woman runs off with a lawyer on a whirlwind adventure across the continents. Free from the prejudices of her times, she grows steadfast in her purpose to stand for equality and liberation.',142,4.05),(1000021,'Spider-Man: Across the Spider-Verse',2023,'It\'s how you wear the mask that matters','After reuniting with Gwen Stacy, Brooklyn’s full-time, friendly neighborhood Spider-Man is catapulted across the Multiverse, where he encounters the Spider Society, a team of Spider-People charged with protecting the Multiverse’s very existence. But when the heroes clash on how to handle a new threat, Miles finds himself pitted against the other Spiders and must set out on his own to save those he loves most.',140,4.45),(1000022,'The Truman Show',1998,'On the air. Unaware.','Truman Burbank is the star of The Truman Show, a 24-hour-a-day reality TV show that broadcasts every aspect of his life without his knowledge. His entire life has been an unending soap opera for consumption by the rest of the world. And everyone he knows, including his wife and his best friend is really an actor, paid to be part of his life.',103,4.21),(1000023,'Lady Bird',2017,'Fly Away Home.','A California high school student plans to escape from her family and small town by going to college in New York, much to the disapproval of wildly loving, deeply opinionated and strong-willed mother.',94,3.85),(1000024,'The Grand Budapest Hotel',2014,'A murder case of Madam D. With enormous wealth and the most outrageous events surrounding her sudden death!','The Grand Budapest Hotel tells of a legendary concierge at a famous European hotel between the wars and his friendship with a young employee who becomes his trusted protégé. The story involves the theft and recovery of a priceless Renaissance painting, the battle for an enormous family fortune and the slow and then sudden upheavals that transformed Europe during the first half of the 20th century.',100,4.24),(1000025,'The Wolf of Wall Street',2013,'EARN. SPEND. PARTY.','A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belfort\'s autobiography.',180,4),(1000026,'American Psycho',2000,'I think my mask of sanity is about to slip.','A wealthy New York investment banking executive hides his alternate psychopathic ego from his co-workers and friends as he escalates deeper into his illogical, gratuitous fantasies.',102,3.86),(1000027,'Spider-Man: No Way Home',2021,'The Multiverse unleashed.','Peter Parker is unmasked and no longer able to separate his normal life from the high-stakes of being a super-hero. When he asks for help from Doctor Strange the stakes become even more dangerous, forcing him to discover what it truly means to be Spider-Man.',148,3.84),(1000028,'Dune: Part Two',2024,'Long live the fighters.','Follow the mythic journey of Paul Atreides as he unites with Chani and the Fremen while on a path of revenge against the conspirators who destroyed his family. Facing a choice between the love of his life and the fate of the known universe, Paul endeavors to prevent a terrible future only he can foresee.',167,4.47),(1000029,'Eternal Sunshine of the Spotless Mind',2004,'You can erase someone from your mind. Getting them out of your heart is another story.','Joel Barish, heartbroken that his girlfriend underwent a procedure to erase him from her memory, decides to do the same. However, as he watches his memories of her fade away, he realises that he still loves her, and may be too late to correct his mistake.',108,4.25),(1000030,'Spirited Away',2001,'Fantasy can be captivating','A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.',125,4.45),(1000031,'The Menu',2022,'Wonderful surprises await you all.','A couple travels to a coastal island to eat at an exclusive restaurant where the chef has prepared a lavish menu, with some shocking surprises.',107,3.54),(1000032,'Gone Girl',2014,'You don\'t know what you\'ve got \'til it\'s...','With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.',149,4.07),(1000033,'Once Upon a Time… in Hollywood',2019,'In this town, it can all change… like that','Los Angeles, 1969. TV star Rick Dalton, a struggling actor specializing in westerns, and stuntman Cliff Booth, his best friend, try to survive in a constantly changing movie industry. Dalton is the neighbor of the young and promising actress and model Sharon Tate, who has just married the prestigious Polish director Roman Polanski…',162,3.76),(1000034,'The Shining',1980,'He came as the caretaker, but this hotel had its own guardians - who\'d been there a long time','Jack Torrance accepts a caretaker job at the Overlook Hotel, where he, along with his wife Wendy and their son Danny, must live isolated from the rest of the world for the winter. But they aren\'t prepared for the madness that lurks within.',144,4.24),(1000035,'Black Swan',2010,NULL,'A journey through the psyche of a young ballerina whose starring role as the duplicitous swan queen turns out to be a part for which she becomes frighteningly perfect.',108,4.15),(1000036,'Inglourious Basterds',2009,'Once upon a time in Nazi occupied France...','In Nazi-occupied France during World War II, a group of Jewish-American soldiers known as \"The Basterds\" are chosen specifically to spread fear throughout the Third Reich by scalping and brutally killing Nazis. The Basterds, lead by Lt. Aldo Raine soon cross paths with a French-Jewish teenage girl who runs a movie theater in Paris which is targeted by the soldiers.',153,4.34),(1000037,'Little Women',2019,'Own your story','Four sisters come of age in America in the aftermath of the Civil War.',135,4.15),(1000038,'Forrest Gump',1994,'Life is like a box of chocolates...you never know what you\'re gonna get.','A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.',142,4.13),(1000039,'Se7en',1995,'Seven deadly sins. Seven ways to die.','Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.',127,4.33),(1000040,'Avengers: Infinity War',2018,'An entire universe. Once and for all.','As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.',149,3.96),(1000041,'Glass Onion',2022,'When the game ends, the mystery begins.','World-famous detective Benoit Blanc heads to Greece to peel back the layers of a mystery surrounding a tech billionaire and his eclectic crew of friends.',140,3.45),(1000042,'The Silence of the Lambs',1991,'To enter the mind of a killer she must challenge the mind of a madman.','Clarice Starling is a top student at the FBI\'s training academy.  Jack Crawford wants Clarice to interview Dr. Hannibal Lecter, a brilliant psychiatrist who is also a violent psychopath, serving life behind bars for various acts of murder and cannibalism.  Crawford believes that Lecter may have insight into a case and that Starling, as an attractive young woman, may be just the bait to draw him out.',119,4.33),(1000043,'Avengers: Endgame',2019,'Part of the journey is the end.','After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos\' actions and restore order to the universe once and for all, no matter what consequences may be in store.',181,3.87),(1000044,'Baby Driver',2017,'All you need is one killer track.','After being coerced into working for a crime boss, a young getaway driver finds himself taking part in a heist doomed to fail.',113,3.72),(1000045,'Kill Bill: Vol. 1',2003,'A roaring rampage of revenge.','An assassin is shot by her ruthless employer, Bill, and other members of their assassination circle – but she lives to plot her vengeance.',111,4.19),(1000046,'The Godfather',1972,'An offer you can\'t refuse.','Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.',175,4.55),(1000047,'Django Unchained',2012,'Life, liberty and the pursuit of vengeance.','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.',165,4.28),(1000048,'Shutter Island',2010,'Someone is missing','World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by his troubling visions and also by a mysterious doctor.',138,4.11),(1000049,'Call Me by Your Name',2017,'Is it better to speak or die?','In 1980s Italy, a relationship begins between seventeen-year-old teenage Elio and the older adult man hired as his father\'s research assistant.',132,3.86),(1000050,'Hereditary',2018,'Every family tree hides a secret.','When Ellen, the matriarch of the Graham family, passes away, her daughter’s family begins to unravel cryptic and increasingly terrifying secrets about their ancestry.',128,3.97),(1000051,'The Social Network',2010,'You don\'t get to 500 million friends without making a few enemies.','On a fall night in 2003, Harvard undergrad and computer programming genius Mark Zuckerberg sits down at his computer and heatedly begins working on a new idea. In a fury of blogging and programming, what begins in his dorm room as a small site among friends soon becomes a global social network and a revolution in communication. A mere six years and 500 million friends later, Mark Zuckerberg is the youngest billionaire in history... but for this entrepreneur, success leads to both personal and legal complications.',121,3.95),(1000052,'Her',2013,'A Spike Jonze Love Story','In the not so distant future, Theodore, a lonely writer purchases a newly developed opemovie_rating system designed to meet the user\'s every needs. To Theodore\'s surprise, a romantic relationship develops between him and his opemovie_rating system. This unconventional love story blends science fiction and romance in a sweet tale that explores the nature of love and the ways that technology isolates and connects us all.',126,4.02),(1000053,'Ratatouille',2007,'He\'s dying to become a chef.','A rat movie_named Remy dreams of becoming a great French chef despite his family\'s wishes and the obvious problem of being a rat in a decidedly rodent-phobic profession. When fate places Remy in the sewers of Paris, he finds himself ideally situated beneath a restaurant made famous by his culinary hero, Auguste Gusteau. Despite the apparent dangers of being an unlikely - and certainly unwanted - visitor in the kitchen of a fine French restaurant, Remy\'s passion for cooking soon sets into motion a hilarious and exciting rat race that turns the culinary world of Paris upside down.',111,4.2),(1000054,'10 Things I Hate About You',1999,'How do I loathe thee? Let me count the ways.','On the first day at his new school, Cameron instantly falls for Bianca, the gorgeous girl of his dreams. The only problem is that Bianca is forbidden to movie_date until her ill-tempered, completely un-movie_dateable older sister Kat goes out, too. In an attempt to solve his problem, Cameron singles out the only guy who could possibly be a match for Kat: a mysterious bad boy with a nasty reputation of his own.',97,3.99),(1000055,'Nope',2022,'What\'s a bad miracle?','Residents in a lonely gulch of inland California bear witness to an uncanny, chilling discovery.',130,3.72),(1000056,'Scott Pilgrim vs. the World',2010,'An epic of epic epicness.','Scott Pilgrim is a 22 year old radical Canadian wannabe rockstar who falls in love with an American delivery girl, Ramona Flowers, and must defeat her seven evil exes to be able to movie_date her.',113,3.87),(1000057,'The Matrix',1999,'Welcome to the Real World.','Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.',136,4.16),(1000058,'Fantastic Mr. Fox',2009,'Dig the life fantastic!','The Fantastic Mr. Fox, bored with his current life, plans a heist against the three local farmers. The farmers, tired of sharing their chickens with the sly fox, seek revenge against him and his family.',87,4.27),(1000059,'Taxi Driver',1976,'On every street in every city, there\'s a nobody who dreams of being a somebody.','A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action.',114,4.17),(1000060,'Dead Poets Society',1989,'He was their inspiration. He made their lives extraordinary.','At an elite, old-fashioned boarding school in New England, a passionate English teacher inspires his students to rebel against convention and seize the potential of every day, courting the disdain of the stern headmaster.',128,4.26),(1000061,'Jojo Rabbit',2019,'An anti-hate satire.','A World War II satire that follows a lonely German boy whose world view is turned upside down when he discovers his single mother is hiding a young Jewish girl in their attic. Aided only by his idiotic imaginary friend, Adolf Hitler, Jojo must confront his blind nationalism.',108,4.03),(1000062,'Guardians of the Galaxy',2014,'All heroes start somewhere.','Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.',121,3.78),(1000063,'Black Panther',2018,'Long live the king.','King T\'Challa returns home from America to the reclusive, technologically advanced African nation of Wakanda to serve as his country\'s new leader. However, T\'Challa soon finds that he is challenged for the throne by factions within his own country as well as without. Using powers reserved to Wakandan kings, T\'Challa assumes the Black Panther mantel to join with girlfriend Nakia, the queen-mother, his princess-kid sister, members of the Dora Milaje (the Wakandan \'special forces\') and an American secret agent, to prevent Wakanda from being dragged into a world war.',135,3.65),(1000064,'Arrival',2016,'Why are they here?','Taking place after alien crafts land around the world, an expert linguist is recruited by the military to determine whether they come in peace or are a threat.',116,4.12),(1000065,'Blade Runner 2049',2017,'The key to the future is finally unearthed.','Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what\'s left of society into chaos. K\'s discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.',164,4.12),(1000066,'The Perks of Being a Wallflower',2012,'We are infinite.','Pittsburgh, Pennsylvania, 1991. High school freshman Charlie is a wallflower, always watching life from the sidelines, until two senior students, Sam and her stepbrother Patrick, become his mentors, helping him discover the joys of friendship, music and love…',103,3.92),(1000067,'The Lord of the Rings: The Fellowship of the Ring',2001,'One ring to rule them all','Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.',179,4.37),(1000068,'The Shawshank Redemption',1994,'Fear can hold you prisoner. Hope can set you free.','Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. 