lly found a friend and stows away on the ship when it leaves.',98,4.2),(1000099,'Aftersun',2022,'Memory burns.','Sophie reflects on the shared joy and private melancholy of a holiday she took with her father twenty years earlier. Memories real and imagined fill the gaps between miniDV footage as she tries to reconcile the father she knew with the man she didn’t.',102,4.24),(1000100,'Thor: Ragnarok',2017,'No Hammer. No Problem.','Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of an all-powerful new threat, the ruthless Hela.',131,3.73),(1000101,'Bottoms',2023,'A movie about empowering women (the hot ones)','Unpopular best friends PJ and Josie start a high school self-defense club to meet girls and lose their virginity. They soon find themselves in over their heads when the most popular students start beating each other up in the movie_name of self-defense.',91,3.81),(1000102,'1917',2019,'Time is the enemy','At the height of the First World War, two young British soldiers must cross enemy territory and deliver a message that will stop a deadly attack on hundreds of soldiers.',119,4.11),(1000103,'Harry Potter and the Philosopher\'s Stone',2001,'Let the Magic Begin.','Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths -- and about the villain who\'s to blame.',152,3.76),(1000104,'Avatar',2009,'Enter the World of Pandora.','In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien