erences.',81,4.12),(1000135,'Jurassic Park',1993,'An adventure 65 million years in the making.','A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.',127,4.11),(1000136,'A Quiet Place',2018,'If they hear you, they hunt you.','A family is forced to live in silence while hiding from creatures that hunt by sound.',91,3.65),(1000137,'The Lord of the Rings: The Return of the King',2003,'The eye of the enemy is moving.','Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron\'s forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord\'s realm.',201,4.5),(1000138,'Guardians of the Galaxy Vol. 2',2017,'Obviously.','The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill\'s true parentage.',137,3.51),(1000139,'The Incredibles',2004,'No gut, no glory','Bob Parr has given up his superhero days to log in time as an insurance adjuster and raise his three children with his formerly heroic wife in suburbia. But when he receives a mysterious assignment, it\'s time to get back into costume.',115,4.07),(1000140,'Iron Man',2008,'Heroes aren\'t born. They\'re built.','After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.',126,3.7),(1000141,'Zodiac',2007,'There\'s more than one way to lose your life to a killer.','The true story of the investigation of the \"Zodiac Killer\", a serial killer who terrified the San Francisco Bay Area, taunting police with his ciphers and letters. The case becomes an obsession for three men as their lives and careers are built and destroyed by the endless trail of clues.',163,4.02),(1000142,'Wonka',2023,'Every good thing in this world started with a dream.','Willy Wonka – chock-full of ideas and determined to change the world one delectable bite at a time – is proof that the best things in life begin with a dream, and if you’re lucky enough to meet Willy Wonka, anything is possible.',117,3.27),(1000143,'Lost in Translation',2003,'Everyone wants to be found.','Two lost souls visiting Tokyo -- the young, neglected wife of a photographer and a washed-up movie star shooting a TV commercial -- find an odd solace and pensive freedom to be real in each other\'s company, away from their lives in America.',102,3.83),(1000144,'Alien',1979,'In space no one can hear you scream.','During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.',117,4.27),(1000145,'Superbad',2007,'Come and Get Some!','Two co-dependent high school seniors are forced to deal with separation anxiety after their plan to stage a booze-soaked party goes awry.',113,3.88),(1000146,'Finding Nemo',2003,'There are 3.7 trillion fish in the ocean. They\'re looking for one.','Nemo, an adventurous young clownfish, is unexpectedly taken from his Great Barrier Reef home to a dentist\'s office aquarium. It\'s up to his worrisome father Marlin and a friendly but forgetful fish Dory to bring Nemo home -- meeting vegetarian sharks, surfer dude turtles, hypnotic jellyfish, hungry seagulls, and more along the way.',100,4.04),(1000147,'Requiem for a Dream',2000,NULL,'The hopes and dreams of four ambitious people are shattered when their drug addictions begin spiraling out of control. A look into addiction and how it overcomes the mind and body.',102,4.1),(1000148,'The Super Mario Bros. Movie',2023,'Not all heroes wear capes. Some wear overalls.','While working underground to fix a water main, Brooklyn plumbers—and brothers—Mario and Luigi are transported down a mysterious pipe and wander into a magical new world. But when the brothers are separated, Mario embarks on an epic quest to find Luigi.',93,3.27),(1000149,'Marriage Story',2019,'Where there\'s a love, there\'s a way.','A stage director and an actress struggle through a grueling, coast-to-coast divorce that pushes them to their personal extremes.',137,4),(1000150,'A Clockwork Orange',1971,'Being the adventures of a young man whose principal interests are rape, ultra-violence and Beethoven.','In a near-future Britain, young Alexander DeLarge and his pals get their kicks beating and raping anyone they please. When not destroying the lives of others, Alex swoons to the music of Beethoven. The state, eager to crack down on juvenile crime, gives an incarcerated Alex the option to undergo an invasive procedure that\'ll rob him of all personal agency. In a time when conscience is a commodity, can Alex change his tune?',137,4.12),(1000151,'Portrait of a Lady on Fire',2019,'Don\'t regret. Remember.','On an isolated island in Brittany at the end of the eighteenth century, a female painter is obliged to paint a wedding portrait of a young woman.',120,4.43),(1000152,'Monsters, Inc.',2001,'We Scare Because We Care.','James Sullivan and Mike Wazowski are monsters, they earn their living scaring children and are the best in the business... even though they\'re more afraid of the children than they are of them. When a child accidentally enters their world, James and Mike suddenly find that kids are not to be afraid of and they uncover a conspiracy that could threaten all children across the world.',92,4.08),(1000153,'Captain America: Civil War',2016,'Divided We Fall','Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.',147,3.57),(1000154,'The Hunger Games: The Ballad of Songbirds & Snakes',2023,'Everyone hungers for something.','64 years before he becomes the tyrannical president of Panem, Coriolanus Snow sees a chance for a change in fortunes when he mentors Lucy Gray Baird, the female tribute from District 12.',157,3.59),(1000155,'Home Alone',1990,'A Family Comedy Without the Family.','Eight-year-old Kevin McCallister makes the most of the situation after his family unwittingly leaves him behind when they go on Christmas vacation. But when a pair of bungling burglars set their sights on Kevin\'s house, the plucky kid stands ready to defend his territory. By planting booby traps galore, adorably mischievous Kevin stands his ground as his frantic mother attempts to race home before Christmas Day.',103,3.8),(1000156,'The Lord of the Rings: The Two Towers',2002,'A New Power Is Rising.','Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.',179,4.39),(1000157,'Blade Runner',1982,'Man has made his match... now it\'s his problem.','In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.',118,4.1),(1000158,'Reservoir Dogs',1992,'Every dog has his day.','A botched robbery indicates a police informant, and the pressure mounts in the aftermath at a warehouse. Crime begets violence as the survivors -- veteran Mr. White, newcomer Mr. Orange, psychopathic parolee Mr. Blonde, bickering weasel Mr. Pink and Nice Guy Eddie -- unravel.',99,4.15),(1000159,'Doctor Strange',2016,'Open your mind. Change your reality.','After his career is destroyed, a brilliant but arrogant surgeon gets a new lease on life when a sorcerer takes him under her wing and trains him to defend the world against evil.',115,3.44),(1000160,'The Dark Knight Rises',2012,'The Legend Ends','Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent\'s crimes to protect the late attorney\'s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham\'s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.',165,3.74),(1000161,'Anyone But You',2023,'They only look like the perfect couple.','After an amazing first movie_date, Bea and Ben\'s fiery attraction turns ice cold — until they find themselves unexpectedly reunited at a destination wedding in Australia. So they do what any two mature adults would do: pretend to be a couple.',104,2.93),(1000162,'Before Sunrise',1995,'Can the greatest romance of your life last only one night?','A young man and woman meet on a train in Europe, and wind up spending one evening together in Vienna. Unfortunately, both know that this will probably be their only night together.',101,4.33),(1000163,'Asteroid City',2023,NULL,'Set in a fictional American desert town circa 1955, the itinerary of a Junior Stargazer/Space Cadet convention (organized to bring together students and parents from across the country for fellowship and scholarly competition) is spectacularly disrupted by world-changing events.',105,3.52),(1000164,'Spider-Man 2',2004,'There\'s a hero in all of us.','Peter Parker is going through a major identity crisis. Burned out from being Spider-Man, he decides to shelve his superhero alter ego, which leaves the city suffering in the wake of carnage left by the evil Doc Ock. In the meantime, Parker still can\'t act on his feelings for Mary Jane Watson, a girl he\'s loved since childhood.',127,3.89),(1000165,'Pride & Prejudice',2005,'A romance ahead of its time.','A story of love and life among the landed English gentry during the Georgian era. Mr. Bennet is a gentleman living in Hertfordshire with his overbearing wife and five daughters, but if he dies their house will be inherited by a distant cousin whom they have never met, so the family\'s future happiness and security is dependent on the daughters making good marriages.',127,4.1),(1000166,'Oldboy',2003,'15 years of imprisonment, five days of vengeance','With no clue how he came to be imprisoned, drugged and tortured for 15 years, a desperate businessman seeks revenge on his captors.',120,4.39),(1000167,'John Wick',2014,'Don\'t set him off.','Ex-hitman John Wick comes out of retirement to track down the gangsters that took everything from him.',101,3.81),(1000168,'The Hunger Games: Catching Fire',2013,'Every revolution begins with a spark.','Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a \"Victor\'s Tour\" of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.',146,3.8),(1000169,'Harry Potter and the Goblet of Fire',2005,'Dark and difficult times lie ahead.','When Harry Potter\'s movie_name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools—the Triwizard Tourmovie_nament. But since Harry never submitted his movie_name for the Tourmovie_nament, who did? Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named.',157,3.81),(1000170,'Batman Begins',2005,'Evil fears the knight.','Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.',140,3.8),(1000171,'Star Wars: The Force Awakens',2015,'Every generation has a story.','Thirty years after defeating the Galactic Empire, Han Solo and his allies face a new threat from the evil Kylo Ren and his army of Stormtroopers.',136,3.31),(1000172,'Harry Potter and the Chamber of Secrets',2002,'Something evil has returned to Hogwarts!','Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.',161,3.59),(1000173,'The Prestige',2006,'Are You Watching Closely?','A mysterious story of two magicians whose intense rivalry leads them on a life-long battle for supremacy -- full of obsession, deceit and jealousy with dangerous and deadly consequences.',130,4.23),(1000174,'Psycho',1960,'The master of suspense moves his cameras into the icy blackness of the unexplored!','When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.',109,4.32),(1000175,'The Witch',2015,'Evil takes many forms.','In 1630s New England, William and Katherine lead a devout Christian life with five children, homesteading on the edge of an impassable wilderness, exiled from their settlement when William defies the local church. When their newborn son vanishes and crops mysteriously fail, the family turns on one another.',92,3.84),(1000176,'Captain America: The Winter Soldier',2014,'In heroes we trust.','After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.',136,3.71),(1000177,'Bohemian Rhapsody',2018,'Fearless lives forever','Singer Freddie Mercury, guitarist Brian May, drummer Roger Taylor and bass guitarist John Deacon take the music world by storm when they form the rock \'n\' roll band Queen in 1970. Hit songs become instant classics. When Mercury\'s increasingly wild lifestyle starts to spiral out of control, Queen soon faces its greatest challenge yet – finding a way to keep the band together amid the success and excess.',135,3.42),(1000178,'The Lion King',1994,'Life\'s greatest adventure is finding your place in the Circle of Life.','A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?',89,4.22),(1000179,'The French Dispatch',2021,NULL,'The staff of a European publication decides to publish a 