ide of a great American myth in Elvis and Priscilla Presley’s long courtship and turbulent marriage, from a German army base to his estate at Graceland.',110,3.57),(1000186,'The Whale',2022,NULL,'A reclusive English teacher suffering from severe obesity attempts to reconnect with his estranged teenage daughter for one last chance at redemption.',117,3.65),(1000187,'Harry Potter and the Deathly Hallows: Part 2',2011,'It all ends.','Harry, Ron and Hermione continue their quest to vanquish the evil Voldemort once and for all. Just as things begin to look hopeless for the young wizards, Harry discovers a trio of magical objects that endow him with powers to rival Voldemort\'s formidable skills.',130,3.96),(1000188,'Star Wars: Episode III – Revenge of the Sith',2005,'The saga is complete.','The evil Darth Sidious enacts his final plan for unlimited power -- and the heroic Jedi Anakin Skywalker must choose a side.',140,3.82),(1000189,'Princess Mononoke',1997,'The Fate Of The World Rests On The Courage Of One Warrior.','Ashitaka, a prince of the disappearing Emishi people, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.',134,4.37),(1000190,'Ex Machina',2015,'There is nothing more human than the will to survive','Caleb, a coder at the world\'s largest internet company, wins a competition to spend a week at a private mountain retreat belonging to Nathan, the reclusive CEO of the company. But when Caleb arrives at the remote location he finds that he will have to participate in a strange and fascinating experiment in which he must interact with the world\'s first true artificial intelligence, housed in the body of a beautiful robot girl.',108,3.98),(1000191,'Return of the Jedi',1983,'The Empire Falls...','Luke Skywalker leads a mission to rescue his friend Han Solo from the clutches of Jabba the Hutt, while the Emperor seeks to destroy the Rebellion once and for all with a second dreaded Death Star.',132,4.04),(1000192,'The Boy and the Heron',2023,'Where death comes to an end, life finds a new beginning.','While the Second World War rages, the teenage Mahito, haunted by his mother\'s tragic death, is relocated from Tokyo to the serene rural home of his new stepmother Natsuko, a woman who bears a striking resemblance to the boy\'s mother. As he tries to adjust, this strange new world grows even stranger following the appearance of a persistent gray heron, who perplexes and bedevils Mahito, dubbing him the \"long-awaited one.\"',124,3.96),(1000193,'Talk to Me',2022,'You call. They\'ll answer.','When a group of friends discover how to conjure spirits using an embalmed hand, they become hooked on the new thrill, until one of them goes too far and unleashes terrifying supernatural forces.',95,3.56),(1000194,'There Will Be Blood',2007,'There Will Be Greed. There Will Be Vengeance.','Ruthless silver miner, turned oil prospector, Daniel Plainview moves to oil-rich California. Using his son to project a trustworthy, family-man image, Plainview cons local landowners into selling him their valuable properties for a pittance. However, local preacher Eli Sunday suspects Plainview\'s motives and intentions, starting a slow-burning feud that threatens both their lives.',158,4.45),(1000195,'Don\'t Worry Darling',2022,'Welcome to Victory.','A 1950s housewife living with her husband in a utopian experimental community begins to worry that his glamorous company may be hiding disturbing secrets.',123,2.96),(1000196,'Tangled',2010,'They\'re taking adventure to new lengths.','When the kingdom\'s most wanted-and most charming-bandit Flynn Rider hides out in a mysterious tower, he\'s taken hostage by Rapunzel, a beautiful and feisty tower-bound teen with 70 feet of magical, golden hair. Flynn\'s curious captor, who\'s looking for her ticket out of the tower where she\'s been locked away for years, strikes a deal with the handsome thief and the unlikely duo sets off on an action-packed escapade, complete with a super-cop horse, an over-protective chameleon and a gruff gang of pub thugs.',100,3.93),(1000197,'Thor: Love and Thunder',2022,'The one is not the only.','After his retirement is interrupted by Gorr the God Butcher, a galactic killer who seeks the extinction of the gods, Thor enlists the help of King Valkyrie, Korg, and ex-girlfriend Jane Foster, who now inexplicably wields Mjolnir as the Mighty Thor. Together, they embark upon a harrowing cosmic adventure to uncover the mystery of the God Butcher’s vengeance and stop him before it’s too late.',119,2.48),(1000198,'Jaws',1975,'Don\'t go in the water','When an insatiable great white shark terrorizes the townspeople of Amity Island, the police chief, an oceanographer and a grizzled shark hunter seek to destroy the blood-thirsty beast.',124,3.96),(1000199,'The Departed',2006,'Lies. Betrayal. Sacrifice. How far will you take it?','To take down South Boston\'s Irish Mafia, the police send in one of their own to infiltrate the underworld, not realizing the syndicate has done likewise. While an undercover cop curries favor with the mob kingpin, a career criminal rises through the police ranks. But both sides soon discover there\'s a mole among them.',151,4.31),(1000200,'Avengers: Age of Ultron',2015,'A New Age Has Come.','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.',141,3.1),(1000201,'The Nightmare Before Christmas',1993,'This is Halloween, everybody make a scene!','Tired of scaring humans every October 31 with the same old bag of tricks, Jack Skellington, the spindly king of Halloween Town, kidnaps Santa Claus and plans to deliver shrunken heads and other ghoulish gifts to children on Christmas morning. But as Christmas approaches, Jack\'s rag-doll girlfriend, Sally, tries to foil his misguided plans.',76,3.95),(1000202,'Birdman or (The Unexpected Virtue of Ignorance)',2014,NULL,'A fading actor best known for his portrayal of a popular superhero attempts to mount a comeback by appearing in a Broadway play. As opening night approaches, his attempts to become more altruistic, rebuild his career, and reconnect with friends and family prove more difficult than expected.',120,3.99),(1000203,'Split',2016,'Kevin has 23 distinct personalities. The 24th is about to be unleashed.','Though Kevin has evidenced 23 personalities to his trusted psychiatrist, Dr. Fletcher, there remains one still submerged who is set to materialize and dominate all the others. Compelled to abduct three teenage girls led by the willful, observant Casey, Kevin reaches a war for survival among all of those contained within him — as well as everyone around him — as the walls between his compartments shatter apart.',117,3.46),(1000204,'Fargo',1996,'A lot can happen in the middle of nowhere.','Jerry, a small-town Minnesota car salesman is bursting at the seams with debt... but he\'s got a plan. He\'s going to hire two thugs to kidnap his wife in a scheme to collect a hefty ransom from his wealthy father-in-law. It\'s going to be a snap and nobody\'s going to get hurt... until people start dying. Enter Police Chief Marge, a coffee-drinking, parka-wearing - and extremely pregnant - investigator who\'ll stop at nothing to get her man. And if you think her small-time investigative skills will give the crooks a run for their ransom... you betcha!',98,4.21),(1000205,'Harry Potter and the Order of the Phoenix',2007,'Evil Must Be Confronted.','Returning for his fifth year of study at Hogwarts, Harry is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students – dubbed \'Dumbledore\'s Army\' – to defend themselves against the dark arts.',138,3.65),(1000206,'The Martian',2015,'Bring Him Home','During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.',141,3.75),(1000207,'The Suicide Squad',2021,'They\'re dying to save the world.','Supervillains Harley Quinn, Bloodsport, Peacemaker and a collection of nutty cons at Belle Reve prison join the super-secret, super-shady Task Force X as they are dropped off at the remote, enemy-infused island of Corto Maltese.',132,3.5),(1000208,'Mamma Mia!',2008,'Take a trip down the aisle you\'ll never forget','An independent, single mother who owns a small hotel on a Greek island is about to marry off the spirited young daughter she\'s raised alone. But, the daughter has secretly invited three of her mother\'s ex-lovers in the hopes of finding her biological father.',108,3.76),(1000209,'Perfect Blue',1997,'The color of illusion is Perfect Blue.','A retired pop singer turned actress\' sense of reality is shaken when she is stalked by an obsessed fan and seemingly a ghost of her past.',82,4.4),(1000210,'Bodies Bodies Bodies',2022,'This is not a safe space.','When a group of 20-somethings gets stuck at a remote mansion during a hurricane, a party game gone very, very wrong ends with a dead body on the ground and fake friends at every turn as they try to find the killer among them.',94,3.33),(1000211,'Clueless',1995,'Sex. Clothes. Popularity. Is there a problem here?','Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school\'s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.',97,3.72),(1000212,'Brokeback Mountain',2005,'Love is a force of nature.','Two modern-day cowboys meet on a shepherding job in the summer of \'63, the two share a raw and powerful summer together that turns into a lifelong relationship conflicting with the lives they are supposed to live.',134,4.11),(1000213,'Shrek 2',2004,'Once upon another time...','Shrek, Fiona and Donkey set off to Far, Far Away to meet Fiona\'s mother and father. But not everyone is happy. Shrek and the King find it hard to get along, and there\'s tension in the marriage. The fairy godmother discovers that Shrek has married Fiona instead of her Son Prince Charming and sets about destroying their marriage.',93,4.04),(1000214,'Star Wars: The Last Jedi',2017,'Darkness rises... and light to meet it','Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares to do battle with the First Order.',152,2.97),(1000215,'The Zone of Interest',2023,NULL,'The commandant of Auschwitz, Rudolf Höss, and his wife Hedwig, strive to build a dream life for their family in a house and garden next to the camp.',105,3.88),(1000216,'Juno',2007,'A comedy about growing up… and the bumps along the way.','Faced with an unplanned pregnancy, an offbeat young woman makes an unusual decision regarding her unborn child.',96,3.73),(1000217,'Twilight',2008,'When you can live forever, what do you live for?','When Bella Swan moves to a small town in the Pacific Northwest to live with her father, she meets the reclusive Edward Cullen, a mysterious classmate who reveals himself to be a 108-year-old vampire. Despite Edward\'s repeated cautions, Bella can\'t help but fall in love with him, a fatal move that endangers her own life when a coven of bloodsuckers try to challenge the Cullen clan.',122,2.92),(1000218,'Encanto',2021,'There\'s a little magic in all of us ...almost all of us.','The tale of an extraordinary family, the Madrigals, who live hidden in the mountains of Colombia, in a magical house, in a vibrant town, in a wondrous, charmed place called an Encanto. The magic of the Encanto has blessed every child in the family with a unique gift from super strength to the power to heal—every child except one, Mirabel. But when she discovers that the magic surrounding the Encanto is in danger, Mirabel decides that she, the only ordinary Madrigal, might just be her exceptional family\'s last hope.',102,3.53),(1000219,'Society of the Snow',2023,'Based on a remarkable true story.','On October 13, 1972, Uruguayan Air Force Flight 571, chartered to take a rugby team to Chile, crashes into a glacier in the heart of the Andes.',144,4.13),(1000220,'Last Night in Soho',2021,'When the past lets you in, the truth will come out.','A young girl, passionate about fashion design, is mysteriously able to enter the 1960s where she encounters her idol, a dazzling wannabe singer. But 1960s London is not what it seems, and time seems to be falling apart with shady consequences.',116,3.41),(1000221,'Black Widow',2021,'She\'s Done Running From Her Past.','Natasha Romanoff, also known as Black Widow, confronts the darker parts of her ledger when a dangerous conspiracy with ties to her past arises. Pursued by a force that will stop at nothing to bring her down, Natasha must deal with her history as a spy and the broken relationships left in her wake long before she became an Avenger.',134,2.93),(1000222,'No Hard Feelings',2023,'Not a love story.','On the brink of losing her childhood home, Maddie discovers an intriguing job listing: wealthy helicopter parents looking for someone to “movie_date” their introverted 19-year-old son, Percy, before he leaves for college. To her surprise, Maddie soon discovers the awkward Percy is no sure thing.',104,3.05),(1000223,'Star Wars: Episode I – The Phantom Menace',1999,'Every generation has a legend. Every journey has a first step. Every saga has a beginning.','Anakin Skywalker, a young slave strong with the Force, is discovered on Tatooine. Meanwhile, the evil Sith have returned, enacting their plot for revenge against the Jedi.',136,2.91),(1000224,'Mulholland Drive',2001,'An actress longing to be a star. A woman searching for herself. Both worlds will collide… on Mulholland Drive.','Blonde Betty Elms has only just arrived in Hollywood to become a movie star when she meets an enigmatic brunette with amnesia. Meanwhile, as the two set off to solve the second woman\'s identity, filmmaker Adam Kesher runs into ominous trouble while casting his latest project.',147,4.24),(1000225,'The Big Lebowski',1998,'It’s good knowin’ he’s out there. The Dude. Takin’ ‘er easy for all us sinners.','Jeffrey \"The Dude\" Lebowski, a Los Angeles slacker who only wants to bowl and drink White Russians, is mistaken for another Jeffrey Lebowski, a wheelchair-bound millionaire, and finds himself dragged into a strange series of events involving nihilists, adult film producers, ferrets, errant toes, and large sums of money.',117,4.13),(1000226,'Scarface',1983,'The world is yours...','After getting a green card in exchange for assassinating a Cuban government official, Tony Montana stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.',169,4.11),(1000227,'Léon: The Professional',1994,'If you want a