roy the remaining Horcruxes, putting an end to Voldemort\'s bid for immortality. But with Harry\'s beloved Dumbledore dead and Voldemort\'s unscrupulous Death Eaters on the loose, the world is more dangerous than ever.',146,3.69),(1000234,'Moonrise Kingdom',2012,'A tormenting and surprising story of children and adults during the stormy days of the summer of 1965.','Set on an island off the coast of New England in the summer of 1965, Moonrise Kingdom tells the story of two twelve-year-olds who fall in love, make a secret pact, and run away together into the wilderness. As various authorities try to hunt them down, a violent storm is brewing off-shore – and the peaceful island community is turned upside down in more ways than anyone can handle.',94,4.02),(1000235,'The Iron Claw',2023,'Sons. Brothers. Champions.','The true story of the inseparable Von Erich brothers, who made history in the intensely competitive world of professional wrestling in the early 1980s. Through tragedy and triumph, under the shadow of their domineering father and coach, the brothers seek larger-than-life immortality on the biggest stage in sports.',132,4.11),(1000236,'Rogue One: A Star Wars Story',2016,'A Rebellion Built on Hope','A rogue band of resistance fighters unite for a mission to steal the Death Star plans and bring a new hope to the galaxy.',133,3.72),(1000237,'Ferris Bueller\'s Day Off',1986,'One man\'s struggle to take it easy.','After high school slacker Ferris Bueller successfully fakes an illness in order to skip school for the day, he goes on a series of adventures throughout Chicago with his girlfriend Sloane and best friend Cameron, all the while trying to outwit his wily school principal and fed-up sister.',103,3.93),(1000238,'The Notebook',2004,'Behind every great love is a great story.','An epic love story centered around an older man who reads aloud to a woman with Alzheimer\'s. From a faded notebook, the old man\'s words bring to life the story about a couple who is separated by World War II, and is then passionately reunited, seven years later, after they have taken different paths.',123,3.7),(1000239,'12 Angry Men',1957,'Life is in their hands. Death is on their minds.','The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors\' prejudices and preconceptions about the trial, the accused, and each other.',97,4.62),(1000240,'The Nice Guys',2016,'Private dicks','A private eye investigates the apparent suicide of a fading porn star in 1970s Los Angeles and uncovers a conspiracy.',116,3.83),(1000241,'Kill Bill: Vol. 2',2004,'The bride is back for the final cut.','The Bride unwaveringly continues on her roaring rampage of revenge against the band of assassins who had tried to kill her and her unborn child. She visits each of her former associates one-by-one, checking off the victims on her Death List Five until there\'s nothing left to do … but kill Bill.',136,4.06),(1000242,'The Thing',1982,'Man is The Warmest Place to Hide.','In remote Antarctica, a group of American research scientists are disturbed at their base camp by a helicopter shooting at a sled dog. When they take in the dog, it brutally attacks both human beings and canines in the camp and they discover that the beast can assume the shape of its victims. A resourceful helicopter pilot and the camp doctor lead the camp crew in a desperate, gory battle against the vicious creature before it picks them all off, one by one.',109,4.35),(1000243,'Pirates of the Caribbean: The Curse of the Black Pearl',2003,'Prepare to be blown out of the water.','Jack Sparrow, a freewheeling 18th-century pirate, quarrels with a rival pirate bent on pillaging Port Royal. When the governor\'s daughter is kidnapped, Sparrow decides to help the girl\'s love save her.',143,3.92),(1000244,'Edward Scissorhands',1990,'His scars run deep.','A small suburban town receives a visit from a castaway unfinished science experiment movie_named Edward.',105,3.86),(1000245,'The Amazing Spider-Man',2012,'The untold story begins.','Peter Parker is an outcast high schooler abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben and Aunt May. Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents\' disappearance – leading him directly to Oscorp and the lab of Dr. Curt Connors, his father\'s former partner. As Spider-Man is set on a collision course with Connors\' alter ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.',136,3.3),(1000246,'Trainspotting',1996,'Choose life.','Mark Renton, deeply immersed in the Edinburgh drug scene, tries to clean up and get out, despite the allure of the drugs and influence of friends.',94,4.2),(1000247,'Logan',2017,'His time has come','In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan\'s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.',137,4.1),(1000248,'Saving Private Ryan',1998,'The mission is a man.','As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetmovie_rating German-held territory and bringing the boy home.',169,4.24),(1000249,'Ant-Man',2015,'Heroes don\'t get any bigger.','Armed with the astonishing ability to shrink in scale but increase in strength, master thief Scott Lang must embrace his inner-hero and help his mentor, Doctor Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.',117,3.23),(1000250,'Elvis',2022,'The man. The legend. The King of Rock & Roll.','The life story of Elvis Presley as seen through the complicated relationship with his enigmatic manager, Colonel Tom Parker.',159,3.35),(1000251,'The Revenant',2015,'(n. One who has returned, as if from the dead.)','In the 1820s, a frontiersman, Hugh Glass, sets out on a path of vengeance against those who left him for dead after a bear mauling.',157,3.87),(1000252,'Bones and All',2022,NULL,'Abandoned by her father, a young woman embarks on a thousand-mile odyssey through the backroads of America where she meets a disenfranchised drifter. But despite their best efforts, all roads lead back to their terrifying pasts and to a final stand that will determine whether their love can survive their otherness.',131,3.65),(1000253,'BlacKkKlansman',2018,'Infiltrate hate.','Colorado Springs, late 1970s. Ron Stallworth, an African American police officer, and Flip Zimmerman, his Jewish colleague, run an undercover operation to infiltrate the Ku Klux Klan.',136,3.94),(1000254,'Captain America: The First Avenger',2011,'When patriots become heroes','During World War II, Steve Rogers is a sickly man from Brooklyn who\'s transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitler\'s ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination.',124,3.26),(1000255,'American Beauty',1999,'Look closer.','Lester Burnham, a depressed suburban father in a mid-life crisis, decides to turn his hectic life around after developing an infatuation with his daughter\'s attractive friend.',122,3.96),(1000256,'Black Panther: Wakanda Forever',2022,'Forever.','Queen Ramonda, Shuri, M’Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T’Challa’s death. As the Wakandans strive to embrace their next chapter, the heroes must band together with the help of War Dog Nakia and Everett Ross and forge a new path for the kingdom of Wakanda.',162,3.36),(1000257,'The Favourite',2018,NULL,'England, early 18th century. The close relationship between Queen Anne and Sarah Churchill is threatened by the arrival of Sarah\'s cousin, Abigail Hill, resulting in a bitter rivalry between the two cousins to be the Queen\'s favourite.',120,4.03),(1000258,'The Shape of Water',2017,'A Fairy Tale for Troubled Times','An other-worldly story, set against the backdrop of Cold War era America circa 1962, where a mute janitor working at a lab falls in love with an amphibious man being held captive there and devises a plan to help him escape.',123,3.67),(1000259,'The Great Gatsby',2013,'Reserving judgments is a matter of infinite hope... I come to the admission that it has a limit.','An adaptation of F. Scott Fitzgerald\'s Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby\'s nouveau riche existence, where obsession, madness, and tragedy await.',143,3.38),(1000260,'Your Name.',2016,NULL,'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.',106,4.21),(1000261,'Eyes Wide Shut',1999,'Cruise. Kidman. Kubrick.','After Dr. Bill Harford\'s wife, Alice, admits to having sexual fantasies about a man she met, Bill becomes obsessed with having a sexual encounter. He discovers an underground sexual group and attends one of their meetings -- and quickly discovers that he is in over his head.',159,4),(1000262,'Apocalypse Now',1979,'This is the end...','At the height of the Vietnam war, Captain Benjamin Willard is sent on a dangerous mission that, officially, \"does not exist, nor will it ever exist.\" His goal is to locate - and eliminate - a mysterious Green Beret Colonel movie_named Walter Kurtz, who has been leading his personal army on illegal guerrilla missions into enemy territory.',147,4.44),(1000263,'About Time',2013,'What if every moment in life came with a second chance?','The night after another unsatisfactory New Year party, Tim\'s father tells his son that the men in his family have always had the ability to travel through time. Tim can\'t change history, but he can change what happens and has happened in his own life – so he decides to make his world a better place... by getting a girlfriend. Sadly, that turns out not to be as easy as he thinks.',123,4.01),(1000264,'Luca',2021,'Prepare for an unforgettable trip.','Two young boys experience an unforgettable Italian summer filled with gelato, pasta and endless scooter rides. But all the fun is threatened by a deeply-held secret: they are sea monsters from another world just below the water’s surface.',95,3.74),(1000265,'Five Nights at Freddy\'s',2023,'Can you survive five nights?','Recently fired and desperate for work, a troubled young man movie_named Mike agrees to take a position as a night security guard at an abandoned theme restaurant: Freddy Fazbear\'s Pizzeria. But he soon discovers that nothing at Freddy\'s is what it seems.',110,2.56),(1000266,'Deadpool 2',2018,'Prepare for the Second Coming.','Wisecracking mercenary Deadpool battles the evil and powerful Cable and other bad guys to save a boy\'s life.',120,3.49),(1000267,'Jennifer\'s Body',2009,'She\'s evil... and not just high school evil','A newly possessed cheerleader turns into a killer who specializes in offing her male classmates. Can her best friend put an end to the horror?',107,3.42),(1000268,'The Worst Person in the World',2021,NULL,'Chronicles four years in the life of Julie, a young woman who navigates the troubled waters of her love life and struggles to find her career path, leading her to take a realistic look at who she really is.',128,4.12),(1000269,'Toy Story 3',2010,'No toy gets left behind.','Woody, Buzz, and the rest of Andy\'s toys haven\'t been played with in years. With Andy about to go to college, the gang find themselves accidentally left at a nefarious day care center. The toys must band together to escape and return home to Andy.',103,3.99),(1000270,'The Florida Project',2017,'Welcome to a magical kingdom','The story of a precocious six year-old and her ragtag group of friends whose summer break is filled with childhood wonder, possibility and a sense of adventure while the adults around them struggle with hard times.',112,4.1),(1000271,'Girl, Interrupted',1999,'The crazy thing is, you\'re not crazy.','Set in the changing world of the late 1960s, Susanna Kaysen\'s prescribed \"short rest\" from a psychiatrist she had met only once becomes a strange, unknown journey into Alice\'s Wonderland, where she struggles with the thin line between normal and crazy. Susanna soon realizes how hard it is to get out once she has been committed, and she ultimately has to choose between the world of people who belong inside or the difficult world of reality outside.',127,3.89),(1000272,'The Hateful Eight',2015,'No one comes up here without a damn good reason.','Bounty hunters seek shelter from a raging blizzard and get caught up in a plot of betrayal and deception.',188,3.95),(1000273,'The Virgin Suicides',1999,'Beautiful, mysterious, haunting, invariably fatal. Just like life.','A group of male friends become obsessed with five mysterious sisters who are sheltered by their strict, religious parents.',97,3.83),(1000274,'Zootopia',2016,'Welcome to the urban jungle.','Determined to prove herself, Officer Judy Hopps, the first bunny on Zootopia\'s police force, jumps at the chance to crack her first case - even if it means partnering with scam-artist fox Nick Wilde to solve the mystery.',109,3.7),(1000275,'In the Mood for Love',2000,'Feel the heat, keep the feeling burning, let the sensation explode.','Taking place in Hong Kong of 1962, a melancholy story about the love between a woman and a man who live in the same building and one day find out that their husband and wife had an affair with each other.',98,4.4),(1000276,'Turning Red',2022,'Growing up is a beast.','Thirteen-year-old Mei is experiencing the awkwardness of being a teenager with a twist – when she gets too excited, she transforms into a giant red panda.',100,3.52),(1000277,'Booksmart',2019,'Getting straight A\'s. Giving zero F\'s.','Two academic teenage superstars realize, on the eve of their high school graduation, that they should have worked less and played more. Determined to never fall short of their peers, the girls set out on a mission to cram four years of fun into one night.',102,3.75),(1000278,'Raiders of the Lost Ark',1981,'Indiana Jones - the new hero from the creators of JAWS and STAR WARS.','When Dr. Indiana Jones – the tweed-suited professor who just happens to be a celebrated archaeologist – is hired by the government to locate the legendary Ark of the Covenant, he finds himself up against the entire Nazi regime.',115,4.16),(1000279,'Star Wars: The Rise of Skywalker',2019,'Every generation has a legend','The surviving Resistance faces the First Order once again as the journey of Rey, Finn and Poe Dameron continues. With the power and knowledge of generations behind them, the final battle begins.',142,2.36),(1000280,'Isle of Dogs',2018,'Welcome to the Isle of Dogs.','In the future, an outbreak of canine flu leads the mayor of a Japanese city to banish all dogs to an island that\'s a garbage dump. The outcasts must soon embark on an epic journey when a 12-year-old boy arrives on the island to find his beloved pet.',101,3.97),(1000281,'Triangle of Sadness',2022,NULL,'Models Carl and Yaya are invited for a luxury cruise with a rogues\' gallery of super-rich passengers. At first, all appears Instagrammable, but the cruise ends catastrophically and the group find themselves marooned on a desert island.',147,3.69),(1000282,'Star Wars: Episode II – Attack of the Clones',2002,'A Jedi Shall Not Know Anger. Nor Hatred. Nor Love.','Following an assassination attempt on Senator Padmé Amidala, Jedi Knights Anakin Skywalker and Obi-Wan Kenobi investigate a mysterious plot that could change the galaxy forever.',142,2.83),(1000283,'Beautiful Boy',2018,NULL,'After he and his first wife separate, journalist David Sheff struggles to help their teenage son, who goes from experimenting with drugs to becoming devastatingly addicted to methamphetamine.',119,3.9),(1000284,'The Pianist',2002,'Music was his passion. Survival was his masterpiece.','The true story of pianist Władysław Szpilman\'s experiences in Warsaw during the Nazi occupation. When the Jews of the city find themselves forced into a ghetto, Szpilman finds work playing in a café; and when his family is deported in 1942, he stays behind, works for a while as a laborer, and eventually goes into hiding in the ruins of the war-torn city.',150,4.37),(1000285,'The Handmaiden',2016,'Never did they expect to get into a controversial relationship...','In 1930s Korea, a swindler and a young woman pose as a Japanese count and a handmaiden to seduce a Japanese heiress and steal her fortune.',145,4.41),(1000286,'The Northman',2022,'Conquer your fate.','Prince Amleth is on the verge of becoming a man when his father is brutally murdered by his uncle, who kidnaps the boy\'s mother. Two decades later, Amleth is now a Viking who\'s on a mission to save his mother, kill his uncle and avenge his father.',137,3.79),(1000287,'Licorice Pizza',2021,'Things come easy when they matter so much.','The story of Gary Valentine and Alana Kane growing up, running around and going through the treacherous navigation of first love in the San Fernando Valley, 1973.',133,3.59),(1000288,'Iron Man 3',2013,'Unleash the power behind the armor.','When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.',130,3.01),(1000289,'Incredibles 2',2018,'Back to work.','Elastigirl springs into action to save the day, while Mr. Incredible faces his greatest challenge yet – taking care of the problems of his three children.',118,3.44),(1000290,'The Royal Tenenbaums',2001,'Family Isn\'t A Word ... It\'s A Sentence.','Royal Tenenbaum and his wife Etheline had three children and then they separated. All three children are extraordinary --- all geniuses. Virtually all memory of the brilliance of the young Tenenbaums was subsequently erased by two decades of betrayal, failure, and disaster. Most of this was generally considered to be their father\'s fault. \"The Royal Tenenbaums\" is the story of the family\'s sudden, unexpected reunion one recent winter.',110,4.1),(1000291,'Suicide Squad',2016,'Worst Heroes Ever','From DC Comics comes the Suicide Squad, an antihero team of incarcerated supervillains who act as deniable assets for the United States government, undertaking high-risk black ops missions in exchange for commuted prison sentences.',122,2.06),(1000292,'Moana',2016,'The ocean is calling.','In Ancient Polynesia, when a terrible curse incurred by Maui reaches an impetuous Chieftain\'s daughter\'s island, she answers the Ocean\'s call to seek out the demigod to set things right.',107,3.71),(1000293,'Gladiator',2000,'A Hero Will Rise.','In the year 180, the death of emperor Marcus Aurelius throws the Roman Empire into chaos.  Maximus is one of the Roman army\'s most capable and trusted generals and a key advisor to the emperor.  As Marcus\' devious son Commodus ascends to the throne, Maximus is set to be executed.  He escapes, but is captured by slave traders.  Removie_named Spaniard and forced to become a gladiator, Maximus must battle to the death with other men for the amusement of paying audiences.',155,4.11),(1000294,'Sound of Metal',2019,'Music was his world. Then silence revealed a new one.','A drummer begins to lose his hearing and has to come to grips with a future that will be filled with silence.',120,4.19),(1000295,'Spider-Man 3',2007,'The battle within.','The seemingly invincible Spider-Man goes up against an all-new crop of villains—including the shape-shifting Sandman. While Spider-Man’s superpowers are altered by an alien organism, his alter ego, Peter Parker, deals with nemesis Eddie Brock and also gets caught up in a love triangle.',139,3.04),(1000296,'TÁR',2022,NULL,'The film, set in the international world of classical music, centers on Lydia Tár, widely considered one of the greatest living composer/conductors and first-ever female chief conductor of a major German orchestra.',158,3.95),(1000297,'Charlie and the Chocolate Factory',2005,'Prepare for a taste of adventure.','A young boy wins a tour through the most magnificent chocolate factory in the world, led by the world\'s most unusual candy maker.',115,3.22),(1000298,'Iron Man 2',2010,'It\'s not the armor that makes the hero, but the man inside.','With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press and the public to share his technology with the military. Unwilling to let go of his invention, Stark, with Pepper Potts and James \'Rhodey\' Rhodes at his side, must forge new alliances – and confront powerful enemies.',124,2.87),(1000299,'Thor',2011,'Two worlds. One hero.','Against his father Odin\'s will, The Mighty Thor - a powerful but arrogant warrior god - recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.',115,2.78),(1000300,'Toy Story 2',1999,'The toys are back!','Andy heads off to Cowboy Camp, leaving his toys to their own devices. Things shift into high gear when an obsessive toy collector movie_named Al McWhiggen, owner of Al\'s Toy Barn kidnaps Woody. Andy\'s toys mount a daring rescue mission, Buzz Lightyear meets his match and Woody has to decide where he and his heart truly belong.',92,3.93),(1000301,'tick, tick...BOOM!',2021,'How much time do we have to do something great?','On the cusp of his 30th birthday, a promising young theater composer navigates love, friendship, and the pressures to create something great before time runs out.',115,3.82),(1000302,'Big Hero 6',2014,NULL,'The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.',102,3.78),(1000303,'Frozen',2013,'Only the act of true love will thaw a frozen heart.','Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.',102,3.39),(1000304,'Die Hard',1988,'40 Stories. Twelve Terrorists. One Cop.','NYPD cop John McClane\'s plan to reconcile with his estranged wife is thrown for a serious loop when, movie_lengths after he arrives at her office, the entire building is overtaken by a group of terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.',132,4.07),(1000305,'The Killing of a Sacred Deer',2017,'What a charming boy.','Dr. Steven Murphy is a renowned cardiovascular surgeon who presides over a spotless household with his wife and two children. Lurking at the margins of his idyllic suburban existence is Martin, a fatherless teen who insinuates himself into the doctor\'s life in gradually unsettling ways.',121,3.74),(1000306,'Halloween',1978,'The Night He Came Home!','Fifteen years after murdering his sister on Halloween Night 1963, Michael Myers escapes from a mental hospital and returns to the small town of Haddonfield, Illinois to kill again.',91,3.8),(1000307,'Eternals',2021,'In the beginning...','The Eternals are a team of ancient aliens who have been living on Earth in secret for thousands of years. When an unexpected tragedy forces them out of the shadows, they are forced to reunite against mankind’s most ancient enemy, the Deviants.',156,2.74),(1000308,'The Hunger Games: Mockingjay – Part 1',2014,'Fire burns brighter in the darkness','Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.',123,3.21),(1000309,'The Irishman',2019,'His story changed history','Pennsylvania, 1956. Frank Sheeran, a war veteran of Irish origin who works as a truck driver, accidentally meets mobster Russell Bufalino. Once Frank becomes his trusted man, Bufalino sends him to Chicago with the task of helping Jimmy Hoffa, a powerful union leader related to organized crime, with whom Frank will maintain a close friendship for nearly twenty years.',209,3.91),(1000310,'The Conjuring',2013,'Based on the true case files of the Warrens','Paranormal investigators Ed and Lorraine Warren work to help a family terrorized by a dark presence in their farmhouse. Forced to confront a powerful entity, the Warrens find themselves caught in the most terrifying case of their lives.',112,3.57),(1000311,'Vertigo',1958,'Alfred Hitchcock engulfs you in a whirlpool of terror and tension!','A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend\'s wife, all the while becoming dangerously obsessed with her.',129,4.24),(1000312,'John Wick: Chapter 4',2023,'No way back, one way out.','With the price on his head ever increasing, John Wick uncovers a path to defeating The High Table. But before he can earn his freedom, Wick must face off against a new enemy with powerful alliances across the globe and forces that turn old friends into foes.',170,3.93),(1000313,'Legally Blonde',2001,'Don\'t judge a book by its hair color!','Elle Woods has it all. She\'s the president of her sorority, a Hawaiian Tropic girl, Miss June in her campus calendar, and, above all, a natural blonde. She movie_dates the cutest fraternity boy on campus and wants nothing more than to be Mrs. Warner Huntington III. But, there\'s just one thing stopping Warner from popping the question: Elle is too blonde.',96,3.78),(1000314,'Kingsman: The Secret Service',2014,'Manners maketh man.','The story of a super-secret spy organization that recruits an unrefined but promising street kid into the agency\'s ultra-competitive training program just as a global threat emerges from a twisted tech genius.',129,3.73),(1000315,'Promising Young Woman',2020,'Payback never looked so promising','A young woman haunted by a tragedy in her past takes revenge on the predatory men unlucky enough to cross her path.',113,3.67),(1000316,'Cars',2006,'Ahhh... it\'s got that new movie smell.','Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.',117,3.7),(1000317,'The Hangover',2009,'Some guys just can\'t handle Vegas.','When three friends finally come to after a raucous night of bachelor-party revelry, they find a baby in the closet and a tiger in the bathroom. But they can\'t seem to locate their best friend, Doug – who\'s supposed to be tying the knot. Launching a frantic search for Doug, the trio perseveres through a nasty hangover to try to make it to the church on time.',100,3.61),(1000318,'All Quiet on the Western Front',2022,NULL,'Paul Baumer and his friends Albert and Muller, egged on by romantic dreams of heroism, voluntarily enlist in the German army. Full of excitement and patriotic fervour, the boys enthusiastically march into a war they believe in. But once on the Western Front, they discover the soul-destroying horror of World War I.',147,3.99),(1000319,'City of God',2002,'If you run, you\'re dead... if you stay, you\'re dead again.','Buscapé was raised in a very violent environment. Despite the feeling that all odds were against him, he finds out that life can be seen with other eyes...',130,4.53),(1000320,'How to Train Your Dragon',2010,'One adventure will change two worlds','As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast – which he movie_names Toothless – much to the chagrin of his warrior father',98,4.02),(1000321,'mother!',2017,'Seeing is believing','A couple\'s relationship is tested when uninvited guests arrive at their home, disrupting their tranquil existence.',121,3.47),(1000322,'When Harry Met Sally...',1989,'Can two friends sleep together and still love each other in the morning?','During their travel from Chicago to New York, Harry and Sally debate whether or not sex ruins a friendship between a man and a woman. Eleven years later, and they\'re still no closer to finding the answer.',96,4.05),(1000323,'The Killer',2023,'Execution is everything.','After a fateful near-miss, an assassin battles his employers, and himself, on an international manhunt he insists isn\'t personal.',118,3.41),(1000324,'Crazy, Stupid, Love.',2011,'This is crazy. This is stupid. This is love.','Cal Weaver is living the American dream. He has a good job, a beautiful house, great children and a beautiful wife, movie_named Emily. Cal\'s seemingly perfect life unravels, however, when he learns that Emily has been unfaithful and wants a divorce. Over 40 and suddenly single, Cal is adrift in the fickle world of dating. Enter, Jacob Palmer, a self-styled player who takes Cal under his wing and teaches him how to be a hit with the ladies.',118,3.66),(1000325,'Pan\'s Labyrinth',2006,'What happens when make-believe believes it\'s real?','Living with her tyrannical stepfather in a new home with her pregnant mother, 10-year-old Ofelia feels alone until she explores a decaying labyrinth guarded by a mysterious faun who claims to know her destiny. If she wishes to return to her real father, Ofelia must complete three terrifying tasks.',118,4.16),(1000326,'Shaun of the Dead',2004,'A romantic comedy. With zombies.','Shaun lives a supremely uneventful life, which revolves around his girlfriend, his mother, and, above all, his local pub. This gentle routine is threatened when the dead return to life and make strenuous attempts to snack on ordinary Londoners.',99,3.97),(1000327,'May December',2023,'Some roles are transformative.','Twenty years after their notorious tabloid romance gripped the nation, a married couple buckles under pressure when an actress arrives to do research for a film about their past.',117,3.71),(1000328,'Ocean\'s Eleven',2001,'Are you in or out?','Less than 24 hours into his parole, charismatic thief Danny Ocean is already rolling out his next plan: In one night, Danny\'s hand-picked crew of specialists will attempt to steal more than $150 million from three Las Vegas casinos. But to score the cash, Danny risks his chances of reconciling with ex-wife, Tess.',116,3.89),(1000329,'E.T. the Extra-Terrestrial',1982,'He is afraid. He is alone. He is three million light years from home.','After a gentle alien becomes stranded on Earth, the being is discovered and befriended by a young boy movie_named Elliott. Bringing the extraterrestrial into his suburban California house, Elliott introduces E.T., as the alien is dubbed, to his brother and his little sister, Gertie, and the children decide to keep its existence a secret. Soon, however, E.T. falls ill, resulting in government intervention and a dire situation for both Elliott and the alien.',115,3.85),(1000330,'One Flew Over the Cuckoo\'s Nest',1975,'If he\'s crazy, what does that make you?','While serving time for insanity at a state mental hospital, implacable rabble-rouser, Randle Patrick McMurphy, inspires his fellow patients to rebel against the authoritarian rule of head nurse, Mildred Ratched.',133,4.36),(1000331,'Corpse Bride',2005,'There\'s been a grave misunderstanding.','Set in a 19th-century european village, this stop-motion animation feature follows the story of Victor, a young man whisked away to the underworld and wed to a mysterious corpse bride, while his real bride Victoria waits bereft in the land of the living.',77,3.81),(1000332,'The Sixth Sense',1999,'Not every gift is a blessing.','Following an unexpected tragedy, child psychologist Malcolm Crowe meets a nine year old boy movie_named Cole Sear, who is hiding a dark secret.',107,4.03),(1000333,'La Haine',1995,'How far you fall doesn\'t matter, it\'s how you land…','After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Saïd, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.',98,4.51),(1000334,'Cruella',2021,'Hello Cruel World','In 1970s London amidst the punk rock revolution, a young grifter movie_named Estella is determined to make a movie_name for herself with her designs. She befriends a pair of young thieves who appreciate her appetite for mischief, and together they are able to build a life for themselves on the London streets. One day, Estella’s flair for fashion catches the eye of the Baroness von Hellman, a fashion legend who is devastatingly chic and terrifyingly haute. But their relationship sets in motion a course of events and revelations that will cause Estella to embrace her wicked side and become the raucous, fashionable and revenge-bent Cruella.',134,3.44),(1000335,'The Black Phone',2021,'Never talk to strangers.','Finney Shaw, a shy but clever 13-year-old boy, is abducted by a sadistic killer and trapped in a soundproof basement where screaming is of little use. When a disconnected phone on the wall begins to ring, Finney discovers that he can hear the voices of the killer’s previous victims. And they are dead set on making sure that what happened to them doesn’t happen to Finney.',103,3.26),(1000336,'All of Us Strangers',2023,'All of us hurt. All of us hope. All of us love.','One night, screenwriter Adam, in his near-empty tower block in contemporary London, has a chance encounter with his mysterious neighbor Harry that punctures the rhythm of his everyday life. As Adam and Harry get closer, Adam is pulled back to his childhood home where he discovers that his long-dead parents are both living and look the same age as the day they died over 30 years ago.',106,3.94),(1000337,'The Exorcist',1973,'Something almost beyond comprehension is happening to a girl on this street, in this house… and a man has been sent for as a last resort. This man is The Exorcist.','12-year-old Regan MacNeil begins to adapt an explicit new personality as strange events befall the local area of Georgetown. Her mother becomes torn between science and superstition in a desperate bid to save her daughter, and ultimately turns to her last hope: Father Damien Karras, a troubled priest who is struggling with his own faith.',122,3.98),(1000338,'Kiki\'s Delivery Service',1989,'I was feeling blue, but I\'m better now.','A young witch, on her mandatory year of independent life, finds fitting into a new community difficult while she supports herself by running an air courier service.',103,4.13),(1000339,'A Star Is Born',2018,NULL,'Seasoned musician Jackson Maine discovers — and falls in love with — struggling artist Ally. She has just about given up on her dream to make it big as a singer — until Jack coaxes her into the spotlight. But even as Ally\'s career takes off, the personal side of their relationship is breaking down, as Jack fights an ongoing battle with his own internal demons.',136,3.61),(1000340,'The Big Short',2015,'This is a true story.','The men who made millions from a global economic meltdown.',131,3.82),(1000341,'Kung Fu Panda',2008,'Prepare for awesomeness.','When the Valley of Peace is threatened, lazy Po the panda discovers his destiny as the \"chosen one\" and trains to become a kung fu hero, but transforming the unsleek slacker into a brave warrior won\'t be easy. It\'s up to Master Shifu and the Furious Five -- Tigress, Crane, Mantis, Viper and Monkey -- to give it a try.',90,3.85),(1000342,'Annihilation',2018,'Fear what\'s inside.','A biologist signs up for a dangerous, secret expedition into a mysterious zone where the laws of nature don\'t apply.',115,3.57),(1000343,'Train to Busan',2016,'Life-or-death survival begins.','Martial law is declared when a mysterious viral outbreak pushes Korea into a state of emergency. Those on an express train to Busan, a city that has successfully fended off the viral outbreak, must fight for their own survival…',118,3.96),(1000344,'Manchester by the Sea',2016,NULL,'After his older brother passes away, Lee Chandler is forced to return home to care for his 16-year-old nephew. There he is compelled to deal with a tragic past that separated him from his family and the community where he was born and raised.',138,4.11),(1000345,'The Imitation Game',2014,'The true enigma was the man who cracked the code.','Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain\'s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.',113,3.8),(1000346,'The Hunger Games: Mockingjay – Part 2',2015,'The fire will burn forever.','With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.',137,3.29),(1000347,'Wonder Woman',2017,'Power. Grace. Wisdom. Wonder.','An Amazon princess comes to the world of Man in the grips of the First World War to confront the forces of evil and bring an end to human conflict.',141,3.27),(1000348,'Heat',1995,'A Los Angeles crime saga.','Obsessive master thief Neil McCauley leads a top-notch crew on various daring heists throughout Los Angeles while determined detective Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.',170,4.27),(1000349,'Ponyo',2008,'Welcome to a world where anything is possible.','The son of a sailor, 5-year old Sosuke lives a quiet life on an oceanside cliff with his mother Lisa. One fateful day, he finds a beautiful goldfish trapped in a bottle on the beach and upon rescuing her, movie_names her Ponyo. But she is no ordinary goldfish. The daughter of a masterful wizard and a sea goddess, Ponyo uses her father\'s magic to transform herself into a young girl and quickly falls in love with Sosuke, but the use of such powerful sorcery causes a dangerous imbalance in the world. As the moon steadily draws nearer to the earth and Ponyo\'s father sends the ocean\'s mighty waves to find his daughter, the two children embark on an adventure of a lifetime to save the world and fulfill Ponyo\'s dreams of becoming human.',100,4.06),(1000350,'Before Sunset',2004,'What if you had a second chance with the one that got away?','Nine years ago two strangers met by chance and spent a night in Vienna that ended before sunrise. They are about to meet for the first time since. Now they have one afternoon to find out if they belong together.',80,4.34),(1000351,'Full Metal Jacket',1987,'In Vietnam, the wind doesn\'t blow. It sucks.','A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.',117,4.2),(1000352,'Venom',2018,'The world has enough Superheroes.','Investigative journalist Eddie Brock attempts a comeback following a scandal, but accidentally becomes the host of Venom, a violent, super powerful alien symbiote. Soon, he must rely on his newfound powers to protect the world from a shadowy organization looking for a symbiote of their own.',112,2.84),(1000353,'Beetlejuice',1988,'He\'s guaranteed to put some life in your afterlife.','Thanks to an untimely demise via drowning, a young couple end up as poltergeists in their New England farmhouse, where they fail to meet the challenge of scaring away the insufferable new owners, who want to make drastic changes. In desperation, the undead newlyweds turn to an expert frightmeister, but he\'s got a diabolical agenda of his own.',92,3.77),(1000354,'The Amazing Spider-Man 2',2014,'No more secrets.','For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.',141,2.91),(1000355,'The Fabelmans',2022,'Capture every moment.','A coming-of-age story about a young man’s discovery of a shattering family secret and an exploration of the power of movies to help us see the truth about each other and ourselves.',151,4.01),(1000356,'Stand by Me',1986,'For some, it\'s the last real taste of innocence, and the first real taste of life.','After learning that a stranger has been accidentally killed near their rural homes, four Oregon boys decide to go see the body. On the way, Gordie Lachance, Vern Tessio, Chris Chambers and Teddy Duchamp encounter a mean junk man and a marsh full of leeches, as they also learn more about one another and their very different home lives. Just a lark at first, the boys\' adventure evolves into a defining event in their lives.',89,4.15),(1000357,'Chungking Express',1994,'What a difference a day makes','Two melancholic Hong Kong policemen fall in love: one with a mysterious underworld figure, the other with a beautiful and ethereal server at a late-night restaurant he frequents.',103,4.3),(1000358,'Civil War',2024,'Welcome to the frontline.','In the near future, a group of war journalists attempt to survive while reporting the truth as the United States stands on the brink of civil war.',109,3.65),(1000359,'13 Going on 30',2004,'For some, 13 feels like it was just yesterday. For Jenna, it was.','After total humiliation at her thirteenth birthday party, Jenna Rink wants to just hide until she\'s thirty. With a little magic, her wish is granted, but it turns out that being thirty isn\'t as always as awesome as she thought it would be!',98,3.57),(1000360,'Toy Story 4',2019,'Get Ready to Hit the Road','Woody has always been confident about his place in the world and that his priority is taking care of his kid, whether that\'s Andy or Bonnie. But when Bonnie adds a reluctant new toy called \"Forky\" to her room, a road trip adventure alongside old and new friends will show Woody how big the world can be for a toy.',100,3.42),(1000361,'Casablanca',1942,'They had a movie_date with fate in Casablanca!','In Casablanca, Morocco in December 1941, a cynical American expatriate meets a former lover, with unforeseen complications.',102,4.27),(1000362,'Easy A',2010,'A comedy about a good girl a small favor and a big rumor','Olive, an average high school student, sees her below-the-radar existence turn around overnight once she decides to use the school\'s gossip grapevine to advance her social standing. Now her classmates are turning against her and the school board is becoming concerned, including her favorite teacher and the distracted guidance counselor. With the support of her hilariously idiosyncratic parents and a little help from a long-time crush, Olive attempts to take on her notorious new identity and crush the rumor mill once and for all.',93,3.42),(1000363,'Free Guy',2021,'Life\'s too short to be a background character.','A bank teller called Guy realizes he is a background character in an open world video game called Free City that will soon go offline.',115,3.04),(1000364,'Fallen Angels',1995,NULL,'In this bifurcated crime narrative, a disillusioned hitman attempts to escape from his violent lifestyle against the wishes of his partner, who is infatuated with him, and an eccentric mute repeatedly encounters, then subsequently falls for a depressed woman looking for the prostitute who supposedly stole her ex-boyfriend\'s affections.',98,4.19),(1000365,'School of Rock',2003,'He just landed the gig of his life: 5th grade.','Fired from his band and hard up for cash, guitarist and vocalist Dewey Finn finagles his way into a job as a fifth-grade substitute teacher at a private school, where he secretly begins teaching his students the finer points of rock \'n\' roll. The school\'s hard-nosed principal is rightly suspicious of Finn\'s activities. But Finn\'s roommate remains in the dark about what he\'s doing.',110,3.76),(1000366,'Ant-Man and the Wasp',2018,'Real heroes. Not actual size.','Just when his time under house arrest is about to end, Scott Lang once again puts his freedom at risk to help Hope van Dyne and Dr. Hank Pym dive into the quantum realm and try to accomplish, against time and any chance of success, a very dangerous rescue mission.',119,2.89),(1000367,'Godzilla Minus One',2023,'Postwar Japan. From zero to minus.','In postwar Japan, a new terror rises. Will the devastated people be able to survive... let alone fight back?',125,4.12),(1000368,'The Green Mile',1999,'Miracles do happen.','A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cell block\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.',189,4.22),(1000369,'Memories of Murder',2003,'The worst of them will stay with you... forever','1986 Gyunggi Province. The body of a young woman is found brutally raped and murdered. Two months later, a series of rapes and murders commences under similar circumstances. And in a country that had never known such crimes, the dark whispers about a serial murderer grow louder. A special task force is set up in the area, with two local detectives Park Doo-Man and Jo Young-Goo joined by a detective from Seoul who requested to be assigned to the case.',131,4.41),(1000370,'John Wick: Chapter 2',2017,'Never stab the devil in the back.','John Wick is forced out of retirement by a former associate looking to seize control of a shadowy international assassins’ guild. Bound by a blood oath to aid him, Wick travels to Rome and does battle against some of the world’s most dangerous killers.',122,3.69),(1000371,'Good Time',2017,'Are you ready for a Good Time?','After a botched bank robbery lands his younger brother in prison, Connie Nikas embarks on a twisted odyssey through New York City\'s underworld to get his brother Nick out of jail.',102,4),(1000372,'Grave of the Fireflies',1988,NULL,'In the final months of World War II, 14-year-old Seita and his sister Setsuko are orphaned when their mother is killed during an air raid in Kobe, Japan. After a falling out with their aunt, they move into an abandoned bomb shelter. With no surviving relatives and their emergency rations depleted, Seita and Setsuko struggle to survive.',89,4.45),(1000373,'Three Billboards Outside Ebbing, Missouri',2017,NULL,'After seven months have passed without a culprit in her daughter\'s murder case, Mildred Hayes makes a bold move, painting three signs leading into her town with a controversial message directed at Bill Willoughby, the town\'s revered chief of police. When his second-in-command Officer Jason Dixon, an immature mother\'s boy with a penchant for violence, gets involved, the battle between Mildred and Ebbing\'s law enforcement is only exacerbated.',115,4.04),(1000374,'Ready Player One',2018,'A better reality awaits.','When the creator of a popular video game system dies, a virtual contest is created to compete for his fortune.',140,3.24),(1000375,'Top Gun',1986,'Up there with the best of the best.','For Lieutenant Pete \'Maverick\' Mitchell and his friend and co-pilot Nick \'Goose\' Bradshaw, being accepted into an elite training school for fighter pilots is a dream come true. But a tragedy, as well as personal demons, will threaten Pete\'s dreams of becoming an ace pilot.',110,3.37),(1000376,'Frances Ha',2012,NULL,'An aspiring dancer moves to New York City and becomes caught up in a whirlwind of flighty fair-weather friends, diminishing fortunes and career setbacks.',86,4.03),(1000377,'Palm Springs',2020,NULL,'When carefree Nyles and reluctant maid of honor Sarah have a chance encounter at a Palm Springs wedding, things get complicated as they are unable to escape the venue, themselves, or each other.',90,3.76),(1000378,'Silver Linings Playbook',2012,'Watch For The Signs','After spending eight months in a mental institution, a former teacher moves back in with his parents and tries to reconcile with his ex-wife.',122,3.68),(1000379,'Birds of Prey (and the Fantabulous Emancipation of One Harley Quinn)',2020,'Mind Over Mayhem','Harley Quinn joins forces with a singer, an assassin and a police detective to help a young girl who had a hit placed on her after she stole a rare diamond from a crime lord.',109,3.04),(1000380,'The Lego Movie',2014,'The story of a nobody who saved everybody.','An ordinary Lego mini-figure, mistakenly thought to be the extraordinary MasterBuilder, is recruited to join a quest to stop an evil Lego tyrant from gluing the universe together.',100,3.79),(1000381,'Smile',2022,'Once you see it, it’s too late.','After witnessing a bizarre, traumatic incident involving a patient, Dr. Rose Cotter starts experiencing frightening occurrences that she can\'t explain. As an overwhelming terror begins taking over her life, Rose must confront her troubling past in order to survive and escape her horrifying new reality.',115,2.82),(1000382,'Citizen Kane',1941,'Some called him a hero...others called him a heel.','Newspaper magnate Charles Foster Kane is taken from his mother as a boy and made the ward of a rich industrialist. As a result, every well-meaning, tyrannical or self-destructive move he makes for the rest of his life appears in some way to be a reaction to that deeply wounding event.',119,4.21),(1000383,'It Chapter Two',2019,'You\'ll Float Again','27 years after overcoming the malevolent supernatural entity Pennywise, the former members of the Losers\' Club, who have grown up and moved away from Derry, are brought back together by a devastating phone call.',169,2.88),(1000384,'Thor: The Dark World',2013,'Delve into the darkness','Thor fights to restore order across the cosmos… but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness. Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all.',112,2.22),(1000385,'Guillermo del Toro\'s Pinocchio',2022,'Love will give you life.','During the rise of fascism in Mussolini\'s Italy, a wooden boy brought magically to life struggles to live up to his father\'s expectations.',117,3.98),(1000386,'Zombieland',2009,'Nut up or shut up.','Columbus has made a habit of running from what scares him. Tallahassee doesn\'t have fears. If he did, he\'d kick their ever-living ass. In a world overrun by zombies, these two are perfectly evolved survivors. But now, they\'re about to stare down the most terrifying prospect of all: each other.',88,3.53),(1000387,'Ant-Man and the Wasp: Quantumania',2023,'Witness the beginning of a new dynasty.','Superhero duo Scott Lang and Hope Van Dyne, together with Hope\'s parents Hank Pym and Janet Van Dyne, find themselves exploring the Quantum Realm, interacting with strange new creatures, and embarking on an adventure that will push them beyond the limits of what they thought was possible.',125,2.26),(1000388,'Midnight in Paris',2011,NULL,'A romantic comedy about a family traveling to the French capital for business. The party includes a young engaged couple forced to confront the illusion that a life different from their own is better.',94,3.71),(1000389,'Akira',1988,'Neo-Tokyo is about to E.X.P.L.O.D.E.','A secret military project endangers Neo-Tokyo when it turns a biker gang member into a rampaging psychic psychopath that only two teenagers and a group of psychics can stop.',124,4.27),(1000390,'Scream',2022,'It\'s always someone you know.','Twenty-five years after a streak of brutal murders shocked the quiet town of Woodsboro, a new killer has donned the Ghostface mask and begins targeting a group of teenagers to resurrect secrets from the town’s deadly past.',114,3.21),(1000391,'Rear Window',1954,'It only takes one witness to spoil the perfect crime.','Professional photographer L.B. \'Jeff\' Jeffries breaks his leg while getting an action shot at an auto race. Confined to his New York apartment, he spends his time looking out of the rear window observing the neighbors. When he begins to suspect that a man across the courtyard may have murdered his wife, Jeff enlists the help of his high society fashion-consultant girlfriend and his visiting nurse to investigate.',115,4.38),(1000392,'Beau Is Afraid',2023,'From his darkest fears comes the greatest adventure.','A paranoid man embarks on an epic odyssey to get home to his mother.',179,3.44),(1000393,'Elemental',2023,'Opposites react.','In a city where fire, water, land, & air residents live together, a fiery young woman & a go-with-the-flow guy will discover something elemental: How much they have in common.',102,3.31),(1000394,'mid90s',2018,'fall. get back up.','Stevie is a sweet 13-year-old about to explode. His mom is loving and attentive, but a little too forthcoming about her romantic life. His big brother is a taciturn and violent bully. So Stevie searches his working-class Los Angeles suburb for somewhere to belong. He finds it at the Motor Avenue skate shop.',86,3.77),(1000395,'Ford v Ferrari',2019,'They took the American dream for a ride','American car designer Carroll Shelby and the British-born driver Ken Miles work together to battle corporate interference, the laws of physics, and their own personal demons to build a revolutionary race car for Ford Motor Company and take on the dominating race cars of Enzo Ferrari at the 24 Hours of Le Mans in France in 1966.',153,3.96),(1000396,'Scream VI',2023,'New York. New rules.','Following the latest Ghostface killings, the four survivors leave Woodsboro behind and start a fresh chapter in New York City.',123,3.39),(1000397,'John Wick: Chapter 3 – Parabellum',2019,'The Grace Period Is Over','Super-assassin John Wick returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin’s guild, the High Table, John Wick is excommunicado, but the world’s most ruthless hit men and women await his every turn.',131,3.68),(1000398,'The Princess Bride',1987,'It\'s as real as the feelings you feel.','In this enchantingly cracked fairy tale, the beautiful Princess Buttercup and the dashing Westley must overcome staggering odds to find happiness amid six-fingered swordsmen, murderous princes, Sicilians and rodents of unusual size. But even death can\'t stop these true lovebirds from triumphing.',99,4.05),(1000399,'Love Actually',2003,'The ultimate romantic comedy.','Follows seemingly unrelated people as their lives begin to intertwine while they fall in – and out – of love. Affections languish and develop as Christmas draws near.',135,3.45),(1000400,'Ready or Not',2019,'In-laws can be murder.','A bride\'s wedding night takes a sinister turn when her eccentric new in-laws force her to take part in a terrifying game.',95,3.54),(1000401,'Green Book',2018,'Inspired by a True Friendship','Tony Lip, a bouncer in 1962, is hired to drive pianist Don Shirley on a tour through the Deep South in the days when African Americans, forced to find alternate accommodations and services due to segregation laws below the Mason-Dixon Line, relied on a guide called The Negro Motorist Green Book.',130,3.72),(1000402,'The Queen\'s Gambit',2020,NULL,'In a Kentucky orphanage in the 1950s, a young girl discovers an astonishing talent for chess while struggling with addiction.',393,4.23),(1000403,'Minari',2020,NULL,'A Korean American family moves to an Arkansas farm in search of its own American dream. Amidst the challenges of this new life in the strange and rugged Ozarks, they discover the undeniable resilience of family and what really makes a home.',115,4.09),(1000404,'Carrie',1976,'If you\'ve got a taste for terror… take Carrie to the prom.','Carrie White, a shy and troubled teenage girl who is tormented by her high school peers and her fanatically religious mother, begins to use her powers of telekinesis to exact revenge upon them.',98,3.85),(1000405,'Leave the World Behind',2023,'There\'s no going back to normal.','A family\'s getaway to a luxurious rental home takes an ominous turn when a cyberattack knocks out their devices — and two strangers appear at their door.',142,2.86),(1000406,'Hot Fuzz',2007,'Big cops. Small town. Moderate violence.','As a former London constable, Nicholas Angel finds it difficult to adapt to his new assignment in the sleepy British village of Sandford. Not only does he miss the excitement of the big city, but he also has a well-meaning oaf for a partner. However, when a series of grisly accidents rocks Sandford, Angel smells something rotten in the idyllic village.',121,4.08),(1000407,'Snowpiercer',2013,'AD 2031, the passengers in the train are the only survivors on Earth.','In a future where a failed global-warming experiment kills off most life on the planet, a class system evolves aboard the Snowpiercer, a train that travels around the globe via a perpetual-motion engine.',127,3.69),(1000408,'Mulan',1998,'Let\'s get down to business, to defeat the Huns','A tomboyish girl disguises herself as a young man so she can fight with the Imperial Chinese Army against the invading Huns. With help from wise-cracking dragon Mushu, Mulan just might save her country -- and win the heart of handsome Captain Li Shang.',88,4.09),(1000409,'Saw',2004,'Live or die. Make your choice.','Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer abducts the morally wayward. Once captured, they must face impossible choices in a horrific game of survival. The victims must fight to win their lives back, or die trying...',103,3.62),(1000410,'M3GAN',2022,'Friendship has evolved.','A brilliant toy company roboticist uses artificial intelligence to develop M3GAN, a life-like doll programmed to emotionally bond with her newly orphaned niece. But when the doll\'s programming works too well, she becomes overprotective of her new friend with terrifying results.',102,2.81),(1000411,'Room',2015,'Love knows no boundaries','Jack is a young boy of 5 years old who has lived all his life in one room. He believes everything within it are the only real things in the world. But what will happen when his Ma suddenly tells him that there are other things outside of Room?',118,3.97),(1000412,'V for Vendetta',2005,'People should not be afraid of their governments. Governments should be afraid of their people.','In a world in which Great Britain has become a fascist state, a masked vigilante known only as “V” conducts guerrilla warfare against the oppressive British government. When V rescues a young woman from the secret police, he finds in her an ally with whom he can continue his fight to free the people of Britain.',132,3.84),(1000413,'21 Jump Street',2012,'They thought the streets were mean. Then they went back to high school.','In high school, Schmidt was a dork and Jenko was the popular jock. After graduation, both of them joined the police force and ended up as partners riding bicycles in the city park. Since they are young and look like high school students, they are assigned to an undercover unit to infiltrate a drug ring that is supplying high school students synthetic drugs.',109,3.58),(1000414,'The Texas Chain Saw Massacre',1974,'Who will survive and what will be left of them?','When Sally hears that her grandfather\'s grave may have been vandalized, she and her paraplegic brother, Franklin, set out with their friends to investigate. After a detour to their family\'s old farmhouse, they discover a group of crazed, murderous outcasts living next door. As the group is attacked one by one by the chainsaw-wielding Leatherface, who wears a mask of human skin, the survivors must do everything they can to escape.',83,3.84),(1000415,'Shiva Baby',2020,'Death, Family Style.','A college student attends a family shiva where she is accosted by her relatives, outshined by her ex-girlfriend, and face-to-face with her sugar daddy and his family.',78,3.85),(1000416,'Pitch Perfect',2012,'Get pitch slapped.','College student Beca knows she does not want to be part of a clique, but that\'s exactly where she finds herself after arriving at her new school. Thrust in among mean gals, nice gals and just plain weird gals, Beca finds that the only thing they have in common is how well they sing together. She takes the women of the group out of their comfort zone of traditional arrangements and into a world of amazing harmonic combinations in a fight to the top of college music competitions.',112,3.48),(1000417,'A Quiet Place Part II',2020,'Silence is not enough.','Following the events at home, the Abbott family now face the terrors of the outside world. Forced to venture into the unknown, they realize that the creatures that hunt by sound are not the only threats that lurk beyond the sand path.',96,3.44),(1000418,'Notting Hill',1999,'Can the most famous film star in the world fall for the man on the street?','William Thacker is a London bookstore owner whose humdrum existence is thrown into romantic turmoil when famous American actress Anna Scott appears in his shop. A chance encounter over spilled orange juice leads to a kiss that blossoms into a full-blown affair. As the average bloke and glamorous movie star draw closer and closer together, they struggle to reconcile their radically different lifestyles in the movie_name of love.',124,3.63),(1000419,'Children of Men',2006,'The future\'s a thing of the past.','In 2027, in a chaotic world in which humans can no longer procreate, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea, where her child\'s birth may help scientists save the future of humankind.',109,4.3),(1000420,'The Green Knight',2021,'When honor was everything.','An epic fantasy adventure based on the timeless Arthurian legend, The Green Knight tells the story of Sir Gawain, King Arthur\'s reckless and headstrong nephew, who embarks on a daring quest to confront the eponymous Green Knight, a gigantic emerald-skinned stranger and tester of men.',130,3.69),(1000421,'How to Lose a Guy in 10 Days',2003,'One of them is lying. So is the other.','An advice columnist, Andie Anderson, tries pushing the boundaries of what she can write about in her new piece about how to get a man to leave you in 10 days. Her editor, Lana, loves it, and Andie goes off to find a man she can use for the experiment. Enter executive Ben Berry, who is so confident in his romantic prowess that he thinks he can make any woman fall in love with him in 10 days. When Andie and Ben meet, their plans backfire.',116,3.59),(1000422,'Blue Velvet',1986,'It’s a strange world.','The discovery of a severed human ear found in a field leads a young man on an investigation related to a beautiful, mysterious nightclub singer and a group of criminals who have kidnapped her child.',120,4.09),(1000423,'No Time to Die',2021,'The mission that changes everything begins…','Bond has left active service and is enjoying a tranquil life in Jamaica. His peace is short-lived when his old friend Felix Leiter from the CIA turns up asking for help. The mission to rescue a kidnapped scientist turns out to be far more treacherous than expected, leading Bond onto the trail of a mysterious villain armed with dangerous new technology.',163,3.5),(1000424,'The Curious Case of Benjamin Button',2008,'Life isn\'t measured in movie_lengths, but in moments.','Born under unusual circumstances, Benjamin Button springs into being as an elderly man in a New Orleans nursing home and ages in reverse. Twelve years after his birth, he meets Daisy, a child who flits in and out of his life as she grows up to be a dancer. Though he has all sorts of unusual adventures over the course of his life, it is his relationship with Daisy, and the hope that they will come together at the right time, that drives Benjamin forward.',166,3.62),(1000425,'Nomadland',2020,'See you down the road.','A woman in her sixties embarks on a journey through the western United States after losing everything in the Great Recession, living as a van-dwelling modern-day nomad.',108,3.83),(1000426,'Sicario',2015,'The border is just another line to cross.','An idealistic FBI agent is enlisted by a government task force to aid in the escalating war against drugs at the border area between the U.S. and Mexico.',122,3.97),(1000427,'The Rocky Horror Picture Show',1975,'A different set of jaws','Sweethearts Brad and Janet, stuck with a flat tire during a storm, discover the eerie mansion of Dr. Frank-N-Furter, a transvestite scientist. As their innocence is lost, Brad and Janet meet a houseful of wild characters, including a rocking biker and a creepy butler. Through elaborate dances and rock songs, Frank-N-Furter unveils his latest creation: a muscular man movie_named \'Rocky\'.',100,4),(1000428,'Phantom Thread',2017,'Whatever you do, do it carefully.','In 1950s London, renowned British dressmaker Reynolds Woodcock comes across Alma, a young, strong-willed woman, who soon becomes ever present in his life as his muse and lover.',130,4.14),(1000429,'Gravity',2013,'Don\'t Let Go','Dr. Ryan Stone, a brilliant medical engineer on her first Shuttle mission, with veteran astronaut Matt Kowalsky in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The Shuttle is destroyed, leaving Stone and Kowalsky completely alone-tethered to nothing but each other and spiraling out into the blackness of space. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of air eats away at what little oxygen is left. But the only way home may be to go further out into the terrifying expanse of space.',91,3.5),(1000430,'Pretty Woman',1990,'Who knew it was so much fun to be a hooker?','When a millionaire wheeler-dealer enters a business contract with a Hollywood hooker Vivian Ward, he loses his heart in the bargain.',119,3.62),(1000431,'Carol',2015,'Some people change your life forever.','In 1950s New York, a department-store clerk who dreams of a better life falls for an older, married woman.',118,4.01),(1000432,'Come and See',1985,NULL,'The invasion of a village in Byelorussia by German forces sends young Florya into the forest to join the weary Resistance fighters, against his family\'s wishes. There he meets a girl, Glasha, who accompanies him back to his village. On returning home, Florya finds his family and fellow peasants massacred. His continued survival amidst the brutal debris of war becomes increasingly nightmarish, a battle between despair and hope.',142,4.64),(1000433,'Bird Box',2018,'Never Lose Sight Of Survival','Five years after an ominous unseen presence drives most of society to suicide, a survivor and her two children make a desperate bid to reach safety.',124,2.86),(1000434,'Fantastic Beasts and Where to Find Them',2016,'From J.K. Rowling\'s wizarding world.','In 1926, Newt Scamander arrives at the Magical Congress of the United States of America with a magically expanded briefcase, which houses a number of dangerous creatures and their habitats. When the creatures escape from the briefcase, it sends the American wizarding authorities after Newt, and threatens to strain even further the state of magical and non-magical relations.',132,3.13),(1000435,'Mission: Impossible – Dead Reckoning Part One',2023,'We all share the same fate.','Ethan Hunt and his IMF team embark on their most dangerous mission yet: To track down a terrifying new weapon that threatens all of humanity before it falls into the wrong hands. With control of the future and the fate of the world at stake, and dark forces from Ethan\'s past closing in, a deadly race around the globe begins. Confronted by a mysterious, all-powerful enemy, Ethan is forced to consider that nothing can matter more than his mission – not even the lives of those he cares about most.',164,3.74),(1000436,'It Follows',2014,'It doesn\'t think, it doesn\'t feel, it doesn\'t give up','After carefree teenager Jay  sleeps with her new boyfriend, Hugh, for the first time, she learns that she is the latest recipient of a fatal curse that is passed from victim to victim via sexual intercourse. Death, Jay learns, will creep inexorably toward her as either a friend or a stranger. Jay\'s friends don\'t believe her seemingly paranoid ravings, until they too begin to see the phantom assassins and band together to help her flee or defend herself.',101,3.48),(1000437,'Boyhood',2014,'12 years in the making.','The film tells a story of a divorced couple trying to raise their young son. The story follows the boy for twelve years, from first grade at age 6 through 12th grade at age 17-18, and examines his relationship with his parents as he grows.',166,3.83),(1000438,'Dungeons & Dragons: Honor Among Thieves',2023,'No experience necessary.','A charming thief and a band of unlikely adventurers undertake an epic heist to retrieve a lost relic, but things go dangerously awry when they run afoul of the wrong people.',134,3.52),(1000439,'Evil Dead Rise',2023,'Mommy loves you to death.','Three siblings find an ancient vinyl that gives birth to bloodthirsty demons that run amok in a Los Angeles apartment building and thrusts them into a primal battle for survival as they face the most nightmarish version of family imaginable.',96,3.18),(1000440,'The Edge of Seventeen',2016,'You\'re only young once… is it over yet?','Two high school girls are best friends until one movie_dates the other\'s older brother, who is totally his sister\'s nemesis.',105,3.52),(1000441,'I\'m Thinking of Ending Things',2020,NULL,'Nothing is as it seems when a woman experiencing misgivings about her new boyfriend joins him on a road trip to meet his parents at their remote farm.',135,3.48),(1000442,'Suspiria',1977,'The Most Frightening Film You\'ll Ever See!','From the moment she arrives in Freiberg, Germany, to attend the prestigious Tanz Academy, American ballet-dancer Suzy Bannion senses that something horribly evil lurks within the walls of the age-old institution.',99,3.95),(1000443,'Another Round',2020,NULL,'Four high school teachers launch a drinking experiment: upholding a constant low level of intoxication.',117,4.08),(1000444,'Jurassic World',2015,'The park is open.','Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.',124,3.02),(1000445,'The Good, the Bad and the Ugly',1966,'For three men the Civil War wasn\'t hell. It was practice.','While the Civil War rages on between the Union and the Confederacy, three men – a quiet loner, a ruthless hitman, and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.',161,4.5),(1000446,'Skyfall',2012,'Think on your sins.','When Bond\'s latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory, the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve - following a trail to the mysterious Silva, whose lethal and hidden motives have yet to reveal themselves.',143,3.9),(1000447,'Marie Antoinette',2006,'Rumor. Scandal. Fame. Revolution.','The retelling of France\'s iconic but ill-fated queen, Marie Antoinette. From her betrothal and marriage to Louis XVI at 15 to her reign as queen at 19 and ultimately the fall of Versailles.',123,3.73),(1000448,'Wreck-It Ralph',2012,'The story of a regular guy just looking for a little wreck-ognition.','Wreck-It Ralph is the 9-foot-tall, 643-pound villain of an arcade video game movie_named Fix-It Felix Jr., in which the game\'s titular hero fixes buildings that Ralph destroys. Wanting to prove he can be a good guy and not just a villain, Ralph escapes his game and lands in Hero\'s Duty, a first-person shooter where he helps the game\'s hero battle against alien invaders. He later enters Sugar Rush, a kart racing game set on tracks made of candies, cookies and other sweets. There, Ralph meets Vanellope von Schweetz who has learned that her game is faced with a dire threat that could affect the entire arcade, and one that Ralph may have inadvertently started.',101,3.58),(1000449,'Brave',2012,'Change your fate.','Brave is set in the mystical Scottish Highlands, where Mérida is the princess of a kingdom ruled by King Fergus and Queen Elinor. An unruly daughter and an accomplished archer, Mérida one day defies a sacred custom of the land and inadvertently brings turmoil to the kingdom. In an attempt to set things right, Mérida seeks out an eccentric old Wise Woman and is granted an ill-fated wish. Also figuring into Mérida’s quest — and serving as comic relief — are the kingdom’s three lords: the enormous Lord MacGuffin, the surly Lord Macintosh, and the disagreeable Lord Dingwall.',93,3.35),(1000450,'Punch-Drunk Love',2002,'You can go to places in the world with pudding.','A socially awkward and volatile small business owner meets the love of his life after being threatened by a gang of scammers.',96,3.99),(1000451,'Rocky',1976,'His whole life was a million-to-one shot.','When world heavyweight boxing champion, Apollo Creed wants to give an unknown fighter a shot at the title as a publicity stunt, his handlers choose palooka Rocky Balboa, an uneducated collector for a Philadelphia loan shark. Rocky teams up with trainer  Mickey Goldmill to make the most of this once in a lifetime break.',120,4.08),(1000452,'Ghostbusters',1984,'They ain\'t afraid of no ghost.','After losing their academic posts at a prestigious university, a team of parapsychologists goes into business as proton-pack-toting \"ghostbusters\" who exterminate ghouls, hobgoblins and supernatural pests of all stripes. An ad campaign pays off when a knockout cellist hires the squad to purge her swanky digs of demons that appear to be living in her refrigerator.',107,3.76),(1000453,'Ocean\'s Eight',2018,'Every con has its pros','Debbie Ocean, a criminal mastermind, gathers a crew of female thieves to pull off the heist of the century at New York\'s annual Met Gala.',111,3.29),(1000454,'Suspiria',2018,'Give your soul to the dance.','A darkness swirls at the center of a world-renowned dance company, one that will engulf the troupe\'s artistic director, an ambitious young dancer and a grieving psychotherapist. Some will succumb to the nightmare, others will finally wake up.',152,3.74),(1000455,'Squid Game',2021,'45,6 Billion Won Is Child\'s Play','Hundreds of cash-strapped players accept a strange invitation to compete in children\'s games. Inside, a tempting prize awaits — with deadly high stakes.',495,3.73),(1000456,'American Fiction',2023,NULL,'Thelonious “Monk” Ellison\'s writing career has stalled because his work isn’t deemed “Black enough.” Monk, a writer and English professor, writes a satirical novel under a pseudonym, aiming to expose the publishing world\'s hypocrisies. The book’s immediate success forces him to get deeper enmeshed in his assumed identity and challenges his closely-held worldviews.',117,3.72),(1000457,'12 Years a Slave',2013,'The extraordinary true story of Solomon Northup','In the pre-Civil War United States, Solomon Northup, a free black man from upstate New York, is abducted and sold into slavery. Facing cruelty as well as unexpected kindnesses Solomon struggles not only to stay alive, but to retain his dignity. In the twelfth year of his unforgettable odyssey, Solomon’s chance meeting with a Canadian abolitionist will forever alter his life.',134,4.14),(1000458,'Terminator 2: Judgment Day',1991,'It\'s nothing personal.','Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.',137,4.28),(1000459,'The Terminator',1984,'Your future is in his hands.','In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the \"Terminator\" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?',108,3.89),(1000460,'The Greatest Showman',2017,'The Impossible Comes True','The story of American showman P.T. Barnum, founder of the circus that became the famous traveling Ringling Bros. and Barnum & Bailey Circus.',105,3.37),(1000461,'Rise of the Planet of the Apes',2011,'Evolution Becomes Revolution.','Scientist Will Rodman is determined to find a cure for Alzheimer\'s, the disease which has slowly consumed his father. Will feels certain he is close to a breakthrough and tests his latest serum on apes, noticing dramatic increases in intelligence and brain activity in the primate subjects – especially Caesar, his pet chimpanzee.',105,3.63),(1000462,'Paris, Texas',1984,'A place for dreams. A place for heartbreak. A place to pick up the pieces.','A man wanders out of the desert not knowing who he is. His brother finds him, and helps to pull his memory back of the life he led before he walked out on his family and disappeared four years earlier.',145,4.4),(1000463,'Grease',1978,'HE WAS IN GREASE','Australian good girl Sandy and greaser Danny fell in love over the summer. But when they unexpectedly discover they\'re now in the same high school, will they be able to rekindle their romance despite their eccentric friends?',110,3.49),(1000464,'The Fall Guy',2024,'Fall hard.','Fresh off an almost career-ending accident, stuntman Colt Seavers has to track down a missing movie star, solve a conspiracy and try to win back the love of his life while still doing his day job.',126,3.5),(1000465,'Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb',1964,'The hot-line suspense comedy.','After the insane General Jack D. Ripper initiates a nuclear strike on the Soviet Union, a war room full of politicians, generals and a Russian diplomat all frantically try to stop the nuclear strike.',95,4.3),(1000466,'What We Do in the Shadows',2014,'Some interviews with some vampires','Vampire housemates try to cope with the complexities of modern life and show a newly turned hipster some of the perks of being undead.',86,4.12),(1000467,'The Cabin in the Woods',2011,'You think you know the story.','Five college friends spend the weekend at a remote cabin in the woods, where they get more than they bargained for. Together, they must discover the truth behind the cabin in the woods.',95,3.41),(1000468,'Groundhog Day',1993,'He’s having the worst day of his life … over, and over …','A narcissistic T.V. weatherman, along with his attractive-but-distant producer and mawkish cameraman, is sent to report on Groundhog Day in the small town of Punxsutawney, where he finds himself repeating the same day over and over.',101,3.83),(1000469,'Crazy Rich Asians',2018,'The only thing crazier than love is family','An American-born Chinese economics professor accompanies her boyfriend to Singapore for his best friend\'s wedding, only to get thrust into the lives of Asia\'s rich and famous.',121,3.48),(1000470,'Back to the Future Part II',1989,'Roads? Where we\'re going, we don\'t need roads!','Marty and Doc are at it again in this wacky sequel to the 1985 blockbuster as the time-traveling duo head to 2015 to nip some McFly family woes in the bud. But things go awry thanks to bully Biff Tannen and a pesky sports almanac. In a last-ditch attempt to set things straight, Marty finds himself bound for 1955 and face to face with his teenage parents -- again.',108,3.87),(1000471,'The Princess Diaries',2001,'She rocks. She rules. She reigns.','A socially awkward but very bright 15-year-old girl being raised by a single mom discovers that she is the princess of a small European country because of the recent death of her long-absent father, who, unknown to her, was the crown prince of Genovia. She must make a choice between continuing the life of a San Francisco teen or stepping up to the throne.',115,3.64),(1000472,'Pirates of the Caribbean: Dead Man\'s Chest',2006,'Jack is back!','Captain Jack Sparrow works his way out of a blood debt with the ghostly Davey Jones, he also attempts to avoid eternal damnation.',151,3.62),(1000473,'The Usual Suspects',1995,'Five Criminals. One Line Up. No Coincidence.','Held in an L.A. interrogation room, Verbal Kint attempts to convince the feds that a mythic crime lord, Keyser Soze, not only exists, but was also responsible for drawing him and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro harbor – leaving few survivors. Verbal lures his interrogators with an incredible story of the crime lord\'s almost supernatural prowess.',106,4.06),(1000474,'Mean Girls',2024,'Plastic is forever.','New student Cady Heron is welcomed into the top of the social food chain by the elite group of popular girls called ‘The Plastics,’ ruled by the conniving queen bee Regina George and her minions Gretchen and Karen. However, when Cady makes the major misstep of falling for Regina’s ex-boyfriend Aaron Samuels, she finds herself prey in Regina’s crosshairs. As Cady sets to take down the group’s apex predator with the help of her outcast friends Janis and Damian, she must learn how to stay true to herself while navigating the most cutthroat jungle of all: high school.',113,2.69),(1000475,'Boogie Nights',1997,'The life of a dreamer, the days of a business, and the nights in between.','Set in 1977, back when sex was safe, pleasure was a business and business was booming, idealistic porn producer Jack Horner aspires to elevate his craft to an art form. Horner discovers Eddie Adams, a hot young talent working as a busboy in a nightclub, and welcomes him into the extended family of movie-makers, misfits and hangers-on that are always around. Adams\' rise from nobody to a celebrity adult entertainer is meteoric, and soon the whole world seems to know his porn alter ego, \"Dirk Diggler\". Now, when disco and drugs are in vogue, fashion is in flux and the party never seems to stop, Adams\' dreams of turning sex into stardom are about to collide with cold, hard reality.',156,4.21),(1000476,'Fresh',2022,'It’s not for everyone.','Frustrated by scrolling dating apps only to end up on lame, tedious movie_dates, Noa takes a chance by giving her number to the awkwardly charming Steve after a produce-section meet-cute at the grocery store.',114,3.4),(1000477,'Life of Pi',2012,'Believe The Unbelievable','The story of an Indian boy movie_named Pi, a zookeeper\'s son who finds himself in the company of a hyena, zebra, orangutan, and a Bengal tiger after a shipwreck sets them adrift in the Pacific Ocean.',127,3.72),(1000478,'The Power of the Dog',2021,NULL,'Charismatic rancher Phil Burbank inspires fear and awe in those around him. When his brother brings home a new wife and her son, Phil torments them until he finds himself exposed to the possibility of love.',126,3.67),(1000479,'Finding Dory',2016,'An unforgettable journey she probably won\'t remember.','Dory is reunited with her friends Nemo and Marlin in the search for answers about her past. What can she remember? Who are her parents? And where did she learn to speak Whale?',97,3.25),(1000480,'Furiosa: A Mad Max Saga',2024,'Fury is born.','As the world fell, young Furiosa is snatched from the Green Place of Many Mothers and falls into the hands of a great Biker Horde led by the Warlord Dementus. Sweeping through the Wasteland they come across the Citadel presided over by The Immortan Joe. While the two Tyrants war for dominance, Furiosa must survive many trials as she puts together the means to find her way home.',149,3.93),(1000481,'Now You See Me',2013,'4 amazing magicians. 3 impossible heists. 1 billion dollars. This is no illusion.','An FBI agent and an Interpol detective track a team of illusionists who pull off bank heists during their performances and reward their audiences with the money.',116,3.32),(1000482,'Alice in Wonderland',2010,'You\'re invited to a very important movie_date','Alice, an unpretentious and individual 19-year-old, is betrothed to a dunce of an English nobleman. At her engagement party, she escapes the crowd to consider whether to go through with the marriage and falls down a hole in the garden after spotting an unusual rabbit. Arriving in a strange and surreal place called \'Underland,\' she finds herself in a world that resembles the nightmares she had as a child, filled with talking animals, villainous queens and knights, and frumious bandersnatches. Alice realizes that she is there for a reason – to conquer the horrific Jabberwocky and restore the rightful queen to her throne.',108,3.08),(1000483,'Almost Famous',2000,'Experience it. Enjoy it. Just don\'t fall for it.','In 1973, 15-year-old William Miller\'s unabashed love of music and aspiration to become a rock journalist lands him an assignment from Rolling Stone magazine to interview and tour with the up-and-coming band, Stillwater.',124,4.04),(1000484,'Elf',2003,'This holiday, discover your inner elf.','When young Buddy falls into Santa\'s gift sack on Christmas Eve, he\'s transported back to the North Pole and raised as a toy-making elf by Santa\'s helpers. But as he grows into adulthood, he can\'t shake the nagging feeling that he doesn\'t belong. Buddy vows to visit Manhattan and find his real dad, a workaholic publisher.',97,3.43),(1000485,'Magnolia',1999,'Things fall down. People look up. And when it rains, it pours.','An epic mosaic of many interrelated characters in search of happiness, forgiveness, and meaning in the San Fernando Valley.',189,4.22),(1000486,'The Invisible Man',2020,'What You Can\'t See Can Hurt You','When Cecilia\'s abusive ex takes his own life and leaves her his fortune, she suspects his death was a hoax. As a series of coincidences turn lethal, Cecilia works to prove that she is being hunted by someone nobody can see.',124,3.43),(1000487,'Perfect Days',2023,NULL,'Hirayama seems utterly content with his simple life as a cleaner of toilets in Tokyo. Outside of his very structured everyday routine he enjoys his passion for music and for books. And he loves trees and takes photos of them. A series of unexpected encounters gradually reveal more of his past.',124,4.26),(1000488,'Hacksaw Ridge',2016,'One of the greatest heroes in American history never fired a bullet.','WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people and becomes the first Conscientious Objector in American history to receive the Congressional Medal of Honor.',14,3.9),(1000489,'The Blair Witch Project',1999,'THE SCARIEST MOVIE OF ALL TIME IS A TRUE STORy.','In October of 1994 three student filmmakers disappeared in the woods near Burkittsville, Maryland, while shooting a documentary. A year later their footage was found.',81,3.31),(1000490,'Casino Royale',2006,'Everyone has a past. Every legend has a beginning.','Le Chiffre, a banker to the world\'s terrorists, is scheduled to participate in a high-stakes poker game in Montenegro, where he intends to use his winnings to establish his financial grip on the terrorist market. M sends Bond—on his maiden mission as a 00 Agent—to attend this game and prevent Le Chiffre from winning. With the help of Vesper Lynd and Felix Leiter, Bond enters the most important poker game in his already dangerous career.',144,4.01),(1000491,'Heathers',1989,'Best friends, social trends, and occasional murder.','A girl who halfheartedly tries to be part of the \"in crowd\" of her school meets a rebel who teaches her a more devious way to play social politics: by killing the popular kids.',103,3.76),(1000492,'It\'s a Wonderful Life',1946,'It\'s a wonderful laugh! It\'s a wonderful love!','A holiday favourite for generations...  George Bailey has spent his entire life giving to the people of Bedford Falls.  All that prevents rich skinflint Mr. Potter from taking over the entire town is George\'s modest building and loan company.  But on Christmas Eve the business\'s $8,000 is lost and George\'s troubles begin.',130,4.39),(1000493,'Monkey Man',2024,'One small ember can burn down everything.','Kid is an anonymous young man who ekes out a meager living in an underground fight club where, night after night, wearing a gorilla mask, he is beaten bloody by more popular fighters for cash. After years of suppressed rage, Kid discovers a way to infiltrate the enclave of the city’s sinister elite. As his childhood trauma boils over, his mysteriously scarred hands unleash an explosive campaign of retribution to settle the score with the men who took everything from him.',121,3.76),(1000494,'Aladdin',1992,'Wish granted!','Princess Jasmine grows tired of being forced to remain in the palace, so she sneaks out into the marketplace, in disguise, where she meets street-urchin Aladdin.  The couple falls in love, although Jasmine may only marry a prince.  After being thrown in jail, Aladdin becomes embroiled in a plot to find a mysterious lamp, with which the evil Jafar hopes to rule the land.',95,3.88),(1000495,'A Nightmare on Elm Street',1984,'If Nancy Doesn\'t Wake Up Screaming, She Won\'t Wake Up At All!','Teenagers in a small town are dropping like flies, apparently in the grip of mass hysteria causing their suicides. A cop\'s daughter, Nancy Thompson, traces the cause to child molester Fred Krueger, who was burned alive by angry parents many years before. Krueger has now come back in the dreams of his killers\' children, claiming their lives as his revenge. Nancy and her boyfriend, Glen, must devise a plan to lure the monster out of the realm of nightmares and into the real world...',91,3.73),(1000496,'Aliens',1986,'This Time It\'s War','When Ripley\'s lifepod is found by a salvage crew over 50 years later, she finds that terra-formers are on the very planet they found the alien species. When the company sends a family of colonists out to investigate her story—all contact is lost with the planet and colonists. They enlist Ripley and the colonial marines to return and search for answers.',137,4.15),(1000497,'Rosemary\'s Baby',1968,'Pray for Rosemary\'s Baby','A young couple moves into an infamous New York apartment building to start a family. Things become frightening as Rosemary begins to suspect her unborn baby isn’t safe around their strange neighbors.',138,4.21),(1000498,'Indiana Jones and the Last Crusade',1989,'The man with the hat is back. And this time, he\'s bringing his Dad.','When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana must team up with Marcus Brody, Sallah and Elsa Schneider to follow in his father\'s footsteps and stop the Nazis from recovering the power of eternal life.',127,4.09),(1000499,'The Hobbit: An Unexpected Journey',2012,'From the smallest beginnings come the greatest legends.','Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.',169,3.46),(1000500,'Mr. & Mrs. Smith',2005,'Smart and sexy.','After five (or six) years of vanilla-wedded bliss, ordinary suburbanites John and Jane Smith are stuck in a huge rut. Unbeknownst to each other, they are both coolly lethal, highly-paid assassins working for rival organisations. When they discover they\'re each other\'s next target, their secret lives collide in a spicy, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry.',119,3.19),(1000501,'Monsters University',2013,'School never looked this scary.','A look at the relationship between Mike and Sulley during their days at Monsters University — when they weren\'t necessarily the best of friends.',104,3.38),(1000502,'Cocaine Bear',2023,'Get in line.','An oddball group of cops, criminals, tourists and teens converge in a Georgia forest where a 500-pound black bear goes on a murderous rampage after unintentionally ingesting cocaine.',95,2.71),(1000503,'The Maze Runner',2014,'Remember. Survive. Run.','Set in a post-apocalyptic world, young Thomas is deposited in a community of boys after his memory is erased, soon learning they\'re all trapped in a maze that will require him to join forces with fellow “runners” for a shot at escape.',113,3.32),(1000504,'But I\'m a Cheerleader',1999,'A Comedy Of Sexual Disorientation.','Megan is an all-American girl. A cheerleader. She has a boyfriend. But Megan doesn\'t like kissing her boyfriend very much. And she\'s pretty touchy with her cheerleader friends. Her conservative parents worry that she must be a lesbian and send her off to \"sexual redirection\" school, where she must, with other lesbians and gays learn how to be straight.',85,3.99),(1000505,'X-Men: Days of Future Past',2014,'To save the future, they must alter the past','The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.',132,3.63),(1000506,'Megamind',2010,'His brain is off the chain.','Bumbling supervillain Megamind finally defeats his nemesis, the superhero Metro Man. But without a hero, he loses all purpose and must find new meaning to his life.',96,3.69),(1000507,'Sorry to Bother You',2018,'Destiny Is Calling','In an alternate present-day version of Oakland, black telemarketer Cassius Green discovers a magical key to professional success – which propels him into a macabre universe.',112,3.73),(1000508,'Batman v Superman: Dawn of Justice',2016,'Justice or revenge','Fearing the actions of a god-like Super Hero left unchecked, Gotham City’s own formidable, forceful vigilante takes on Metropolis’s most revered, modern-day savior, while the world wrestles with what sort of hero it really needs. And with Batman and Superman at war with one another, a new threat quickly arises, putting mankind in greater danger than it’s ever known before.',152,2.41),(1000509,'Roma',2018,'There are periods in history that scar societies and moments in life that transform us as individuals.','In 1970s Mexico City, two domestic workers help a mother of four while her husband is away for an extended period of time.',135,4.1),(1000510,'Solo: A Star Wars Story',2018,'Never tell him the odds.','Through a series of daring escapades deep within a dark and dangerous criminal underworld, Han Solo meets his mighty future copilot Chewbacca and encounters the notorious gambler Lando Calrissian.',135,2.9),(1000511,'The Idea of You',2024,'When the last thing you expect becomes the only thing you want.','40-year-old single mom Solène begins an unexpected romance with 24-year-old Hayes Campbell, the lead singer of August Moon, the hottest boy band on the planet.',116,2.55),(1000512,'American History X',1998,'Some Legacies Must End.','Derek Vineyard is paroled after serving 3 years in prison for killing two thugs who tried to break into/steal his truck. Through his brother, Danny Vineyard\'s narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.',119,4.13),(1000513,'Dawn of the Planet of the Apes',2014,'One last chance for peace.','A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.',130,3.8),(1000514,'Spencer',2021,'Every fairy tale ends.','Covers a critical weekend in the early ‘90s, when Princess Diana decided her marriage to Prince Charles wasn’t working, and that she needed to veer from a path that put her in line to one day be queen.',117,3.66),(1000515,'WandaVision',2021,'Experience a new vision of reality.','Wanda Maximoff and Vision—two super-powered beings living idealized suburban lives—begin to suspect that everything is not as it seems.',350,3.75),(1000516,'Napoleon',2023,'He came from nothing. He conquered everything.','An epic that details the checkered rise and fall of French Emperor Napoleon Bonaparte and his relentless journey to power through the prism of his addictive, volatile relationship with his wife, Josephine.',158,2.96),(1000517,'Despicable Me',2010,'Superbad. Superdad.','Villainous Gru lives up to his reputation as a despicable, deplorable and downright unlikable guy when he hatches a plan to steal the moon from the sky. But he has a tough time staying on task after three orphans land in his care.',95,3.53),(1000518,'Raging Bull',1980,NULL,'When Jake LaMotta steps into a boxing ring and obliterates his opponent, he\'s a prizefighter. But when he treats his family and friends the same way, he\'s a ticking time bomb, ready to go off at any moment. Though LaMotta wants his family\'s love, something always seems to come between them. Perhaps it\'s his violent bouts of paranoia and jealousy. This kind of rage helped make him a champ, but in real life, he winds up in the ring alone.',129,4.25),(1000519,'Men in Black',1997,'Protecting the Earth from the scum of the universe.','After a police chase with an otherworldly being, a New York City cop is recruited as an agent in a top-secret organization established to monitor and police alien activity on Earth: the Men in Black. Agent Kay and new recruit Agent Jay find themselves in the middle of a deadly plot by an intergalactic terrorist who has arrived on Earth to assassinate two ambassadors from opposing galaxies.',98,3.65),(1000520,'Casino',1995,'No one stays at the top forever.','In early-1970s Las Vegas, low-level mobster Sam \"Ace\" Rothstein gets tapped by his bosses to head the Tangiers Casino. At first, he\'s a great success in the job, but over the years, problems with his loose-cannon enforcer Nicky Santoro, his ex-hustler wife Ginger, her con-artist ex Lester Diamond and a handful of corrupt politicians put Sam in ever-increasing danger.',179,4.19),(1000521,'Singin\' in the Rain',1952,'What a Glorious Feeling!','In 1927 Hollywood, a silent film production company and cast make a difficult transition to sound.',103,4.32),(1000522,'The Emperor\'s New Groove',2000,'It\'s All About.....ME!','Kuzco is a self-centered emperor who summons Pacha from a village and to tell him that his home will be destroyed to make room for Kuzco\'s new summer home. Kuzco\'s advisor, Yzma, tries to poison Kuzco and accidentally turns him into a llama, who accidentally ends up in Pacha\'s village. Pacha offers to help Kuzco if he doesn\'t destroy his house, and so they form an unlikely partnership.',78,3.88),(1000523,'Nocturnal Animals',2016,'When you love someone you can\'t just throw it away','Susan Morrow receives a book manuscript from her ex-husband – a man she left 20 years earlier – asking for her opinion of his writing. As she reads, she is drawn into the fictional life of Tony Hastings, a mathematics professor whose family vacation turns violent.',117,3.73),(1000524,'The Girl with the Dragon Tattoo',2011,'Evil shall with evil be expelled.','This English-language adaptation of the Swedish novel by Stieg Larsson follows a disgraced journalist, Mikael Blomkvist, as he investigates the disappearance of a weary patriarch\'s niece from 40 years ago. He is aided by the pierced, tattooed, punk computer hacker movie_named Lisbeth Salander. As they work together in the investigation, Blomkvist and Salander uncover immense corruption beyond anything they have ever imagined.',158,3.88),(1000525,'The Little Mermaid',2023,'Watch and you\'ll see, some day I\'ll be, part of your world!','The youngest of King Triton’s daughters, and the most defiant, Ariel longs to find out more about the world beyond the sea, and while visiting the surface, falls for the dashing Prince Eric. With mermaids forbidden to interact with humans, Ariel makes a deal with the evil sea witch, Ursula, which gives her a chance to experience life on land, but ultimately places her life – and her father’s crown – in jeopardy.',135,3.17),(1000526,'Dazed and Confused',1993,'See it with a bud.','The adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a \"no drugs\" pledge.',102,3.93),(1000527,'Jumanji: Welcome to the Jungle',2017,'The game has evolved.','The tables are turned as four teenagers are sucked into Jumanji\'s world - pitted against rhinos, black mambas and an endless variety of jungle traps and puzzles. To survive, they\'ll play as characters from the game.',119,3.07),(1000528,'Eraserhead',1977,'In Heaven, Everything Is Fine.','Henry Spencer tries to survive his industrial environment, his angry girlfriend, and the unbearable screams of his newly born mutant child.',89,3.87),(1000529,'Paprika',2006,'This is your brain on anime','When a machine that allows therapists to enter their patient\'s dreams is stolen, all hell breaks loose. Only a young female therapist can stop it: Paprika.',90,4.08),(1000530,'Aquaman',2018,'Home Is Calling','Once home to the most advanced civilization on Earth, Atlantis is now an underwater kingdom ruled by the power-hungry King Orm. With a vast army at his disposal, Orm plans to conquer the remaining oceanic people and then the surface world. Standing in his way is Arthur Curry, Orm\'s half-human, half-Atlantean brother and true heir to the throne.',143,2.79),(1000531,'Being John Malkovich',1999,'Ever wanted to be someone else? Now you can.','One day at work, unsuccessful puppeteer Craig finds a portal into the head of actor John Malkovich. The portal soon becomes a passion for anybody who enters its mad and controlling world of overtaking another human body.',113,4.07),(1000532,'Eighth Grade',2018,'Based on the most awkward year of your life','Thirteen-year-old Kayla endures the tidal wave of contemporary suburban adolescence as she makes her way through the last week of middle school — the end of her thus far disastrous eighth grade year — before she begins high school.',94,3.79),(1000533,'Enemy',2013,'You can’t escape Yourself!','A mild-mannered college professor discovers a look-alike actor and delves into the other man\'s private affairs.',91,3.63),(1000534,'The Parent Trap',1998,'Twice the Fun, Double the Trouble.','Hallie Parker and Annie James are identical twins separated at a young age because of their parents\' divorce. Unknowingly to their parents, the girls are sent to the same summer camp where they meet, discover the truth about themselves, and then plot with each other to switch places.',128,3.69),(1000535,'Shazam!',2019,'Just Say The Word','A boy is given the ability to become an adult superhero in times of need with a single magic word.',132,3.1),(1000536,'Seven Samurai',1954,'The Mighty Warriors Who Became the Seven National Heroes of a Small Town','A samurai answers a village\'s request for protection after he falls on hard times. The town needs protection from bandits, so the samurai gathers six others to help him teach the people how to defend themselves, and the villagers provide the soldiers with food. A giant battle occurs when 40 bandits attack the village.',207,4.6),(1000537,'Drive My Car',2021,'Go on living.','Yusuke Kafuku, a stage actor and director, still unable, after two years, to cope with the loss of his beloved wife, accepts to direct Uncle Vanja at a theater festival in Hiroshima. There he meets Misaki, an introverted young woman, appointed to drive his car. In between rides, secrets from the past and heartfelt confessions will be unveiled.',179,4.2),(1000538,'Nobody',2021,'Never underestimate a nobody.','Hutch Mansell, a suburban dad, overlooked husband, nothing neighbor — a \"nobody.\" When two thieves break into his home one night, Hutch\'s unknown long-simmering rage is ignited and propels him on a brutal path that will uncover dark secrets he fought to leave behind.',92,3.51),(1000539,'Ice Age',2002,'They came. They thawed. They conquered.','With the impending ice age almost upon them, a mismatched trio of prehistoric critters – Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth – find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.',81,3.52),(1000540,'Love Lies Bleeding',2024,'Revenge gets ripped.','Reclusive gym manager Lou falls hard for Jackie, an ambitious bodybuilder headed through town to Las Vegas in pursuit of her dream. But their love ignites violence, pulling them deep into the web of Lou’s criminal family.',104,3.63),(1000541,'Raw',2016,'What are you hungry for?','In Justine’s family everyone is a vet and a vegetarian. At 16, she’s a gifted teen ready to take on her first year in vet school, where her older sister also studies. There, she gets no time to settle: hazing starts right away. Justine is forced to eat raw meat for the first time in her life. Unexpected consequences emerge as her true self begins to form.',99,3.7),(1000542,'Indiana Jones and the Temple of Doom',1984,'If adventure has a movie_name... it must be Indiana Jones.','After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees – and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.',118,3.63),(1000543,'Possession',1981,'Inhuman ecstasy fulfilled.','A young woman left her family for an unspecified reason. The husband determines to find out the truth and starts following his wife. At first, he suspects that a man is involved. But gradually, he finds out more and more strange behaviors and bizarre incidents that indicate something more than a possessed love affair.',124,4.09),(1000544,'Persona',1966,NULL,'A young nurse, Alma, is put in charge of Elisabeth Vogler: an actress who is seemingly healthy in all respects, but will not talk. As they spend time together, Alma speaks to Elisabeth constantly, never receiving any answer. Alma eventually confesses her secrets to a seemingly sympathetic Elisabeth and finds that her own personality is being submerged into Elisabeth\'s persona.',83,4.41),(1000545,'The Darjeeling Limited',2007,'I want us to be brothers again, like we used to be.','Three American brothers who have not spoken to each other in a year set off on a train voyage across India with a plan to find themselves and bond with each other -- to become brothers again like they used to be. Their \"spiritual quest\", however, veers rapidly off-course (due to events involving over-the-counter pain killers, Indian cough syrup, and pepper spray).',92,3.81),(1000546,'Titane',2021,NULL,'Following a series of unexplained crimes, a former firefighter is reunited with his son who has been missing for 10 years.',108,3.63),(1000547,'Atonement',2007,'Torn apart by betrayal. Separated by war. Bound by love.','As a 13-year-old, fledgling writer Briony Tallis irrevocably changes the course of several lives when she accuses her older sister\'s lover of a crime he did not commit.',123,3.97),(1000548,'Teenage Mutant Ninja Turtles: Mutant Mayhem',2023,'A new generation of heroes will rise... straight from the sewers.','After years of being sheltered from the human world, the Turtle brothers set out to win the hearts of New Yorkers and be accepted as normal teenagers through heroic acts. Their new friend April O\'Neil helps them take on a mysterious crime syndicate, but they soon get in over their heads when an army of mutants is unleashed upon them.',100,3.77),(1000549,'The Lego Batman Movie',2017,'Always be yourself. Unless you can be Batman.','In the irreverent spirit of fun that made \"The Lego Movie\" a worldwide phenomenon, the self-described leading man of that ensemble—Lego Batman—stars in his own big-screen adventure. But there are big changes brewing in Gotham, and if he wants to save the city from The Joker’s hostile takeover, Batman may have to drop the lone vigilante thing, try to work with others and maybe, just maybe, learn to lighten up.',104,3.82),(1000550,'Home Alone 2: Lost in New York',1992,'He\'s up past his bedtime in the city that never sleeps.','Instead of flying to Florida with his folks, Kevin ends up alone in New York, where he gets a hotel room with his dad\'s credit card—despite problems from a clerk and meddling bellboy. But when Kevin runs into his old nemeses, the Wet Bandits, he\'s determined to foil their plans to rob a toy store on Christmas eve.',120,3.46),(1000551,'Rocketman',2019,'Based on a True Fantasy','The story of Elton John\'s life, from his years as a prodigy at the Royal Academy of Music through his influential and enduring musical partnership with Bernie Taupin.',121,3.68),(1000552,'Venom: Let There Be Carnage',2021,'The universe needs Venom.','After finding a host body in investigative reporter Eddie Brock, the alien symbiote must face a new enemy, Carnage, the alter ego of serial killer Cletus Kasady.',97,2.49),(1000553,'How the Grinch Stole Christmas',2000,'He puts the mean in green.','Inside a snowflake exists the magical land of Whoville. In Whoville, live the Whos, an almost mutated sort of Munchkin-like people. All the Whos love Christmas, yet just outside of their beloved Whoville lives the Grinch. The Grinch is a nasty creature that hates Christmas, and plots to steal it away from the Whos, whom he equally abhors. Yet a small child, Cindy Lou Who, decides to try befriending the Grinch.',104,3.43),(1000554,'Lilo & Stitch',2002,'There\'s one in every family.','As Stitch, a runaway genetic experiment from a faraway planet, wreaks havoc on the Hawaiian Islands, he becomes the mischievous adopted alien \"puppy\" of an independent little girl movie_named Lilo and learns about loyalty, friendship, and \'ohana, the Hawaiian tradition of family.',85,3.99),(1000555,'Mission: Impossible – Fallout',2018,'Some Missions Are Not A Choice','When an IMF mission ends badly, the world is faced with dire consequences. As Ethan Hunt takes it upon himself to fulfill his original briefing, the CIA begin to question his loyalty and his motives. The IMF team find themselves in a race against time, hunted by assassins while trying to prevent a global catastrophe.',147,3.96),(1000556,'Indiana Jones and the Dial of Destiny',2023,'A legend will face his destiny.','Finding himself in a new era, approaching retirement, Indy wrestles with fitting into a world that seems to have outgrown him. But as the tentacles of an all-too-familiar evil return in the form of an old rival, Indy must don his hat and pick up his whip once more to make sure an ancient and powerful artifact doesn\'t fall into the wrong hands.',155,2.93),(1000557,'Do the Right Thing',1989,'It\'s the hottest day of the summer. You can do nothing, you can do something, or you can …','Salvatore \"Sal\" Fragione is the Italian owner of a pizzeria in Brooklyn. A neighborhood local, Buggin\' Out, becomes upset when he sees that the pizzeria\'s Wall of Fame exhibits only Italian actors. Buggin\' Out believes a pizzeria in a black neighborhood should showcase black actors, but Sal disagrees. The wall becomes a symbol of racism and hate to Buggin\' Out and to other people in the neighborhood, and tensions rise.',120,4.4),(1000558,'Paddington',2014,'Please look after this bear. Thank you','A young Peruvian bear travels to London in search of a new home. Finding himself lost and alone at Paddington Station, he meets the kindly Brown family.',96,3.79),(1000559,'Madagascar',2005,'Someone\'s got a zoo loose.','Alex the lion is the king of the urban jungle, the main attraction at New York’s Central Park Zoo. He and his best friends—Marty the zebra, Melman the giraffe and Gloria the hippo—have spent their whole lives in blissful captivity before an admiring public and with regular meals provided for them. Not content to leave well enough alone, Marty lets his curiosity get the better of him and makes his escape—with the help of some prodigious penguins—to explore the world.',86,3.49),(1000560,'Air',2023,'Some icons are meant to fly.','Discover the game-changing partnership between a then undiscovered Michael Jordan and Nike\'s fledgling basketball division which revolutionized the world of sports and culture with the Air Jordan brand.',111,3.56),(1000561,'Edge of Tomorrow',2014,'Live, Die, Repeat','Major Bill Cage is an officer who has never seen a day of combat when he is unceremoniously demoted and dropped into combat. Cage is killed within movie_lengths, managing to take an alpha alien down with him. He awakens back at the beginning of the same day and is forced to fight and die again... and again - as physical contact with the alien has thrown him into a time loop.',114,3.75),(1000562,'Moneyball',2011,'What are you really worth?','The story of Oakland Athletics general manager Billy Beane\'s successful attempt to put together a baseball team on a budget, by employing computer-generated analysis to draft his players.',134,3.89),(1000563,'Kick-Ass',2010,'Shut up. Kick ass.','Dave Lizewski is an unnoticed high school student and comic book fan who one day decides to become a super-hero, even though he has no powers, training or meaningful reason to do so.',117,3.5),(1000564,'Monty Python and the Holy Grail',1975,'And now! At Last! Another film completely different from some of the other films which aren\'t quite the same as this one is.','King Arthur, accompanied by his squire, recruits his Knights of the Round Table, including Sir Bedevere the Wise, Sir Lancelot the Brave, Sir Robin the Not-Quite-So-Brave-As-Sir-Lancelot and Sir Galahad the Pure. On the way, Arthur battles the Black Knight who, despite having had all his limbs chopped off, insists he can still fight. They reach Camelot, but Arthur decides not  to enter, as \"it is a silly place\".',91,4.14),(1000565,'The Babadook',2014,'If it\'s in a word, or it\'s in a look, you can\'t get rid of the Babadook.','A single mother, plagued by the violent death of her husband, battles with her son\'s fear of a monster lurking in the house, but soon discovers a sinister presence all around her.',94,3.39),(1000566,'Man of Steel',2013,'You will believe that a man can fly.','A young boy learns that he has extraordinary powers and is not of this earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind.',143,3),(1000567,'Old',2021,'It\'s only a matter of time.','A family on a tropical holiday discovers that the secluded beach where they are staying is somehow causing them to age rapidly, reducing their entire lives into a single day.',108,2.43),(1000568,'Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan',2006,'Come to Kazakhstan, it\'s nice!','Kazakh journalist Borat Sagdiyev travels to America to make a documentary. As he zigzags across the nation, Borat meets real people in real situations with hysterical consequences. His backwards behavior generates strong reactions around him exposing prejudices and hypocrisies in American culture.',84,3.73),(1000569,'Bo Burnham: Inside',2021,NULL,'Stuck in COVID-19 lockdown, US comedian and musician Bo Burnham attempts to stay sane and happy by writing, shooting and performing a one-man comedy special.',87,4.2),(1000570,'Before Midnight',2013,'Everything\'s better with maturity.','We meet Jesse and Celine nine years on in Greece. Almost two decades have passed since their first meeting on that train bound for Vienna.',109,4.07),(1000571,'Spotlight',2015,'Break the story. Break the silence.','The true story of how the Boston Globe uncovered the massive scandal of child molestation and cover-up within the local Catholic Archdiocese, shaking the entire Catholic Church to its core.',129,4.08),(1000572,'The Secret Life of Walter Mitty',2013,'Stop Dreaming, Start Living','A timid magazine photo manager who lives life vicariously through daydreams embarks on a true-life adventure when a negative goes missing.',114,3.74),(1000573,'Emma.',2020,'Handsome, clever, and rich.','In 1800s England, a well-meaning but selfish young woman meddles in the love lives of her friends.',125,3.69),(1000574,'Beauty and the Beast',1991,'The most beautiful love story ever told.','Follow the adventures of Belle, a bright young woman who finds herself in the castle of a prince who\'s been turned into a mysterious beast. With the help of the castle\'s enchanted staff, Belle soon learns the most important lesson of all -- that true beauty comes from within.',84,3.88),(1000575,'The Flash',2023,'Worlds collide.','When his attempt to save his family inadvertently alters the future, Barry Allen becomes trapped in a reality in which General Zod has returned and there are no Super Heroes to turn to. In order to save the world that he is in and return to the future that he knows, Barry\'s only hope is to race for his life. But will making the ultimate sacrifice be enough to reset the universe?',144,2.58),(1000576,'The Wonderful Story of Henry Sugar',2023,NULL,'A rich man learns about a guru who can see without using his eyes. He sets out to master the skill in order to cheat at gambling.',39,3.84),(1000577,'The Mitchells vs. The Machines',2021,'Saving the world can be a trip.','A quirky, dysfunctional family\'s road trip is upended when they find themselves in the middle of the robot apocalypse and suddenly become humanity\'s unlikeliest last hope.',110,3.88),(1000578,'The Evil Dead',1981,'The Ultimate Experience In Grueling Terror','When a group of college students finds a mysterious book and recording in the old wilderness cabin they\'ve rented for the weekend, they unwittingly unleash a demonic force from the surrounding forest.',85,3.66),(1000579,'The Pursuit of Happyness',2006,NULL,'A struggling salesman takes custody of his son as he\'s poised to begin a life-changing professional career.',117,3.88),(1000580,'House of Gucci',2021,'A legacy worth killing for.','The true story of how Patrizia Reggiani plotted to kill her husband Maurizio Gucci, the grandson of renowned fashion designer Guccio Gucci.',158,2.92),(1000581,'Matilda',1996,'A little magic goes a long way.','An extraordinarily intelligent young girl from a cruel and uncaring family discovers she possesses telekinetic powers and is sent off to a school headed by a tyrannical principal.',98,3.7),(1000582,'In Bruges',2008,'Shoot first. Sightsee later.','Ray and Ken, two hit men, are in Bruges, Belgium, waiting for their next mission. While they are there they have time to think and discuss their previous assignment. When the mission is revealed to Ken, it is not what he expected.',108,4.11),(1000583,'Jackie Brown',1997,'Six players on the trail of a half million in cash. There\'s only one question... Who\'s playing who?','Jackie Brown is a flight attendant who gets caught in the middle of smuggling cash into the country for her gunrunner boss. When the cops try to use Jackie to get to her boss, she hatches a plan — with help from a bail bondsman — to keep the money for herself.',154,3.87),(1000584,'Snatch',2000,'Stealin\' stones and breakin\' bones','The second film from British director Guy Ritchie. Snatch tells an obscure story similar to his first fast-paced crazy character-colliding filled film “Lock, Stock and Two Smoking Barrels.” There are two overlapping stories here – one is the search for a stolen diamond, and the other about a boxing promoter who’s having trouble with a psychotic gangster.',103,4.02),(1000585,'Night at the Museum',2006,'Where History Comes To Life','Chaos reigns at the natural history museum when night watchman Larry Daley accidentally stirs up an ancient curse, awakening Attila the Hun, an army of gladiators, a Tyrannosaurus rex and other exhibits.',108,3.26),(1000586,'Into the Wild',2007,'Into the heart. Into the soul.','After graduating from Emory University in 1992, top student and athlete Christopher McCandless abandons his possessions, gives his entire $24,000 savings account to charity, and hitchhikes to Alaska to live in the wilderness.',148,3.8),(1000587,'War for the Planet of the Apes',2017,'For freedom. For family. For the planet.','Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the journey finally brings them face to face, Caesar and the Colonel are pitted against each other in an epic battle that will determine the fate of both their species and the future of the planet.',140,3.79),(1000588,'West Side Story',2021,NULL,'Two youngsters from rival New York City gangs fall in love, but tensions between their respective friends build toward tragedy.',156,3.61),(1000589,'Stalker',1979,NULL,'Near a gray and unmovie_named city is the Zone, a place guarded by barbed wire and soldiers, and where the normal laws of physics are victim to frequent anomalies. A stalker guides two men into the Zone, specifically to an area in which deep-seated desires are granted.',162,4.43),(1000590,'The Hunt',2012,'The lie is spreading.','A teacher lives a lonely life, all the while struggling over his son’s custody. His life slowly gets better as he finds love and receives good news from his son, but his new luck is about to be brutally shattered by an innocent little lie.',116,4.29),(1000591,'Dream Scenario',2023,'Meet the man of your dreams.','Hapless family man Paul Matthews finds his life turned upside down when millions of strangers suddenly start seeing him in their dreams. But when his nighttime appearances take a nightmarish turn, Paul is forced to navigate his newfound stardom.',100,3.46),(1000592,'Decision to Leave',2022,'The Closer You Look, The Harder You Fall.','Hae-Joon, a seasoned detective, investigates the suspicious death of a man on a mountaintop. Soon, he begins to suspect Seo-rae, the deceased\'s wife, while being unsettled by his attraction to her.',138,3.97),(1000593,'Late Night with the Devil',2023,'The live television event that shocked a nation!','A live broadcast of a late-night talk show in 1977 goes horribly wrong, unleashing evil into the nation’s living rooms.',93,3.43),(1000594,'28 Days Later',2002,'His fear began when he woke up alone. His terror began when he realised he wasn\'t.','Twenty-eight days after a killer virus was accidentally unleashed from a British research facility, a small group of London survivors are caught in a desperate struggle to protect themselves from the infected. Carried by animals and humans, the virus turns those it infects into homicidal maniacs -- and it\'s absolutely impossible to contain.',113,3.76),(1000595,'The Chronicles of Narnia: The Lion, the Witch and the Wardrobe',2005,'Evil Has Reigned For 100 Years...','Siblings Lucy, Edmund, Susan and Peter step through a magical wardrobe and find the land of Narnia. There, the they discover a charming, once peaceful kingdom that has been plunged into eternal winter by the evil White Witch, Jadis. Aided by the wise and magnificent lion, Aslan, the children lead Narnia into a spectacular, climactic battle to be free of the Witch\'s glacial powers forever.',143,3.5),(1000596,'The Twilight Saga: New Moon',2009,'The Next Chapter Begins.','Forks, Washington resident Bella Swan is reeling from the departure of her vampire love, Edward Cullen, and finds comfort in her friendship with Jacob Black, a werewolf. But before she knows it, she\'s thrust into a centuries-old conflict, and her desire to be with Edward at any cost leads her to take greater and greater risks.',131,2.58),(1000597,'Life Is Beautiful',1997,'An unforgettable fable that proves love, family and imagination conquer all.','A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.',116,4.34),(1000598,'Hercules',1997,'Zero to Hero!','Bestowed with superhuman strength, a young mortal movie_named Hercules sets out to prove himself a hero in the eyes of his father, the great god Zeus. Along with his friends Pegasus, a flying horse, and Phil, a personal trainer, Hercules is tricked by the hilarious, hotheaded villain Hades, who\'s plotting to take over Mount Olympus!',93,3.78),(1000599,'The Iron Giant',1999,'It came from outer space!','In the small town of Rockwell, Maine in October 1957, a giant metal machine befriends a nine-year-old boy and ultimately finds its humanity by unselfishly saving people from their own fears and prejudices.',86,4.24),(1000600,'Climax',2018,'Birth and death are extraordinary experiences. Life is a fleeting pleasure.','Young dancers gather in a remote and empty school building to rehearse on a cold and wintry night. The all-night celebration soon turns into a hallucinatory nightmare when they learn that their sangria is laced with LSD.',97,3.78),(1000601,'The Wizard of Oz',1939,'We\'re off to see the Wizard, the wonderful Wizard of Oz!','Young Dorothy finds herself in a magical world where she makes friends with a lion, a scarecrow and a tin man as they make their way along the yellow brick road to talk with the Wizard and ask for the things they miss most in their lives. The Wicked Witch of the West is the only thing that could stop them.',102,3.95),(1000602,'Marcel the Shell with Shoes On',2021,'Everybody loves Marcel.','Marcel is an adorable one-inch-tall shell who ekes out a colorful existence with his grandmother Connie and their pet lint, Alan. Once part of a sprawling community of shells, they now live alone as the sole survivors of a mysterious tragedy. But when a documentary filmmaker discovers them amongst the clutter of his Airbnb, the short film he posts online brings Marcel millions of passionate fans, as well as unprecedented dangers and a new hope at finding his long-lost family.',90,4.23),(1000603,'Ted',2012,'Ted is coming.','John Bennett, a man whose childhood wish of bringing his teddy bear to life came true, now must decide between keeping the relationship with the bear or his girlfriend, Lori.',107,2.97),(1000604,'Frozen II',2019,'The past is not what it seems.','Elsa, Anna, Kristoff and Olaf head far into the forest to learn the truth about an ancient mystery of their kingdom.',103,3.12),(1000605,'Zoolander',2001,'3% Body Fat. 1% Brain Activity.','Clear the runway for Derek Zoolander, VH1\'s three-time male model of the year. His face falls when hippie-chic \"he\'s so hot right now\" Hansel scooters in to steal this year\'s award. The evil fashion guru Mugatu seizes the opportunity to turn Derek into a killing machine. Its a well-designed conspiracy and only with the help of Hansel and a few well-chosen accessories can Derek make the world safe.',90,3.33),(1000606,'X-Men: First Class',2011,'Witness the moment that will change our world.','Before Charles Xavier and Erik Lensherr took the movie_names Professor X and Magneto, they were two young men discovering their powers for the first time. Before they were arch-enemies, they were closest of friends, working together with other mutants (some familiar, some new), to stop the greatest threat the world has ever known.',132,3.56),(1000607,'Pirates of the Caribbean: At World\'s End',2007,'At the end of the world, the adventure begins.','Captain Barbossa, long believed to be dead, has come back to life and is headed to the edge of the Earth with Will Turner and Elizabeth Swann. But nothing is quite as it seems.',169,3.42),(1000608,'The Princess and the Frog',2009,'Every Love Story Begins With a Kiss...','A waitress, desperate to fulfill her dreams as a restaurant owner, is set on a journey to turn a frog prince back into a human being, but she has to face the same problem after she kisses him.',98,3.84),(1000609,'Dallas Buyers Club',2013,'Sometimes it takes a hustler to change the world','Loosely based on the true-life tale of Ron Woodroof, a drug-taking, women-loving, homophobic man who in 1986 was diagnosed with HIV/AIDS and given thirty days to live.',117,3.96),(1000610,'Dirty Dancing',1987,'Have the time of your life.','Expecting the usual tedium that accompanies a summer in the Catskills with her family, 17-year-old Frances \'Baby\' Houseman is surprised to find herself stepping into the shoes of a professional hoofer—and unexpectedly falling in love.',100,3.65),(1000611,'World War Z',2013,'Remember Philly!','Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.',116,3.12),(1000612,'The Platform',2019,NULL,'A mysterious place, an indescribable prison, a deep hole. An unknown number of levels. Two inmates living on each level. A descending platform containing food for all of them. An inhuman fight for survival, but also an opportunity for solidarity…',95,3.26),(1000613,'Slumdog Millionaire',2008,'What does it take to find a lost love? A. Money, B. Luck, C. Smarts, D. Destiny','Jamal Malik is an impoverished Indian teen who becomes a contestant on the Hindi version of ‘Who Wants to Be a Millionaire?’ but, after he wins, he is suspected of cheating.',120,3.9),(1000614,'10 Cloverfield Lane',2016,'Monsters come in many forms.','After getting in a car accident, a woman is held in a shelter with two men, who claim the outside world is affected by a widespread chemical attack.',104,3.57),(1000615,'Romeo + Juliet',1996,'My only love sprung from my only hate.','In director Baz Luhrmann\'s contemporary take on William Shakespeare\'s classic tragedy, the Montagues and Capulets have moved their ongoing feud to the sweltering suburb of Verona Beach, where Romeo and Juliet fall in love and secretly wed. Though the film is visually modern, the bard\'s dialogue remains.',120,3.4),(1000616,'The Graduate',1967,'This is Benjamin. He\'s a little worried about his future.','Benjamin, a recent college graduate very worried about his future, finds himself in a love triangle with an older woman and her daughter.',106,4.12),(1000617,'Chinatown',1974,'You get tough. You get tender. You get close to each other. Maybe you even get close to the truth.','Private eye Jake Gittes lives off of the murky moral climate of sunbaked, pre-World War II Southern California. Hired by a beautiful socialite to investigate her husband\'s extra-marital affair, Gittes is swept into a maelstrom of double dealings and deadly deceits, uncovering a web of personal and political scandals that come crashing together.',130,4.29),(1000618,'The Talented Mr. Ripley',1999,'How far would you go to become someone else?','Tom Ripley is a calculating young man who believes it\'s better to be a fake somebody than a real nobody. Opportunity knocks in the form of a wealthy U.S. shipbuilder who hires Tom to travel to Italy to bring back his playboy son, Dickie. Ripley worms his way into the idyllic lives of Dickie and his girlfriend, plunging into a daring scheme of duplicity, lies and murder.',139,3.84),(1000619,'Okja',2017,NULL,'A young girl movie_named Mija risks everything to prevent a powerful, multi-national company from kidnapping her best friend - a massive animal movie_named Okja.',122,3.7),(1000620,'Cinema Paradiso',1988,'A celebration of youth, friendship, and the everlasting magic of the movies.','A filmmaker recalls his childhood, when he fell in love with the movies at his village\'s theater and formed a deep friendship with the theater\'s projectionist.',124,4.45),(1000621,'Cast Away',2000,'At the edge of the world, his journey begins.','Chuck, a top international manager for FedEx, and Kelly, a Ph.D. student, are in love and heading towards marriage. Then Chuck\'s plane to Malaysia ditches at sea during a terrible storm. He\'s the only survivor, and he washes up on a tiny island with nothing but some flotsam and jetsam from the aircraft\'s cargo.',143,3.86),(1000622,'Scream 2',1997,'Someone has taken their love of sequels one step too far.','Two years after the terrifying events that occurred in Woodsboro, Sidney is now attending Windsor College in Cincinnati, and Gale Weathers\' best selling book on Sidney\'s life has now been made into a major motion picture. When two college students are killed in a theatre while watching the new film \'Stab\', Sidney knows deep down that history is repeating itself.',120,3.26),(1000623,'To All the Boys I\'ve Loved Before',2018,'The Letters Are Out.','Lara Jean\'s love life goes from imaginary to out of control when her secret letters to every boy she\'s ever fallen for are mysteriously mailed out.',100,2.96),(1000624,'Baby Reindeer',2024,NULL,'When a struggling comedian shows one act of kindness to a vulnerable woman, it sparks a suffocating obsession which threatens to wreck both their lives.',237,4.04),(1000625,'Red, White & Royal Blue',2023,'Love who you want. It\'s good foreign policy.','After an altercation between Alex, the president\'s son, and Britain\'s Prince Henry at a royal event becomes tabloid fodder, their long-running feud now threatens to drive a wedge in U.S./British relations. When the rivals are forced into a staged truce, their icy relationship begins to thaw and the friction between them sparks something deeper than they ever expected.',121,3.15),(1000626,'The Hobbit: The Desolation of Smaug',2013,'Beyond darkness... beyond desolation... lies the greatest danger of all.','The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.',161,3.38),(1000627,'Malignant',2021,'A new vision of terror.','Madison is paralyzed by shocking visions of grisly murders, and her torment worsens as she discovers that these waking dreams are in fact terrifying realities.',111,3.06),(1000628,'Rango',2011,'Heroes come in all different colors.','When Rango, a lost family pet, accidentally winds up in the gritty, gun-slinging town of Dirt, the less-than-courageous lizard suddenly finds he stands out. Welcomed as the last hope the town has been waiting for, new Sheriff Rango is forced to play his new role to the hilt.',107,3.66),(1000629,'Mission: Impossible',1996,'Expect the Impossible.','When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, he\'s surprised to learn that he\'s the No. 1 suspect. To clear his movie_name, Hunt now must ferret out the real double agent and, in the process, even the score.',110,3.59),(1000630,'The Theory of Everything',2014,'His Mind Changed Our World. Her Love Changed His.','The Theory of Everything is the extraordinary story of one of the world’s greatest living minds, the renowned astrophysicist Stephen Hawking, who falls deeply in love with fellow Cambridge student Jane Wilde.',123,3.61),(1000631,'Infinity Pool',2023,'Find out what kind of a creature you really are.','While staying at an isolated island resort, James and Em are enjoying a perfect vacation of pristine beaches, exceptional staff, and soaking up the sun. But guided by the seductive and mysterious Gabi, they venture outside the resort grounds and find themselves in a culture filled with violence, hedonism, and untold horror.',118,3.15),(1000632,'The Unbearable Weight of Massive Talent',2022,'The most Nicolas Cage movie ever.','Creatively unfulfilled and facing financial ruin, Nick Cage must accept a $1 million offer to attend the birthday of a dangerous superfan. Things take a wildly unexpected turn when Cage is recruited by a CIA operative and forced to live up to his own legend, channeling his most iconic and beloved on-screen characters in order to save himself and his loved ones.',107,3.43),(1000633,'The Master',2012,'Every man needs a guide.','Freddie, a volatile, heavy-drinking veteran who suffers from post-traumatic stress disorder, finds some semblance of a family when he stumbles onto the ship of Lancaster Dodd, the charismatic leader of a new \"religion\" he forms after World War II.',137,4.02),(1000634,'Zack Snyder\'s Justice League',2021,'Us united.','Determined to ensure Superman\'s ultimate sacrifice was not in vain, Bruce Wayne aligns forces with Diana Prince with plans to recruit a team of metahumans to protect the world from an approaching threat of catastrophic proportions.',242,3.41),(1000635,'Rushmore',1998,'Love. Expulsion. Revolution.','When a beautiful first-grade teacher arrives at a prep school, she soon attracts the attention of an ambitious teenager movie_named Max, who quickly falls in love with her. Max turns to the father of two of his schoolmates for advice on how to woo the teacher. However, the situation soon gets complicated when Max\'s new friend becomes involved with her, setting the two pals against one another in a war for her attention.',93,3.9),(1000636,'Maestro',2023,'Don’t you feel triumphant?','A towering and fearless love story chronicling the lifelong relationship between Leonard Bernstein and Felicia Montealegre Cohn Bernstein. A love letter to life and art, Maestro at its core is an emotionally epic portrayal of family and love.',129,3.15),(1000637,'The Life Aquatic with Steve Zissou',2004,'The deeper you go, the weirder life gets.','Renowned oceanographer Steve Zissou has sworn vengeance upon the rare shark that devoured a member of his crew. In addition to his regular team, he is joined on his boat by Ned, a man who believes Zissou to be his father, and Jane, a journalist pregnant by a married man. They travel the sea, all too often running into pirates and, perhaps more traumatically, various figures from Zissou\'s past, including his estranged wife, Eleanor.',119,3.8),(1000638,'The Father',2020,NULL,'A man refuses all assistance from his daughter as he ages. As he tries to make sense of his changing circumstances, he begins to doubt his loved ones, his own mind and even the fabric of his reality.',96,4.29),(1000639,'Godzilla vs. Kong',2021,'One Will Fall','In a time when monsters walk the Earth, humanity’s fight for its future sets Godzilla and Kong on a collision course that will see the two most powerful forces of nature on the planet collide in a spectacular battle for the ages.',114,2.79),(1000640,'Prey',2022,'They hunt to live. It lives to hunt.','On the Great Plains in 1719, Naru, a fierce and highly skilled Comanche warrior, sets out to protect her people when an unknown danger threatens them. But the prey she’s stalking turns out to be a highly evolved alien predator with a technically advanced arsenal.',100,3.56),(1000641,'The Holiday',2006,'It\'s Christmas Eve and we are going to go celebrate being young and being alive','Two women, one from the United States and one from the United Kingdom, swap homes at Christmastime after bad breakups with their boyfriends. Each woman finds romance with a local man but realizes that the imminent return home may end the relationship.',136,3.48),(1000642,'Amadeus',1984,'...Everything you\'ve heard is true','The incredible story of genius musician Wolfgang Amadeus Mozart, told in flashback by his peer and secret rival, Antonio Salieri—now confined to an insane asylum.',161,4.32),(1000643,'Paddington 2',2017,'It takes a bear to catch a thief','Paddington, now happily settled with the Browns, picks up a series of odd jobs to buy the perfect present for his Aunt Lucy, but it is stolen.',104,4.16),(1000644,'Do Revenge',2022,'I\'ll do yours if you do mine.','A dethroned queen bee at a posh private high school strikes a secret deal with an unassuming new student to enact revenge on one another’s enemies.',118,3.09),(1000645,'Blue Valentine',2010,'Nobody Baby But You And Me','Dean and Cindy live a quiet life in a modest neighborhood. They appear to have the world at their feet at the outset of the relationship. However, his lack of ambition and her retreat into self-absorption cause potentially irreversible cracks in their marriage.',112,3.8),(1000646,'CODA',2021,'Every family has its own language.','As a CODA (Child of Deaf Adults), Ruby is the only hearing person in her deaf family. When the family’s fishing business is threatened, Ruby finds herself torn between pursuing her love of music and her fear of abandoning her