vanced AI who has developed a mysterious weapon with the power to end the war—and mankind itself.',134,3.27),(1000653,'El Camino: A Breaking Bad Movie',2019,NULL,'In the wake of his dramatic escape from captivity, Jesse Pinkman must come to terms with his past in order to forge some kind of future.',123,3.56),(1000654,'Normal People',2020,'Drawn together. Driven apart.','Marianne and Connell weave in and out of each other’s lives in this exploration of sex, power and the desire to love and be loved. Adaptation of Sally Rooney’s best-selling novel.',342,4.42),(1000655,'Thelma & Louise',1991,'Somebody said get a life… so they did.','Whilst on a short weekend getaway, Louise shoots a man who had tried to rape Thelma. Due to the incriminating circumstances, they make a run for it and thus a cross country chase ensues for the two fugitives. Along the way, both women rediscover the strength of their friendship and surprising aspects of their personalities and self-strengths in the trying times.',130,4.13),(1000656,'Under the Skin',2013,NULL,'A seductive stranger prowls the streets of Glasgow in search of prey: unsuspecting men who fall under her spell.',108,3.63),(1000657,'The Polar Express',2004,'This holiday season... believe.','When a doubting young boy takes an extraordinary train ride to the North Pole, he embarks on a journey of self-discovery that shows him that the wonder of life never fades for those who believe.',100,3.23),(1000658,'Nightmare Alley',2021,'Man or beast.','An ambitious carnival man with a talent for manipulating people with a few well-chosen words hooks up with a female psychiatrist who is even more dangerous than he is.',150,3.44),(1000659,'The Proposal',2009,'Here comes the bribe...','When she learns she\'s in danger of losing her visa status and being deported, overbearing book editor Margaret Tate forces her put-upon assistant, Andrew Paxton, to marry her.',108,3.32),(1000660,'Napoleon Dynamite',2004,'He\'s out to prove he\'s got nothing to prove.','A listless and alienated teenager decides to help his new friend win the class presidency in their small western high school, while he must deal with his bizarre family life back home.',95,3.68),(1000661,'Enola Holmes',2020,'Mystery runs in the family.','While searching for her missing mother, intrepid teen Enola Holmes uses her sleuthing skills to outsmart big brother Sherlock and help a runaway lord.',123,3.06),(1000662,'The Gentlemen',2019,'Criminal. Class.','American expat Mickey Pearson has built a highly profitable marijuana empire in London. When word gets out that he’s looking to cash out of the business forever it triggers plots, schemes, bribery and blackmail in an attempt to steal his domain out from under him.',113,3.7),(1000663,'The Incredible Hulk',2008,'You\'ll like him when he\'s angry.','Scientist Bruce Banner scours the planet for an antidote to the unbridled force of rage within him: the Hulk. But when the military masterminds who dream of exploiting his powers force him back to civilization, he finds himself coming face to face with a new, deadly foe.',114,2.45),(1000664,'Onward',2020,'Their quest begineth.','In a suburban fantasy world, two teenage elf brothers embark on an extraordinary quest to discover if there is still a little magic left out there.',103,3.39),(1000665,'Dog Day Afternoon',1975,'The most bizarre bank siege ever','Based on the true story of would-be Brooklyn bank robbers John Wojtowicz and Salvatore Naturale. Sonny and Sal attempt a bank heist which quickly turns sour and escalates into a hostage situation and stand-off with the police. As Sonny\'s motives for the robbery are slowly revealed and things become more complicated, the heist turns into a media circus.',125,4.31),(1000666,'A Bug\'s Life',1998,'An epic presentation of miniature proportions.','On behalf of \"oppressed bugs everywhere,\" an inventive ant movie_named Flik hires a troupe of warrior bugs to defend his bustling colony from a horde of freeloading grasshoppers led by the evil-minded Hopper.',95,3.45),(1000667,'We Need to Talk About Kevin',2011,'Mummy\'s little monster…','After her son Kevin commits a horrific act, troubled mother Eva reflects on her complicated relationship with her disturbed son as he grew from a toddler into a teenager.',113,3.82),(1000668,'Inside Llewyn Davis',2013,NULL,'In Greenwich Village in the early 1960s, gifted but volatile folk musician Llewyn Davis struggles with money, relationships, and his uncertain future.',104,4.04),(1000669,'The Little Mermaid',1989,'Somewhere under the sea and beyond your imagination is an adventure in fantasy.','This colorful adventure tells the story of an impetuous mermaid princess movie_named Ariel who falls in love with the very human Prince Eric and puts everything on the line for the chance to be with him. Memorable songs and characters -- including the villainous sea witch Ursula.',83,3.67),(1000670,'House',1977,NULL,'Hoping to find a sense of connection to her late mother, Gorgeous takes a trip to the country to visit her aunt at their ancestral house. She invites her six friends, Prof, Melody, Mac, Fantasy, Kung Fu, and Sweet, to join her. The girls soon discover that there is more to the old house than meets the eye.',88,4.01),(1000671,'Breakfast at Tiffany\'s',1961,'Audrey Hepburn plays that daring, darling Holly Golightly to a new high in entertainment delight!','Fortune hunter Holly Golightly finds herself captivated by aspiring writer Paul Varjak, who\'s moved into her building on a wealthy woman\'s dime. As romance blooms between Paul and Holly, Doc Golightly shows up on the scene, revealing Holly\'s past.',115,3.76),(1000672,'The Matrix Reloaded',2003,'Free your mind.','Six months after the events depicted in The Matrix, Neo has proved to be a good omen for the free humans, as more and more humans are being freed from the matrix and brought to Zion, the one and only stronghold of the Resistance.  Neo himself has discovered his superpowers including super speed, ability to see the codes of the things inside the matrix and a certain degree of pre-cognition. But a nasty piece of news hits the human resistance: 250,000 machine sentinels are digging to Zion and would reach them in 72 hours. As Zion prepares for the ultimate war, Neo, Morpheus and Trinity are advised by the Oracle to find the Keymaker who would help them reach the Source.  Meanwhile Neo\'s recurrent dreams depicting Trinity\'s death have got him worried and as if it was not enough, Agent Smith has somehow escaped deletion, has become more powerful than before and has fixed Neo as his next target.',138,3.35),(1000673,'The Game',1997,'What do you get for the man who has everything?','In honor of his birthday, San Francisco banker Nicholas Van Orton, a financial genius and a cold-hearted loner, receives an unusual present from his younger brother, Conrad: a gift certificate to play a unique kind of game. In nearly a nanosecond, Nicholas finds himself consumed by a dangerous set of ever-changing rules, unable to distinguish where the charade ends and reality begins.',129,3.76),(1000674,'The Farewell',2019,'Based on an actual lie.','A headstrong Chinese-American woman returns to China when her beloved grandmother is given a terminal diagnosis. Billi struggles with her family\'s decision to keep grandma in the dark about her own illness as they all stage an impromptu wedding to see grandma one last time.',100,4.06),(1000675,'A Beautiful Mind',2001,'He saw the world in a way no one could have imagined.','John Nash is a brilliant but asocial mathematician fighting schizophrenia. After he accepts secret work in cryptography, his life takes a turn for the nightmarish.',135,3.83),(1000676,'Minions: The Rise of Gru',2022,'Brace yourself.','A fanboy of a supervillain supergroup known as the Vicious 6, Gru hatches a plan to become evil enough to join them, with the backup of his followers, the Minions.',87,3.16),(1000677,'Swiss Army Man',2016,'We all need somebody to lean on.','Alone on a tiny deserted island, Hank has given up all hope of ever making it home again. But one day everything changes when a dead body washes ashore, and he soon realizes it may be his last opportunity to escape certain death. Armed with his new “friend” and an unusual bag of tricks, the duo go on an epic adventure to bring Hank back to the woman of his dreams.',97,3.66),(1000678,'Wonder Woman 1984',2020,'A new era of wonder begins.','A botched store robbery places Wonder Woman in a global battle against a powerful and mysterious ancient force that puts her powers in jeopardy.',151,2.09),(1000679,'Knock at the Cabin',2023,'Save your family or save humanity. Make the choice.','While vacationing at a remote cabin, a young girl and her parents are taken hostage by four armed strangers who demand that the family make an unthinkable choice to avert the apocalypse. With limited access to the outside world, the family must decide what they believe before all is lost.',100,2.89),(1000680,'The Matrix Resurrections',2021,'Return to the source.','Plagued by strange memories, Neo\'s life takes an unexpected turn when he finds himself back inside the Matrix.',147,2.73),(1000681,'Watchmen',2009,'Justice is coming to all of us.  No matter what we do.','In a gritty and alternate 1985 the glory days of costumed vigilantes have been brought to a close by a government crackdown, but after one of the masked veterans is brutally murdered, an investigation into the killer is initiated. The reunited heroes set out to prevent their own destruction, but in doing so uncover a sinister plot that puts all of humanity in grave danger.',163,3.64),(1000682,'I Am Legend',2007,'The last man on Earth is not alone','Robert Neville is a scientist who was unable to stop the spread of the terrible virus that was incurable and man-made. Immune, Neville is now the last human survivor in what is left of New York City and perhaps the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone.',101,3.38),(1000683,'Kingsman: The Golden Circle',2017,'Reports of my death have been greatly exaggerated.','When an attack on the Kingsman headquarters takes place and a new villain rises, Eggsy and Merlin are forced to work together with the American agency known as the Statesman to save the world.',141,3.12),(1000684,'The Hobbit: The Battle of the Five Armies',2014,'Witness the defining chapter of the Middle-Earth saga','Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebor\'s mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo\'s hands.',144,3.17),(1000685,'The Mask',1994,'From zero to hero.','When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.',101,3.33),(1000686,'The Fly',1986,'Be afraid. Be very afraid.','When Seth Brundle makes a huge scientific and technological breakthrough in teleportation, he decides to test it on himself. Unbeknownst to him, a common housefly manages to get inside the device and the two become one.',96,3.98),(1000687,'Chernobyl',2019,'What is the cost of lies?','The true story of one of the worst man-made catastrophes in history: the catastrophic nuclear accident at Chernobyl. A tale of the brave men and women who sacrificed to save Europe from