 don\'t know, behind the mission you do.','The untold story of Katherine G. Johnson, Dorothy Vaughan and Mary Jackson – brilliant African-American women working at NASA and serving as the brains behind one of the greatest operations in history – the launch of astronaut John Glenn into orbit. The visionary trio crossed all gender and race lines to inspire generations to dream big.',127,3.84),(1000694,'Mysterious Skin',2004,'Two boys. One can\'t remember. The other can\'t forget.','A teenage hustler and a young man obsessed with alien abductions cross paths, together discovering a horrible, libemovie_rating truth.',105,4.18),(1000695,'Jumanji',1995,'Roll the dice and unleash the excitement!','When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult who\'s been trapped inside the game for 26 years -- into their living room. Alan\'s only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.',104,3.61),(1000696,'Game Night',2018,'This is not a game','Max and Annie\'s weekly game night gets kicked up a notch when Max\'s brother Brooks arranges a murder mystery party -- complete with fake thugs and federal agents. So when Brooks gets kidnapped, it\'s all supposed to be part of the game. As the competitors set out to solve the case, they start to learn that neither the game nor Brooks are what they seem to be. The friends soon find themselves in over their heads as each twist leads to another unexpected turn over the course of one chaotic night.',100,3.5),(1000697,'Castle in the Sky',1986,'Haunting and brilliant!','A young boy and a girl with a magic crystal must race against pirates and foreign agents in a search for a legendary floating castle.',125,4.04),(1000698,'Love, Simon',2018,'He\'s done keeping his story straight.','Everyone deserves a great love story. But for seventeen-year old Simon Spier it\'s a little more complicated: he\'s yet to tell his family or friends he\'s gay and he doesn\'t know the identity of the anonymous classmate he\'s fallen for online.',110,3.27),(1000699,'Batman',1989,'Have you ever danced with the devil in the pale moonlight?','The Dark Knight of Gotham City begins his war on crime with his first major enemy being the clownishly homicidal Joker, who has seized control of Gotham\'s underworld.',126,3.61),(1000700,'Me Before You',2016,'Live boldly','A small town girl is caught between dead-end jobs. A high-profile, successful man becomes wheelchair bound following an accident. The man decides his life is not worth living until the girl is hired for six months to be his new caretaker. Worlds apart and trapped together by circumstance, the two get off to a rocky start. But the girl becomes determined to prove to the man that life is worth living and as they embark on a series of adventures together, each finds their world changing in ways neither of them could begin to imagine.',110,3.35),(1000701,'White Chicks',2004,'They\'re going deep undercover.','Two FBI agent brothers, Marcus and Kevin Copeland, accidentally foil a drug bust. As punishment, they are forced to escort a pair of socialites to the Hamptons, where they\'re going to be used as bait for a kidnapper. But when the girls realize the FBI\'s plan, they refuse to go. Left without options, Marcus and Kevin decide to pose as the sisters, transforming themselves from African-American men into a pair of blonde, white women.',109,3.35),(1000702,'The Devil All the Time',2020,'Everyone ends up in the same damned place.','In Knockemstiff, Ohio and its neighboring backwoods, sinister characters converge around young Arvin Russell as he fights the evil forces that threaten him and his family.',138,3.29),(1000703,'The Seventh Seal',1957,NULL,'When disillusioned Swedish knight Antonius Block returns home from the Crusades to find his country in the grips of the Black Death, he challenges Death to a chess match for his life. Tormented by the belief that God does not exist, Block sets off on a journey, meeting up with traveling players Jof and his wife, Mia, and becoming determined to evade Death long enough to commit one redemptive act while he still lives.',96,4.34),(1000704,'Freaky Friday',2003,'Mondays are manic. Wednesdays are wild. And Fridays are about to get a little freaky.','Mother and daughter bicker over everything -- what Anna wears, whom she likes and what she wants to do when she\'s older. In turn, Anna detests Tess\'s fiancé. When a magical fortune cookie switches their personalities, they each get a peek at how the other person feels, thinks and lives.',97,3.4),(1000705,'Beauty and the Beast',2017,'Be our guest.','A live-action adaptation of Disney\'s version of the classic tale of a cursed prince and a beautiful young woman who helps him break the spell.',129,3.07),(1000706,'Judas and the Black Messiah',2021,'You can kill a revolutionary but you can\'t kill the revolution','The story of Fred Hampton, deputy chairman of the national Black Panther Party, who was assassinated in 1969 by a Cook County tactical unit on the orders of the FBI and Chicago Police Department.',126,4.03),(1000707,'Doctor Sleep',2019,'Dare to go back','Still irrevocably scarred by the trauma he endured as a child at the Overlook, Dan Torrance has fought to find some semblance of peace. But that peace is shattered when he encounters Abra, a courageous teenager with her own powerful extrasensory gift, known as the \'shine\'. Instinctively recognising that Dan shares her power, Abra has sought him out, desperate for his help against the merciless Rose the Hat and her followers.',152,3.37),(1000708,'Insidious',2010,'It\'s not the house that\'s haunted.','A family discovers that dark spirits have invaded their home after their son inexplicably falls into an endless sleep. When they reach out to a professional for help, they learn things are 