eased follow-ups to the Neon Genesis Evangelion series. Comprising of two alternate episodes which were first intended to take the place of episodes 25 and 26, this finale answers many of the questions surrounding the series, while also opening up some new possibilities.',87,4.47),(1000714,'Willy Wonka & the Chocolate Factory',1971,'It\'s Scrumdidilyumptious!','Eccentric candy man Willy Wonka prompts a worldwide frenzy when he announces that golden tickets hidden inside five of his delicious candy bars will admit their lucky holders into his top-secret confectionary. But does Wonka have an agenda hidden amid a world of Oompa Loompas and chocolate rivers?',99,3.81),(1000715,'Fear Street: 1994',2021,'Face the evil.','In 1994, a group of teenagers discovers that the terrifying events which have haunted their town for generations ​are all connected — and that they may be the next targets.',107,3.06),(1000716,'Barry Lyndon',1975,'At long last Redmond Barry became a gentleman—and that was his tragedy.','An Irish rogue uses his cunning and wit to work his way up the social classes of 18th century England, transforming himself from the humble Redmond Barry into the noble Barry Lyndon.',185,4.39),(1000717,'Airplane!',1980,'What\'s slower than a speeding bullet, and able to hit tall buildings at a single bound?','Alcoholic pilot, Ted Striker has developed a fear of flying due to wartime trauma, but nevertheless boards a passenger jet in an attempt to woo back his stewardess girlfriend. Food poisoning decimates the passengers and crew, leaving it up to Striker to land the plane with the help of a glue-sniffing air traffic controller and Striker\'s vengeful former Air Force captain, who must both talk him down.',88,3.84),(1000718,'A Silent Voice',2016,NULL,'Shouya Ishida starts bullying the new girl in class, Shouko Nishimiya, because she is deaf. But as the teasing continues, the rest of the class starts to turn on Shouya for his lack of compassion. When they leave elementary 