avaged by a string of mysterious killings and a malicious vampire continues her quest for revenge. In the midst of it all, she is forced to choose between her love for Edward and her friendship with Jacob, knowing that her decision has the potential to ignite the ageless struggle between vampire and werewolf. With her graduation quickly approaching, Bella is confronted with the most important decision of her life.',124,2.57),(1000725,'Melancholia',2011,'Enjoy it while it lasts','Two sisters find their already strained relationship challenged as a mysterious new planet threatens to collide with Earth.',136,3.84),(1000726,'The King of Comedy',1982,'It\'s No Laughing Matter.','Aspiring comic Rupert Pupkin attempts to achieve success in show business by stalking his idol, a late night talk-show host who craves his own privacy.',109,4.24),(1000727,'RRR',2022,'Rise Roar Revolt','A fictional history of two legendary revolutionaries\' journey away from home before they began fighting for their country in the 1920s.',185,4.19),(1000728,'Close',2022,NULL,'Thirteen-year-olds Léo and Rémi have always been close, but they drift apart after the intimacy of their relationship is questioned by schoolmates.',104,4.1),(1000729,'Misery',1990,'Paul Sheldon used to write for a living. Now, he\'s writing to stay alive.','Novelist Paul Sheldon crashes his car on a snowy Colorado road. He is found by Annie Wilkes, the \"number one fan\" of Paul\'s heroine Misery Chastaine. Annie is also somewhat unstable, and Paul finds himself crippled, drugged and at her mercy.',107,3.97),(1000730,'The Disaster Artist',2017,'I did naaaht! Oh, hi Mark','An aspiring actor in Hollywood meets an enigmatic stranger by the movie_name of Tommy Wiseau, the meeting leads the actor down a path nobody could have predicted; creating the worst movie ever made.',104,3.56),(1000731,'Lucy',2014,'The average person uses 10% of their brain capacity. Imagine what she could do with 100%.','A woman, accidentally caught in a 