 and her bridesmaids just how far you’ll go for someone you love.',125,3.43),(1000738,'22 Jump Street',2014,'They\'re not 21 anymore','After making their way through high school (twice), big changes are in store for officers Schmidt and Jenko when they go deep undercover at a local college. But when Jenko meets a kindred spirit on the football team, and Schmidt infiltrates the bohemian art major scene, they begin to question their partnership. Now they don\'t have to just crack the case - they have to figure out if they can have a mature relationship. If these two overgrown adolescents can grow from freshmen into real men, college might be the best thing that ever happened to them.',112,3.32),(1000739,'The Sound of Music',1965,'The happiest sound in all the world!','A tomboyish postulant at an Austrian abbey becomes a governess in the home of a widowed naval captain with seven children, and brings a new love of life and music into the home.',174,4.11),(1000740,'Fury',2014,'War never ends quietly.','In the last months of World War II, as the Allies make their final push in the European theatre, a battle-hardened U.S. Army sergeant movie_named \'Wardaddy\' commands a Sherman tank called \'Fury\' and its five-man crew on a deadly mission behind enemy lines. Outnumbered and outgunned, Wardaddy and his men face overwhelming odds in their heroic attempts to strike at the heart of Nazi Germany.',135,3.72),(1000741,'Tropic Thunder',2008,'Get Some.','Vietnam veteran \'Four Leaf\' Tayback\'s memoir, Tropic Thunder, is being made into a film, but Director Damien Cockburn can’t control the cast of prima donnas. Behind schedule and over budget, Cockburn is ordered by a studio executive to get filming back on track, or risk its cancellation. On Tayback\'s advice, Cockburn drops the actors into the middle of the jungle to film the remaining scenes but, unbeknownst to the actors and production, the group have been dropped in the middle of the Golden Triangle, the home of heroin-producing gangs.',107,3.58),(1000742,'The Help',2011,'Change begins with a whisper.','Aibileen Clark is a middle-aged African-American maid who has spent her life raising white children and has recently lost her only son; Minny Jackson is an African-American maid who has often offended her employers despite her family\'s struggles with money and her desperate need for jobs; and Eugenia \"Skeeter\" Phelan is a young white woman who has recently moved back home after graduating college to find out her childhood maid has mysteriously disappeared. These three stories intertwine to explain how life in Jackson, Mississippi revolves around \"the help\"; yet they are always kept at a certain distance because of racial lines.',146,3.84),(1000743,'Burn After Reading',2008,'Intelligence is relative.','When a disc containing memoirs of a former CIA analyst falls into the hands of gym employees, Linda and Chad, they see a chance to make enough money for Linda to have life-changing cosmetic surgery. Predictably, events whirl out of control for the duo, and those in their orbit.',96,3.62),(1000744,'Incendies',2010,'The search began at the opening of their mother\'s will.','A mother\'s last wishes send twins Jeanne and Simon on a journey to Middle East in search of their tangled roots. Adapted from Wajdi Mouawad\'s acclaimed play, Incendies tells the powerful and moving tale of two young adults\' voyage to the core of deep-rooted hatred, never-ending wars and enduring love.',131,4.41),(1000745,'The Tree of Life',2011,'Nothing stands still.','The impressionistic story of a Texas family in the 1950s. The film follows the life journey of the eldest son, Jack, through the innocence of childhood to his disillusioned adult years as he tries to reconcile a complicated relationship with his father. Jack finds himself a lost soul in the modern world, seeking answers to the origins and meaning of life while questioning the existence of faith.',139,3.86),(1000746,'After Hours',1985,'When it\'s after midnight in New York City, you don\'t have to look for love, laughter and trouble. They\'ll all find you!','An ordinary word processor has the worst night of his life after he agrees to visit a girl in Soho whom he met that evening at a coffee shop.',97,4.13),(1000747,'Pacific Rim',2013,'To Fight Monsters, We Created Monsters','When legions of monstrous creatures, known as Kaiju, started rising from the sea, a war began that would take millions of lives and consume humanity\'s resources for years on end. To combat the giant Kaiju, a special type of weapon was devised: massive robots, called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. But even the Jaegers are proving nearly defenseless in the face of the relentless Kaiju. On the verge of defeat, the forces defending mankind have no choice but to turn to two unlikely heroes—a washed-up former pilot (Charlie Hunnam) and an untested trainee (Rinko Kikuchi)—who are teamed to drive a legendary but seemingly obsolete Jaeger from the past. Together, they stand as mankind\'s last hope against the mounting apocalypse.',131,3.37),(1000748,'The Boy in the Striped Pyjamas',2008,'Lines may divide us, but hope will unite us.','When his family moves from their home in Berlin to a strange new house in Poland, young Bruno befriends Shmuel, a boy who lives on the other side of the fence where everyone seems to be wearing striped pajamas. Unaware of Shmuel\'s fate as a Jewish prisoner or the role his own Nazi father plays in his imprisonment, Bruno embarks on a dangerous journey inside the camp\'s walls.',94,3.62),(1000749,'Kung Fu Panda 2',2011,'Prepare for the Year of Awesomeness!','Po is now living his dream as The Dragon Warrior, protecting the Valley of Peace alongside his friends and fellow kung fu masters, The Furious Five - Tigress, Crane, Mantis, Viper and Monkey. But Po’s new life of awesomeness is threatened by the emergence of a formidable villain, who plans to 