eaux run off on a big quest to find the secret stash of Pirate One-Eyed Willie.',114,3.78),(1000765,'She\'s the Man',2006,'If you wanna chase your dream, sometimes you gotta break the rules.','Viola Johnson is in a real jam. Complications threaten her scheme to pose as her twin brother, Sebastian, and take his place at a new boarding school. She falls in love with her handsome roommate, Duke, who loves beautiful Olivia, who has fallen for Sebastian! As if that were not enough, Viola\'s twin returns from London ahead of schedule but has no idea that his sister has already replaced him on campus.',105,3.34),(1000766,'Divergent',2014,'What makes you different makes you dangerous.','In a world divided into factions based on personality types, Tris learns that she\'s been classified as Divergent and won\'t fit in. When she discovers a plot to destroy Divergents, Tris and the mysterious Four must find out what makes Divergents dangerous before it\'s too late.',139,2.84),(1000767,'Raya and the Last Dragon',2021,'A quest to save her world.','Long ago, in the fantasy world of Kumandra, humans and dragons lived together in harmony. But when an evil force threatened the land, the dragons sacrificed themselves to save humanity. Now, 500 years later, that same evil has returned and it’s up to a lone warrior, Raya, to track down the legendary last dragon to restore the fractured land and its divided people.',107,3.28),(1000768,'Jurassic World Dominion',2022,'The epic conclusion of the Jurassic era.','Four years after Isla Nublar was destroyed, dinosaurs now live—and hunt—alongside humans all over the world. This fragile balance will reshape the future and determine, once and for all, whether human beings are to remain the apex predators on a planet they now share with history’s most fearsome creatures.',147,2.2),(1000769,'Kong: Skull Island',2017,'All hail the king','Explore the mysterious and dangerous home of the king of the apes as a team of explorers ventures deep inside the treacherous, primordial island.',118,3.07),(1000770,'Nimona',2023,'A new hero takes shape.','A knight framed for a tragic crime teams with a scrappy, shape-shifting teen to prove his innocence.',99,3.94),(1000771,'The Craft',1996,'Welcome to the witching hour.','A Catholic school newcomer falls in with a clique of teen witches who wield their powers against all who dare to cross them -- be they teachers, rivals or meddlesome parents.',101,3.52),(1000772,'Sunset Boulevard',1950,'A Hollywood Story','A hack screenwriter writes a screenplay for a former silent film star who has faded into Hollywood obscurity.',110,4.44),(1000773,'Les Misérables',2012,'Fight. Dream. Hope. Love.','An adaptation of the successful stage musical based on Victor Hugo\'s classic novel set in 19th-century France, in which a paroled prisoner movie_named Jean Valjean seeks redemption.',158,3.58),(1000774,'Prometheus',2012,'The Search for Our Beginning Could Lead to Our End.','A team of explorers discover a clue to the origins of mankind on Earth, leading them on a journey to the darkest corners of the universe. There, they must fight a terrifying battle to save the future of the human race.',124,3.24),(1000775,'Death Proof',2007,'A crash course in revenge','Austin\'s hottest DJ, Jungle Julia, sets out into the night to unwind with her two friends Shanna and Arlene. Covertly tracking their moves is Stuntman Mike, a scarred rebel leering from behind the wheel of his muscle car, revving just feet away.',113,3.56),(1000776,'Murder on the Orient Express',2017,'Everyone is a suspect','Genius Belgian detective Hercule Poirot investigates the murder of an American tycoon aboard the Orient Express train.',114,3.06),(1000777,'Glass',2019,'You Cannot Contain What You Are','In a series of escalating encounters, former security guard David Dunn uses his supernatural abilities to track Kevin Wendell Crumb, a disturbed man who has twenty-four personalities. Meanwhile, the shadowy presence of Elijah Price emerges as an orchestrator who holds secrets critical to both men.',13,2.9),(1000778,'Klaus',2019,'Welcome to the jingle','When Jesper distinguishes himself as the Postal Academy\'s worst student, he is sent to Smeerensburg, a small village located on an icy island above the Arctic Circle, where grumpy inhabitants barely exchange words, let alone letters. Jesper is about to give up and abandon his duty as a postman when he meets local teacher Alva and Klaus, a mysterious carpenter who lives alone in a cabin full of handmade toys.',96,4.12),(1000779,'X-Men: Apocalypse',2016,'Only the strong will survive','After the re-emergence of the world\'s first mutant, world-destroyer Apocalypse, the X-Men must unite to defeat his extinction level plan.',144,2.58),(1000780,'The Twilight Saga: Breaking Dawn – Part 2',2012,'The epic finale that will live forever.','After the birth of Renesmee, the Cullens gather other vampire clans in order to protect the child from a false allegation that puts the family in front of the Volturi.',115,2.77),(1000781,'Pokémon Detective Pikachu',2019,'Partner Up!','In a world where people collect pocket-size monsters (Pokémon) to do battle, a boy comes across an intelligent monster who seeks to be a detective.',105,3.04),(1000782,'Immaculate',2024,'Not every intervention is divine.','An American nun embarks on a new journey when she joins a remote convent in the Italian countryside. However, her warm welcome quickly turns into a living nightmare when she discovers her new home harbours a sinister secret and unspeakable horrors.',89,2.97),(1000783,'Videodrome',1983,'First it controls your mind. Then it destroys your body.','As the president of a trashy TV channel, Max Renn is desperate for new programming to attract viewers. When he happens upon \"Videodrome,\" a TV show dedicated to gratuitous torture and punishment, Max sees a potential hit and broadcasts the show on his channel. However, after his girlfriend auditions for the show and never returns, Max investigates the truth behind Videodrome and discovers that the graphic violence may not be as fake as he thought.',88,3.88),(1000784,'The Place Beyond the Pines',2012,'If you ride like lightning you\'re gonna crash like thunder','A motorcycle stunt rider considers committing a crime in order to provide for his wife and child, an act that puts him on a collision course with a cop-turned-politician.',140,3.78),(1000785,'Maleficent',2014,'Don\'t believe the fairy tale.','A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land.  Maleficent rises to be the land\'s fiercest protector, but she ultimately suffers a ruthless betrayal – an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading King\'s successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom – and to Maleficent\'s true happiness as well.',97,3.17),(1000786,'Scary Movie',2000,'No mercy. No shame. No sequel.','Following on the heels of popular teen-scream horror movies, with uproarious comedy and biting satire. Marlon and Shawn Wayans, Shannon Elizabeth and Carmen Electra pitch in to skewer some of Hollywood\'s biggest blockbusters, including Scream, I Know What You Did Last Summer, The Matrix, American Pie and The Blair Witch Project.',88,3.06),(1000787,'High School Musical',2006,'This School Rocks Like No Other!','Troy, the popular captain of the basketball team, and Gabriella, the brainy and beautiful member of the academic club, break all the rules of East High society when they secretly audition for the leads in the school\'s musical. As they reach for the stars and follow their dreams, everyone learns about acceptance, teamwork, and being yourself.',98,3.16),(1000788,'The Fifth Element',1997,'There is no future without it.','In 2257, a taxi driver is unintentionally given the task of saving a young girl who is part of the key that will ensure the survival of humanity.',126,3.74),(1000789,'Spectre',2015,'A Plan No One Escapes','A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.',148,3.15),(1000790,'O Brother, Where Art Thou?',2000,'They have a plan...but not a clue.','In the deep south during the 1930s, three escaped convicts search for hidden treasure while a relentless lawman pursues them. On their journey they come across many comical characters and incredible situations. Based upon Homer\'s \'Odyssey\'.',107,3.94),(1000791,'Captain Fantastic',2016,'He Prepared Them for Everything Except the Outside World.','A father living in the forests of the Pacific Northwest with his six young kids tries to assimilate back into society.',118,3.92),(1000792,'Thirteen',2003,'It\'s happening so fast.','Tracy is a normal 13-year-old trying to make it in school. After befriending the most popular girl at school, Evie, Tracy\'s world is turned upside down when Evie introduces her to a world of sex, drugs and cash. But it isn\'t long before Tracy\'s new world and attitude finally takes a toll on her, her family, and old friends.',100,3.48),(1000793,'Transformers',2007,'Their war. Our world.','Young teenager, Sam Witwicky becomes involved in the ancient struggle between two extraterrestrial factions of transforming robots – the heroic Autobots and the evil Decepticons. Sam holds the clue to unimaginable power and the Decepticons will stop at nothing to retrieve it.',144,3.12),(1000794,'Fantastic Beasts: The Crimes of Grindelwald',2018,'Fate of One. Future of All.','Gellert Grindelwald has escaped imprisonment and has begun gathering followers to his cause—elevating wizards above all non-magical beings. The only one capable of putting a stop to him is the wizard he once called his closest friend, Albus Dumbledore. However, Dumbledore will need to seek help from the wizard who had thwarted Grindelwald once before, his former student Newt Scamander, who agrees to help, unaware of the dangers that lie ahead. Lines are drawn as love and loyalty are tested, even among the truest friends and family, in an increasingly divided wizarding world.',134,2.56),(1000795,'Shoplifters',2018,'Sometimes you choose your family.','After one of their shoplifting sessions, Osamu and his son come across a little girl in the freezing cold. At first reluctant to shelter the girl, Osamu’s wife agrees to take care of her after learning of the hardships she faces. Although the family is poor, barely making enough money to survive through petty crime, they seem to live happily together until an unforeseen incident reveals hidden secrets, testing the bonds that unite them.',120,4.3),(1000796,'Madame Web',2024,'Her web connects them all.','Forced to confront revelations about her past, paramedic Cassandra Webb forges a relationship with three young women destined for powerful futures...if they can all survive a deadly present.',116,1.49),(1000797,'The Gray Man',2022,'We\'re gonna train you to kill bad guys. And since you\'ve already killed one, it shouldn\'t be too difficult.','When a shadowy CIA agent uncovers damning agency secrets, he\'s hunted across the globe by a sociopathic rogue operative who\'s put a bounty on his head.',122,2.73),(1000798,'The Terminal',2004,'Life is waiting.','Viktor Navorski is a man without a country; his plane took off just as a coup d\'etat exploded in his homeland, leaving it in shambles, and now he\'s stranded at Kennedy Airport, where he\'s holding a passport that nobody recognizes. While quarantined in the transit lounge until authorities can figure out what to do with him, Viktor simply goes on living – and courts romance with a beautiful flight attendant.',128,3.59),(1000799,'The Butterfly Effect',2004,'Such minor changes, such huge consequences.','A young man struggles to access sublimated childhood memories. He finds a technique that allows him to travel back into the past, to occupy his childhood body and change history. However, he soon finds that every change he makes has unexpected consequences.',120,3.46),(1000800,'The Lion King',2019,'The King has Returned.','Simba idolizes his father, King Mufasa, and takes to heart his own royal destiny. But not everyone in the kingdom celebrates the new cub\'s arrival. Scar, Mufasa\'s brother—and former heir to the throne—has plans of his own. The battle for Pride Rock is ravaged with betrayal, tragedy and drama, ultimately resulting in Simba\'s exile. With help from a curious pair of newfound friends, Simba will have to figure out how to grow up and take back what is rightfully his.',118,2.77),(1000801,'District 9',2009,'You are not welcome here.','Thirty years ago, aliens arrive on Earth. Not to conquer or give aid, but to find refuge from their dying planet. Separated from humans in a South African area called District 9, the aliens are managed by Multi-National United, which is unconcerned with the aliens\' welfare but will do anything to master their advanced technology. When a company field agent contracts a mysterious virus that begins to alter his DNA, there is only one place he can hide: District 9.',112,3.8),(1000802,'Indiana Jones and the Kingdom of the Crystal Skull',2008,'The adventure continues . . .','Set during the Cold War, the Soviets – led by sword-wielding Irina Spalko – are in search of a crystal skull which has supernatural powers related to a mystical Lost City of Gold. After being captured and then escaping from them, Indy is coerced to head to Peru at the behest of a young man whose friend – and Indy\'s colleague – Professor Oxley has been captured for his knowledge of the skull\'s whereabouts.',122,2.69),(1000803,'The Twilight Saga: Breaking Dawn – Part 1',2011,'Forever is just the beginning','The new found married bliss of Bella Swan and vampire Edward Cullen is cut short when a series of betrayals and misfortunes threatens to destroy their world.',117,2.55),(1000804,'Men',2022,'What haunts you will find you.','In the aftermath of a personal tragedy, Harper retreats alone to the beautiful English countryside, hoping to find a place to heal. But someone or something from the surrounding woods appears to be stalking her. What begins as simmering dread becomes a fully-formed nightmare, inhabited by her darkest memories and fears.',100,2.82),(1000805,'I Care a Lot',2020,NULL,'A court-appointed legal guardian defrauds her older clients and traps them under her care. But her latest mark comes with some unexpected baggage.',119,3.11),(1000806,'Black Adam',2022,'The world needed a hero. It got Black Adam.','Nearly 5,000 years after he was bestowed with the almighty powers of the Egyptian gods—and imprisoned just as quickly—Black Adam is freed from his earthly tomb, ready to unleash his unique form of justice on the modern world.',125,2.31),(1000807,'Predator',1987,'Soon the hunt will begin.','Dutch and his group of commandos are hired by the CIA to rescue downed airmen from guerillas in a Central American jungle. The mission goes well but as they return they find that something is hunting them. Nearly invisible, it blends in with the forest, taking trophies from the bodies of its victims as it goes along. Occasionally seeing through its eyes, the audience sees it is an intelligent alien hunter, hunting them for sport, killing them off one at a time.',107,3.79),(1000808,'Sherlock Holmes',2009,'Nothing escapes him.','Eccentric consulting detective Sherlock Holmes and Doctor John Watson battle to bring down a new nemesis and unravel a deadly plot that could destroy England.',129,3.43),(1000809,'The King\'s Speech',2010,'Find your voice.','The King\'s Speech tells the story of the man who became King George VI, the father of Queen Elizabeth II. After his brother abdicates, George (\'Bertie\') reluctantly assumes the throne. Plagued by a dreaded stutter and considered unfit to be king, Bertie engages the help of an unorthodox speech therapist movie_named Lionel Logue. Through a set of unexpected techniques, and as a result of an unlikely friendship, Bertie is able to find his voice and boldly lead the country into war.',118,3.78),(1000810,'Aladdin',2019,'Choose Wisely.','A kindhearted street urchin movie_named Aladdin embarks on a magical adventure after finding a lamp that releases a wisecracking genie while a power-hungry Grand Vizier vies for the same lamp that has the power to make their deepest wishes come true.',127,2.95),(1000811,'Clue',1985,'Seven Suspects, Six Weapons, Five Bodies and Three Endings.','Clue finds six colorful dinner guests gathered at the mansion of their host, Mr. Boddy -- who turns up dead after his secret is exposed: He was blackmailing all of them. With the killer among them, the guests and Boddy\'s chatty butler must suss out the culprit before the body count rises.',94,3.85),(1000812,'Ralph Breaks the Internet',2018,'Who broke the internet?','Video game bad guy Ralph and fellow misfit Vanellope von Schweetz must risk it all by traveling to the World Wide Web in search of a replacement part to save Vanellope\'s video game, Sugar Rush. In way over their heads, Ralph and Vanellope rely on the citizens of the internet — the netizens — to help navigate their way, including an entrepreneur movie_named Yesss, who is the head algorithm and the heart and soul of trend-making site BuzzzTube.',112,2.91),(1000813,'Collateral',2004,'It started like any other night.','Cab driver Max picks up a man who offers him $600 to drive him around. But the promise of easy money sours when Max realizes his fare is an assassin.',120,3.85),(1000814,'Scream 3',2000,'Someone has taken their love of trilogies one step too far.','As bodies begin dropping around the set of ‘Stab 3’ — a movie sequel based on the gruesome Woodsboro killings — Sidney, Gale and Dewey are once again drawn into a game of horror movie mayhem.',117,2.82),(1000815,'Mission: Impossible – Rogue Nation',2015,'Desperate Times. Desperate Measures.','Ethan and team take on their most impossible mission yet—eradicating \'The Syndicate\', an International and highly-skilled rogue organisation committed to destroying the IMF.',131,3.71),(1000816,'Looper',2012,'Hunted By Your Future, Haunted By Your Past','In the futuristic action thriller Looper, time travel will be invented but it will be illegal and only available on the black market. When the mob wants to get rid of someone, they will send their target 30 years into the past where a looper, a hired gun, like Joe is waiting to mop up. Joe is getting rich and life is good until the day the mob decides to close the loop, sending back Joe\'s future self for assassination.',118,3.56),(1000817,'Gangs of New York',2002,'America was born in the streets.','It\'s 1863. America was born in the streets. Amsterdam Vallon returns to the Five Points of America to seek vengeance against the psychotic gangland kingpin, Bill the Butcher, who murdered his father years earlier. With an eager pickpocket by his side and a whole new army, Vallon fights his way to seek vengeance on the Butcher and restore peace in the area.',168,3.7),(1000818,'Mommy',2014,'Loving people doesn\'t save them','A peculiar neighbor offers hope to a recent widow who is struggling to raise a teenager who is unpredictable and, sometimes, violent.',138,4.31),(1000819,'Nausicaä of the Valley of the Wind',1984,'A young girl\'s love called forth miracles…','After a global war, the seaside kingdom known as the Valley of the Wind remains one of the last strongholds on Earth untouched by a poisonous jungle and the powerful insects that guard it. Led by the courageous Princess Nausicaä, the people of the Valley engage in an epic struggle to restore the bond between humanity and Earth.',117,4.15),(1000820,'The Birds',1963,'...and remember, the next scream you hear may be your own!','Chic socialite Melanie Daniels enjoys a passing flirtation with an eligible attorney in a San Francisco pet shop and, on an impulse, follows him to his hometown bearing a gift of lovebirds. But upon her arrival, the bird population runs amok. Suddenly, the townsfolk face a massive avian onslaught, with the feathered fiends inexplicably attacking people all over Bodega Bay.',120,3.76),(1000821,'Kingdom of the Planet of the Apes',2024,'No one can stop the reign.','Several generations in the future following Caesar\'s reign, apes are now the dominant species and live harmoniously while humans have been reduced to living in the shadows. As a new tyrannical ape leader builds his empire, one young ape undertakes a harrowing journey that will cause him to question all that he has known about the past and to make choices that will define a future for apes and humans alike.',145,3.4),(1000822,'Fear and Loathing in Las Vegas',1998,'Buy the ticket, take the ride','Raoul Duke and his attorney Dr. Gonzo drive a red convertible across the Mojave desert to Las Vegas with a suitcase full of drugs to cover a motorcycle race. As their consumption of drugs increases at an alarming rate, the stoned duo trash their hotel room and fear legal repercussions. Duke begins to drive back to L.A., but after an odd run-in with a cop, he returns to Sin City and continues his wild drug binge.',118,3.77),(1000823,'Hocus Pocus',1993,'It\'s just a bunch of Hocus Pocus.','After 300 years of slumber, three sister witches are accidentally resurrected in Salem on Halloween night, and it is up to three kids and their newfound feline friend to put an end to the witches\' reign of terror once and for all.',96,3.44),(1000824,'Sinister',2012,'Once you see him, nothing can save you.','Found footage helps a true-crime novelist realize how and why a family was murdered in his new home, though his discoveries put his entire family in the path of a supernatural entity.',110,3.32),(1000825,'Bee Movie',2007,'Born to bee wild.','Barry B. Benson, a bee who has just graduated from college, is disillusioned at his lone career choice: making honey. On a special trip outside the hive, Barry\'s life is saved by Vanessa, a florist in New York City. As their relationship blossoms, he discovers humans actually eat honey, and subsequently decides to sue us.',91,2.89),(1000826,'Unbreakable',2000,'Some things are only revealed by accident','An ordinary man makes an extraordinary discovery when a train accident leaves his fellow passengers dead — and him unscathed. The answer to this mystery could lie with the mysterious Elijah Price, a man who suffers from a disease that renders his bones as fragile as glass.',106,3.68),(1000827,'Friday the 13th',1980,'They were warned...They are doomed...And on Friday the 13th, nothing will save them.','Camp counselors are stalked and murdered by an unknown assailant while trying to reopen a summer camp that was the site of a child\'s drowning.',95,3),(1000828,'Cloudy with a Chance of Meatballs',2009,'Prepare to get served.','Inventor Flint Lockwood creates a machine that makes clouds rain food, enabling the down-and-out citizens of Chewandswallow to feed themselves. But when the falling food reaches gargantuan proportions, Flint must scramble to avert disaster. Can he regain control of the machine and put an end to the wild weather before the town is destroyed?',90,3.35),(1000829,'Ghost in the Shell',1995,'It found a voice... Now it needs a body.','In the year 2029, the barriers of our world have been broken down by the net and by cybernetics, but this brings new vulnerability to humans in the form of brain-hacking. When a highly-wanted hacker known as \'The Puppetmaster\' begins involving them in politics, Section 9, a group of cybernetically enhanced cops, are called in to investigate and stop the Puppetmaster.',82,4.08),(1000830,'Interview with the Vampire',1994,'Drink from me and live forever','A vampire relates his epic life story of love, betrayal, loneliness, and dark hunger to an over-curious reporter.',123,3.58),(1000831,'The Apartment',1960,'Movie-wise, there has never been anything like it - laugh-wise, love-wise, or otherwise-wise!','Bud Baxter is a minor clerk in a huge New York insurance company, until he discovers a quick way to climb the corporate ladder. He lends out his apartment to the executives as a place to take their mistresses. Although he often has to deal with the aftermath of their visits, one night he\'s left with a major problem to solve.',125,4.43),(1000832,'Bram Stoker\'s Dracula',1992,'The blood is life.','When Dracula leaves the captive Jonathan Harker and Transylvania for London in search of Mina Harker, the reincarnation of Dracula\'s long-dead wife Elisabeta, obsessed vampire hunter Dr. Van Helsing sets out to end the madness.',127,3.67),(1000833,'Twelve Monkeys',1995,'The future is history.','In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earth\'s population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, he\'s arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.',129,3.86),(1000834,'Argo',2012,'The movie was fake. The mission was real.','As the Iranian revolution reaches a boiling point, a CIA \'exfiltration\' specialist concocts a risky plan to free six Americans who have found shelter at the home of the Canadian ambassador.',120,3.71),(1000835,'Pig',2021,'We don\'t get a lot of things to really care about.','A truffle hunter who lives alone in the Oregonian wilderness must return to his past in Portland in search of his beloved foraging pig after she is kidnapped.',92,3.76),(1000836,'Hugo',2011,'One of the most legendary directors of our time takes you on an extraordinary adventure.','Orphaned and alone except for an uncle, Hugo Cabret lives in the walls of a train station in 1930s Paris. Hugo\'s job is to oil and maintain the station\'s clocks, but to him, his more important task is to protect a broken automaton and notebook left to him by his late father. Accompanied by the goddaughter of an embittered toy merchant, Hugo embarks on a quest to solve the mystery of the automaton and find a place he can call home.',126,3.5),(1000837,'First Reformed',2017,NULL,'A pastor of a small church in upstate New York starts to spiral out of control after a soul-shaking encounter with an unstable environmental activist and his pregnant wife.',113,4.04),(1000838,'Borat Subsequent Moviefilm',2020,'Delivery of prodigious bribe to American regime for make benefit once glorious nation of Kazakhstan.','14 years after making a film about his journey across the USA, Borat risks life and limb when he returns to the United States with his young daughter, and reveals more about the culture, the COVID-19 pandemic, and the political elections.',96,3.28),(1000839,'Project X',2012,'Witness it','Three high school seniors throw a party to make a movie_name for themselves. As the night progresses, things spiral out of control as word of the party spreads.',88,3.2),(1000840,'The Elephant Man',1980,'I am not an animal! I am a human being! I … am … a man!','A Victorian surgeon rescues a heavily disfigured man being mistreated by his \"owner\" as a side-show freak. Behind his monstrous façade, there is revealed a person of great intelligence and sensitivity. Based on the true story of Joseph Merrick (called John Merrick in the film), a severely deformed man in 19th century London.',124,4.23),(1000841,'Lawrence of Arabia',1962,'A mighty motion picture of action and adventure!','The story of British officer T.E. Lawrence\'s mission to aid the Arab tribes in their revolt against the Ottoman Empire during the First World War. Lawrence becomes a flamboyant, messianic figure in the cause of Arab unity but his psychological instability threatens to undermine his achievements.',228,4.36),(1000842,'Mission: Impossible – Ghost Protocol',2011,'No Plan. No Backup. No Choice.','Ethan Hunt and his team are racing against time to track down a dangerous terrorist movie_named Hendricks, who has gained access to Russian nuclear launch codes and is planning a strike on the United States. An attempt to stop him ends in an explosion causing severe destruction to the Kremlin and the IMF to be implicated in the bombing, forcing the President to disavow them. No longer being aided by the government, Ethan and his team chase Hendricks around the globe, although they might still be too late to stop a disaster.',133,3.71),(1000843,'Rain Man',1988,'A journey through understanding and fellowship.','Selfish yuppie Charlie Babbitt\'s father left a fortune to his savant brother Raymond and a pittance to Charlie; they travel cross-country.',134,3.87),(1000844,'Love, Rosie',2014,'Right Love. Wrong Time.','Since the moment they met at age 5, Rosie and Alex have been best friends, facing the highs and lows of growing up side by side. A fleeting shared moment, one missed opportunity, and the decisions that follow send their lives in completely different directions. As each navigates the complexities of life, love, and everything in between, they always find their way back to each other - but is it just friendship, or something more?  Based on Cecelia Ahern\'s bestselling novel, LOVE, ROSIE is a heart-warming, modern comedy-of-errors posing the ultimate question: do we really only get one shot at true love?',102,3.61),(1000845,'Batman Returns',1992,'The Bat, the Cat, the Penguin.','Having defeated the Joker, Batman now faces the Penguin—a warped and deformed individual who is intent on being accepted into Gotham society, with the help of Max Schreck, a crooked businessman, whom he coerces into helping him run for the position of Mayor of Gotham, while they both attempt to frame Batman in a different light. Batman must attempt to clear his movie_name, all while also deciding just what must be done with the mysterious Catwoman slinking about.',126,3.55),(1000846,'Happy Death Day',2017,'Get up. Live your day. Get killed. Again.','Caught in a bizarre and terrifying time warp, college student Tree finds herself repeatedly reliving the day of her murder, ultimately realizing that she must identify the killer and the reason for her death before her chances of survival run out.',97,3.01),(1000847,'Porco Rosso',1992,'A Pig\'s Got to Fly','Porco Rosso, known in Japan as Crimson Pig (Kurenai no Buta) is the sixth animated film by Hayao Miyazaki and released in 1992. You\'re introduced to an Italian World War I fighter ace, now living as a freelance bounty hunter chasing \"air pirates\" in the Adriatic Sea. He has been given a curse that changed his head to that of a pig. Once called Marco Pagot, he is now known to the world as \"Porco Rosso\", Italian for \"Red Pig.\"',93,3.99),(1000848,'Saw X',2023,'Witness the return of Jigsaw.','Between the events of \'Saw\' and \'Saw II\', a sick and desperate John Kramer travels to Mexico for a risky and experimental medical procedure in hopes of a miracle cure for his cancer, only to discover the entire operation is a scam to defraud the most vulnerable. Armed with a newfound purpose, the infamous serial killer returns to his work, turning the tables on the con artists in his signature visceral way through devious, deranged, and ingenious traps.',118,3.23),(1000849,'The Purge',2013,'One night a year, all crime is legal.','Given the country\'s overcrowded prisons, the U.S. government begins to allow 12-hour periods of time in which all illegal activity is legal. During one of these free-for-alls, a family must protect themselves from a home invasion.',86,2.7),(1000850,'The Last Duel',2021,'The true story of a woman who defied a nation and made history.','King Charles VI declares that Knight Jean de Carrouges settle his dispute with his squire by challenging him to a duel.',153,3.73),(1000851,'Halloween',2018,'Face your fate','Laurie Strode comes to her final confrontation with Michael Myers, the masked figure who has haunted her since she narrowly escaped his killing spree on Halloween night four decades ago.',106,3.21),(1000852,'Enchanted',2007,'This fairytale princess is about to meet a real Prince Charming.','The beautiful princess Giselle is banished by an evil queen from her magical, musical animated land and finds herself in the gritty reality of the streets of modern-day Manhattan. Shocked by this strange new environment that doesn\'t operate on a \"happily ever after\" basis, Giselle is now adrift in a chaotic world badly in need of enchantment. But when Giselle begins to fall in love with a charmingly flawed divorce lawyer who has come to her aid - even though she is already promised to a perfect fairy tale prince back home - she has to wonder: Can a storybook view of romance survive in the real world?',107,3.5),(1000853,'Whisper of the Heart',1995,'I found someone I like.','Shizuku lives a simple life, dominated by her love for stories and writing. One day she notices that all the library books she has have been previously checked out by the same person: \'Seiji Amasawa\'.',111,4.16),(1000854,'Green Room',2015,'One way in. No way out.','A punk rock band becomes trapped in a secluded venue after finding a scene of violence. For what they saw, the band themselves become targets of violence from a gang of white power skinheads, who want to eliminate all evidence of the crime.',95,3.65),(1000855,'8½',1963,'A picture that goes beyond what men think about - because no man ever thought about it in quite this way!','Guido Anselmi, a film director, finds himself creatively barren at the peak of his career. Urged by his doctors to rest, Anselmi heads for a luxurious resort, but a sorry group gathers—his producer, staff, actors, wife, mistress, and relatives—each one begging him to get on with the show. In retreat from their dependency, he fantasizes about past women and dreams of his childhood.',139,4.3),(1000856,'Step Brothers',2008,'They grow up so fast.','Brennan Huff and Dale Doback might be grown men. But that doesn\'t stop them from living at home and turning into jealous, competitive stepbrothers when their single parents marry. Brennan\'s constant competition with Dale strains his mom\'s marriage to Dale\'s dad, leaving everyone to wonder whether they\'ll ever see eye to eye.',98,3.44),(1000857,'The Matrix Revolutions',2003,'Everything that has a beginning has an end.','The human city of Zion defends itself against the massive invasion of the machines as Neo fights to end the war at another front while also opposing the rogue Agent Smith.',129,3.05),(1000858,'Waves',2019,'Love is patient','A controlling father’s attempts to ensure that his two children succeed in high school backfire after his son experiences a career-ending sports injury. Their familial bonds are eventually placed under severe strain by an unexpected tragedy.',135,3.86),(1000859,'Grown Ups',2010,'Boys will be boys. . . some longer than others.','After their high school basketball coach passes away, five good friends and former teammates reunite for a Fourth of July holiday weekend.',102,2.98),(1000860,'The Conjuring: The Devil Made Me Do It',2021,'The demonic case that shocked America.','Paranormal investigators Ed and Lorraine Warren encounter what would become one of the most sensational cases from their files. The fight for the soul of a young boy takes them beyond anything they\'d ever seen before, to mark the first time in U.S. history that a murder suspect would claim demonic possession as a defense.',111,2.73),(1000861,'300',2006,'Spartans, prepare for glory!','Based on Frank Miller\'s graphic novel, \"300\" is very loosely based the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the world\'s first democracy.',116,3.35),(1000862,'Mandy',2018,NULL,'The Shadow Mountains, 1983. Red and Mandy lead a loving and peaceful existence; but when their pine-scented haven is savagely destroyed, Red is catapulted into a phantasmagoric journey filled with bloody vengeance and laced with fire.',122,3.61),(1000863,'American Hustle',2013,'Everyone Hustles To Survive','A conman and his seductive partner are forced to work for a wild FBI agent, who pushes them into a world of Jersey power-brokers and the Mafia.',138,3.32),(1000864,'Harakiri',1962,'The world has never understood why the Japanese prefer death to dishonor! Winner of Prix Special du Jury at Cannes 1963 provides the answer!!','Down-on-his-luck veteran Tsugumo Hanshirō enters the courtyard of the prosperous House of Iyi. Unemployed, and with no family, he hopes to find a place to commit seppuku—and a worthy second to deliver the coup de grâce in his suicide ritual. The senior counselor for the Iyi clan questions the ronin’s resolve and integrity, suspecting Hanshirō of seeking charity rather than an honorable end. What follows is a pair of interlocking stories which lay bare the difference between honor and respect, and promises to examine the legendary foundations of the Samurai code.',135,4.69),(1000865,'Monster',2023,'Are they the ones we dream of, or the ones we fail to see among us?','When her young son Minato starts to behave strangely, his mother feels that there is something wrong. Discovering that a teacher is responsible, she storms into the school demanding to know what\'s going on. But as the story unfolds through the eyes of mother, teacher and child, the truth gradually emerges.',125,4.3),(1000866,'Adaptation.',2002,'From the creator of Being John Malkovich, comes the story about the creator of Being John Malkovich.','A love-lorn script writer grows increasingly desperate in his quest to adapt the book \'The Orchid Thief\'.',115,4.11),(1000867,'Sweeney Todd: The Demon Barber of Fleet Street',2007,'Never Forget. Never Forgive.','The infamous story of Benjamin Barker, a.k.a Sweeney Todd, who sets up a barber shop down in London which is the basis for a sinister partnership with his fellow tenant, Mrs. Lovett. Based on the hit Broadway musical.',116,3.5),(1000868,'Lightyear',2022,'Infinity awaits.','Legendary Space Ranger Buzz Lightyear embarks on an intergalactic adventure alongside a group of ambitious recruits and his robot companion Sox.',105,2.85),(1000869,'Fear Street: 1978',2021,'Find the truth.','In 1978, two rival groups at Camp Nightwing must band together to solve a terrifying mystery when horrors from their towns\' history come alive.',110,3.39),(1000870,'Braveheart',1995,'Every man dies. Not every man truly lives.','Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.',177,3.87),(1000871,'Metropolis',1927,'There can be no understanding between the hands and the brain unless the heart acts as mediator.','In a futuristic city sharply divided between the working class and the city planners, the son of the city\'s mastermind falls in love with a working class prophet who predicts the coming of a savior to mediate their differences.',153,4.26),(1000872,'Hunt for the Wilderpeople',2016,'Nature just got gangster','Ricky is a defiant young city kid who finds himself on the run with his cantankerous foster uncle in the wild New Zealand bush. A national manhunt ensues, and the two are forced to put aside their differences and work together to survive.',101,4.06),(1000873,'Don\'t Breathe',2016,'This house looked like an easy target, until they found out what was inside.','A group of teens break into a blind man\'s home thinking they\'ll get away with the perfect crime. They\'re wrong.',89,3.33),(1000874,'Lost Highway',1997,NULL,'A tormented jazz musician finds himself lost in an enigmatic story involving murder, surveillance, gangsters, doppelgangers, and an impossible transformation inside a prison cell.',134,4.05),(1000875,'Death on the Nile',2022,'Murder was just the beginning.','Belgian sleuth Hercule Poirot’s Egyptian vacation aboard a glamorous river steamer turns into a terrifying search for a murderer when a picture-perfect couple’s idyllic honeymoon is tragically cut short.',127,2.67),(1000876,'Godzilla',2014,'The world ends, Godzilla begins.','Ford Brody, a Navy bomb expert, has just reunited with his family in San Francisco when he is forced to go to Japan to help his estranged father, Joe. Soon, both men are swept up in an escalating crisis when an ancient alpha predator arises from the sea to combat malevolent adversaries that threaten the survival of humanity. The creatures leave colossal destruction in their wake, as they make their way toward their final battleground: San Francisco.',123,3.05),(1000877,'8 Mile',2002,'Every moment is another chance','The setting is Detroit in 1995. The city is divided by 8 Mile, a road that splits the town in half along racial lines. A young white rapper, Jimmy \"B-Rabbit\" Smith Jr. summons strength within himself to cross over these arbitrary boundaries to fulfill his dream of success in hip hop. With his pal Future and the three one third in place, all he has to do is not choke.',111,3.57),(1000878,'The Skin I Live In',2011,NULL,'A brilliant plastic surgeon creates a synthetic skin that withstands any kind of damage. His guinea pig: a mysterious and volatile woman who holds the key to his obsession.',120,3.85),(1000879,'Anchorman: The Legend of Ron Burgundy',2004,'They bring you the news so you don\'t have to get it yourself.','It\'s the 1970s, and San Diego super-sexist anchorman Ron Burgundy is the top dog in local TV, but that\'s all about to change when ambitious reporter Veronica Corningstone arrives as a new employee at his station.',95,3.49),(1000880,'Despicable Me 2',2013,'Back 2 Work','Gru is recruited by the Anti-Villain League to help deal with a powerful new super criminal.',98,3.11),(1000881,'Yesterday',2019,'Everyone in the world has forgotten The Beatles. Everyone except Jack…','Jack Malik is a struggling singer-songwriter in an English seaside town whose dreams of fame are rapidly fading, despite the fierce devotion and support of his childhood best friend, Ellie. After a freak bus accident during a mysterious global blackout, Jack wakes up to discover that he\'s the only person on Earth who can remember The Beatles.',116,2.89),(1000882,'The Simpsons Movie',2007,'See our family. And feel better about yours.','After Homer accidentally pollutes the town\'s water supply, Springfield is encased in a gigantic dome by the EPA and the Simpsons are declared fugitives.',87,3.44),(1000883,'Theater Camp',2023,'You only fit in by acting out.','After the indomitable and beloved founder of a scrappy theater camp in upstate New York falls into a coma, the eccentric staff must band together with her clueless \"crypto-bro\" son to keep the thespian paradise afloat.',93,3.76),(1000884,'The Ballad of Buster Scruggs',2018,'Stories live forever. People don\'t.','Vignettes weaving together the stories of six individuals in the old West at the end of the Civil War. Following the tales of a sharp-shooting songster, a wannabe bank robber, two weary traveling performers, a lone gold prospector, a woman traveling the West to an uncertain future, and a motley crew of strangers undertaking a carriage ride.',132,3.65),(1000885,'Monster House',2006,'The house is . . . alive!','Monsters under the bed are scary enough, but what happens when an entire house is out to get you? Three teens aim to find out when they go up against a decrepit neighboring home and unlock its frightening secrets.',91,3.36),(1000886,'Click',2006,'What If You Had A Remote... That Controlled Your Universe?','A harried workaholic, Michael Newman doesn\'t have time for his wife and children, not if he\'s to impress his ungrateful boss and earn a well-deserved promotion. So when he meets Morty, a loopy sales clerk, he gets the answer to his prayers: a magical remote that allows him to bypass life\'s little distractions with increasingly hysterical results.',107,2.83),(1000887,'The Neon Demon',2016,'Beauty is vicious.','When aspiring model Jesse moves to Los Angeles, her youth and vitality are devoured by a group of beauty-obsessed women who will take any means necessary to get what she has.',118,3.17),(1000888,'You Were Never Really Here',2017,'Based on true events.','A traumatised veteran, unafraid of violence, tracks down missing girls for a living. When a job spins out of control, Joe\'s nightmares overtake him as a conspiracy is uncovered leading to what may be his death trip or his awakening.',89,3.7),(1000889,'Tarzan',1999,'An immortal legend. As you\'ve only imagined.','Tarzan was a small orphan who was raised by an ape movie_named Kala since he was a child. He believed that this was his family, but on an expedition Jane Porter is rescued by Tarzan. He then finds out that he\'s human. Now Tarzan must make the decision as to which family he should belong to...',88,3.68),(1000890,'Training Day',2001,'The only thing more dangerous than the line being crossed, is the cop who will cross it.','On his first day on the job as a narcotics officer, a rookie cop works with a rogue detective who isn\'t what he appears.',122,3.97),(1000891,'A Haunting in Venice',2023,'Death was only the beginning.','Celebrated sleuth Hercule Poirot, now retired and living in self-imposed exile in Venice, reluctantly attends a Halloween séance at a decaying, haunted palazzo. When one of the guests is murdered, the detective is thrust into a sinister world of shadows and secrets.',104,3.01),(1000892,'Y Tu Mamá También',2001,'Life has its ways of teaching','In Mexico, two teenage boys and an attractive older woman embark on a road trip and learn a thing or two about life, friendship, sex, and each other.',106,4.19),(1000893,'Orphan',2009,'Can you keep a secret?','A married couple with a rocky past adopt 9-year old, Esther to fill the void created by a recently-stillborn baby. However, Esther is not quite who she seems.',122,3.27),(1000894,'Hellraiser',1987,'He\'ll tear your soul apart.','An unfaithful wife encounters the zombie of her dead lover while the demonic cenobites are pursuing him after he escaped their sadomasochistic underworld.',94,3.53),(1000895,'First Man',2018,'One giant leap into the unknown','A look at the life of the astronaut, Neil Armstrong, and the legendary space mission that led him to become the first man to walk on the Moon on July 20, 1969.',141,3.67),(1000896,'Under the Silver Lake',2018,'What are they hiding?','Young and disenchanted Sam meets a mysterious and beautiful woman who\'s swimming in his building\'s pool one night. When she suddenly vanishes the next morning, Sam embarks on a surreal quest across Los Angeles to decode the secret behind her disappearance, leading him into the murkiest depths of mystery, scandal and conspiracy.',139,3.48),(1000897,'X2',2003,'The time has come for those who are different to stand united.','Professor Charles Xavier and his team of genetically gifted superheroes face a rising tide of anti-mutant sentiment led by Col. William Stryker. Storm, Wolverine and Jean Grey must join their usual nemeses—Magneto and Mystique—to unhinge Stryker\'s scheme to exterminate all mutants.',133,3.42),(1000898,'Creed III',2023,'You can\'t run from your past.','After dominating the boxing world, Adonis Creed has been thriving in both his career and family life. When a childhood friend and former boxing prodigy, Damien Anderson, resurfaces after serving a long sentence in prison, he is eager to prove that he deserves his shot in the ring. The face-off between former friends is more than just a fight. To settle the score, Adonis must put his future on the line to battle Damien - a fighter who has nothing to lose.',116,3.46),(1000899,'The Others',2001,'Sooner or later she\'ll see them, then everything will be different.','Grace is a religious woman who lives in an old house kept dark because her two children, Anne and Nicholas, have a rare sensitivity to light. When the family begins to suspect the house is haunted, Grace fights to protect her children at any cost in the face of strange events and disturbing visions.',104,3.74),(1000900,'Are You There God? It\'s Me, Margaret.',2023,'Discovering who you are is a journey that lasts a lifetime.','When her family moves from the city to the suburbs, 11-year-old Margaret navigates new friends, feelings, and the beginning of adolescence.',107,3.8),(1000901,'Closer',2004,'If you believe in love at first sight, you never stop looking.','Two couples disintegrate when they begin destructive adulterous affairs with each other.',104,3.4),(1000902,'The King',2019,'All hail','England, 15th century. Hal, a capricious prince who lives among the populace far from court, is forced by circumstances to reluctantly accept the throne and become Henry V.',140,3.38),(1000903,'Annie Hall',1977,'A nervous romance.','New York comedian Alvy Singer falls in love with the ditsy Annie Hall.',93,4.04),(1000904,'20th Century Women',2016,NULL,'In 1979 Santa Barbara, California, Dorothea Fields is a determined single mother in her mid-50s who is raising her adolescent son, Jamie, at a moment brimming with cultural change and rebellion. Dorothea enlists the help of two younger women – Abbie, a free-spirited punk artist living as a boarder in the Fields\' home and Julie, a savvy and provocative teenage neighbour – to help with Jamie\'s upbringing.',119,4),(1000905,'Morbius',2022,'The line between hero and villain will be broken.','Dangerously ill with a rare blood disorder, and determined to save others suffering his same fate, Dr. Michael Morbius attempts a desperate gamble. What at first appears to be a radical success soon reveals itself to be a remedy potentially worse than the disease.',105,1.6),(1000906,'The Machinist',2004,'A little guilt goes a long way...','The Machinist is the story of Trevor Reznik, a lathe-operator who is dying of insomnia. In a machine shop, occupational hazards are bad enough under normal circumstances; yet for Trevor the risks are compounded by fatigue. Trevor has lost the ability to sleep. This is no ordinary insomnia...',101,3.75),(1000907,'My Own Private Idaho',1991,'Wherever, whatever, have a nice day.','In this loose adaptation of Shakespeare\'s \"Henry IV,\" Mike Waters is a hustler afflicted with narcolepsy. Scott Favor is the rebellious son of a mayor. Together, the two travel from Portland, Oregon to Idaho and finally to the coast of Italy in a quest to find Mike\'s estranged mother. Along the way they turn tricks for money and drugs, eventually attracting the attention of a wealthy benefactor and sexual deviant.',104,3.87),(1000908,'The Godfather: Part III',1990,'All the power on earth can\'t change destiny.','In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don, Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.',162,3.46),(1000909,'Pirates of the Caribbean: On Stranger Tides',2011,'Live Forever Or Die Trying.','Captain Jack Sparrow crosses paths with a woman from his past, and he\'s not sure if it\'s love -- or if she\'s a ruthless con artist who\'s using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Anne\'s Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesn\'t know who to fear more: Blackbeard or the woman from his past.',137,2.79),(1000910,'The SpongeBob SquarePants Movie',2004,'Bigger. Better. More absorbent.','There\'s trouble brewing in Bikini Bottom. Someone has stolen King Neptune\'s crown, and it looks like Mr. Krab, SpongeBob\'s boss, is the culprit. Though he\'s just been passed over for the promotion of his dreams, SpongeBob stands by his boss, and along with his best pal Patrick, sets out on a treacherous mission to Shell City to reclaim the crown and save Mr. Krab\'s life.',87,3.86),(1000911,'Signs',2002,'It’s not like they didn’t warn us.','A family living on a farm finds mysterious crop circles in their fields which suggests something more frightening to come.',106,3.46),(1000912,'Chicken Run',2000,'This ain\'t no chick flick. It\'s poultry in motion.','Having been hopelessly repressed and facing eventual certain death at the British chicken farm where they are held, Ginger the chicken along with the help of Rocky the American rooster decide to rebel and lead their fellow chickens in a great escape from the murderous farmers Mr. and Mrs. Tweedy and their farm of doom.',84,3.59),(1000913,'Loving Vincent',2017,NULL,'The film brings the paintings of Vincent van Gogh to life to tell his remarkable story. Every one of the 65,000 frames of the film is an oil-painting hand-painted by 125 professional oil-painters who travelled from all across the world to the Loving Vincent studios in Poland and Greece to be a part of the production. As remarkable as Vincent’s brilliant paintings are his passionate and ill-fated life and mysterious death.',95,3.96),(1000914,'The Adam Project',2022,'Past meets future.','After accidentally crash-landing in 2022, time-traveling fighter pilot Adam Reed teams up with his 12-year-old self on a mission to save the future.',106,2.93),(1000915,'C\'mon C\'mon',2021,NULL,'Johnny and his young nephew forge a tenuous but transformational relationship when they embark on a cross-country trip to see life away from Los Angeles.',109,4.13),(1000916,'Zombieland: Double Tap',2019,NULL,'Columbus, Tallahassee, Wichita, and Little Rock move to the American heartland as they face off against evolved zombies, fellow survivors, and the growing pains of the snarky makeshift family.',99,3),(1000917,'L.A. Confidential',1997,'Everything is suspect... Everyone is for sale... And nothing is what it seems.','Three detectives in the corrupt and brutal L.A. police force of the 1950s use differing methods to uncover a conspiracy behind the shotgun slayings of the patrons at an all-night diner.',138,4.07),(1000918,'Submarine',2010,'A comedy that doesn\'t let principles stand in the way of progress.','15-year-old deep-thinking Welsh schoolboy, Oliver Tate struggles to initiate and maintain a relationship with Jordana, his devilish, dark-haired classmate at their Swansea high school. As his parents\' marriage begins to fall apart, similar problems arise in his relationship with Jordana.',97,3.83),(1000919,'Sing Street',2016,'Boy meets girl. Girl unimpressed. Boy starts band.','A boy growing up in Dublin during the 1980s escapes his strained family life by starting a band to impress the mysterious girl he likes.',106,4.02),(1000920,'Once Upon a Time in America',1984,'Crime, passion and lust for power.','A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.',229,4.21),(1000921,'Passengers',2016,'There is a reason they woke up.','A spacecraft traveling to a distant colony planet and transporting thousands of people has a malfunction in its sleep chambers. As a result, two passengers are awakened 90 years early.',116,2.8),(1000922,'Enter the Void',2009,'Sex. Money. Power.','This psychedelic tour of life after death is seen entirely from the point of view of Oscar, a young American drug dealer and addict living in Tokyo with his prostitute sister, Linda. When Oscar is killed by police during a bust gone bad, his spirit journeys from the past -- where he sees his parents before their deaths -- to the present -- where he witnesses his own autopsy -- and then to the future, where he looks out for his sister from beyond the grave.',161,3.76),(1000923,'The World\'s End',2013,'Good food. Fine ales. Total Annihilation.','Five friends who reunite in an attempt to top their epic pub crawl from 20 years earlier unwittingly become humankind\'s only hope for survival.',109,3.62),(1000924,'Funny Games',1997,NULL,'Two psychotic young men take a mother, father, and son hostage in their vacation cabin and force them to play sadistic \"games\" with one another for their own amusement.',109,3.95),(1000925,'RoboCop',1987,'Part man. Part machine. All cop. The future of law enforcement.','In a dystopic and crime-ridden Detroit, a terminally wounded cop returns to the force as a powerful cyborg haunted by submerged memories.',102,3.92),(1000926,'The Lost World: Jurassic Park',1997,'Something has survived.','Four years after Jurassic Park\'s genetically bred dinosaurs ran amok, multimillionaire John Hammond shocks chaos theorist Ian Malcolm by revealing that Hammond has been breeding more beasties at a secret location. Malcolm, his paleontologist ladylove and a wildlife videographer join an expedition to document the lethal lizards\' natural behavior in this action-packed thriller.',129,3.08),(1000927,'Moon Knight',2022,'Embrace the chaos.','When Steven Grant, a mild-mannered gift-shop employee, becomes plagued with blackouts and memories of another life, he discovers he has dissociative identity disorder and shares a body with mercenary Marc Spector. As Steven/Marc’s enemies converge upon them, they must navigate their complex identities while thrust into a deadly mystery among the powerful gods of Egypt.',282,3.57),(1000928,'Paths of Glory',1957,'It explodes in the no-man\'s land no picture ever dared cross before!','A commanding officer defends three scapegoats on trial for a failed offensive that occurred within the French Army in 1916.',88,4.45),(1000929,'Snow White and the Seven Dwarfs',1937,'The Happiest, Dopiest, Grumpiest, Sneeziest movie of the year.','A beautiful girl, Snow White, takes refuge in the forest in the house of seven dwarfs to hide from her stepmother, the wicked Queen. The Queen is jealous because she wants to be known as \"the fairest in the land,\" and Snow White\'s beauty surpasses her own.',83,3.43),(1000930,'Sonic the Hedgehog',2020,'A Whole New Speed of Hero','Based on the global blockbuster videogame franchise from Sega, Sonic the Hedgehog tells the story of the world’s speediest hedgehog as he embraces his new home on Earth. In this live-action adventure comedy, Sonic and his new best friend team up to defend the planet from the evil genius Dr. Robotnik and his plans for world domination.',99,2.85),(1000931,'Who Framed Roger Rabbit',1988,'It\'s the story of a man, a woman, and a rabbit in a triangle of trouble.','\'Toon star Roger is worried that his wife Jessica is playing pattycake with someone else, so the studio hires detective Eddie Valiant to snoop on her. But the stakes are quickly raised when Marvin Acme is found dead and Roger is the prime suspect.',104,3.94),(1000932,'Totally Killer',2023,'Murder is so 1987.','When the infamous \"Sweet Sixteen Killer\" returns 35 years after his first murder spree to claim another victim, 17-year-old Jamie accidentally travels back in time to 1987, determined to stop the killer before he can start.',105,3.12),(1000933,'The Piano Teacher',2001,'Perversion at its wicked best!','Erika Kohut, a sexually repressed piano teacher living with her domineering mother, meets a young man who starts romantically pursuing her.',131,4.1),(1000934,'The Lost Daughter',2021,'Being a mother is a crushing responsibility.','A woman\'s seaside vacation takes a dark turn when her obsession with a young mother forces her to confront secrets from her past.',121,3.52),(1000935,'The Addams Family',1991,'Weird Is Relative','When an evil doctor finds out Uncle Fester has been missing for 25 years, he introduces a fake Fester in an attempt to get the Addams family\'s money. Wednesday has some doubts about the new uncle Fester, but the fake uncle adapts very well to the strange family.',102,3.69),(1000936,'Some Like It Hot',1959,'Marilyn Monroe and her bosom companions... Tony Curtis... Jack Lemmon...','Two musicians witness a mob hit and struggle to find a way out of the city before they are found by the gangsters. Their only opportunity is to join an all-girl band as they leave on a tour. To make their getaway they must first disguise themselves as women, then keep their identities secret and deal with the problems this brings - such as an attractive bandmate and a very determined suitor.',122,4.24),(1000937,'North by Northwest',1959,'A 2000 MILE CHASE . . . That blazes a trail of TERROR to a gripping, spine-chilling climax !','Advertising man Roger Thornhill is mistaken for a spy, triggering a deadly cross-country chase.',136,4.19),(1000938,'Godzilla × Kong: The New Empire',2024,'Rise together or fall alone.','Following their explosive showdown, Godzilla and Kong must reunite against a colossal undiscovered threat hidden within our world, challenging their very existence – and our own.',115,2.77),(1000939,'Bridge to Terabithia',2007,'Close your eyes, but keep your mind wide open.','Jesse Aarons trained all summer to become the fastest runner in school, so he\'s very upset when newcomer Leslie Burke outruns him and everyone else. Despite this and other differences, including that she\'s rich, he\'s poor, and she\'s a city girl, he\'s a country boy, the two become fast friends. Together, they create Terabithia, a land of monsters, trolls, ogres, and giants and rule as king and queen.',96,3.59),(1000940,'Chicago',2002,'If you can\'t be famous, be infamous.','Murderesses Velma Kelly and Roxie Hart find themselves on death row together and fight for the fame that will keep them from the gallows in 1920s Chicago.',113,3.89),(1000941,'BEEF',2023,'Revenge is best served raw.','A road rage incident between two strangers — a failing contractor and an unfulfilled entrepreneur — sparks a feud that brings out their darkest impulses.',351,4.24),(1000942,'Spring Breakers',2012,'A little sun can bring out your dark side.','After four college girls rob a restaurant to fund their spring break in Florida, they get entangled with a weird dude with his own criminal agenda.',94,2.77),(1000943,'Twin Peaks: Fire Walk with Me',1992,'Meet Laura Palmer... In a town where nothing is as it seems... And everyone has something to hide.','In the questionable town of Deer Meadow, Washington, FBI Agent Desmond inexplicably disappears while hunting for the man who murdered a teen girl. The killer is never apprehended, and, after experiencing dark visions and supernatural encounters, Agent Dale Cooper chillingly predicts that the culprit will claim another life. Meanwhile, in the more cozy town of Twin Peaks, hedonistic beauty Laura Palmer hangs with lowlifes and seems destined for a grisly fate.',135,4.19),(1000944,'Battle Royale',2000,'Could you kill your best friend?','In the future, the Japanese government captures a class of ninth-grade students and forces them to kill each other under the revolutionary \"Battle Royale\" act.',113,3.86),(1000945,'American Sniper',2014,'The most lethal sniper in U.S. history.','U.S. Navy SEAL Chris Kyle takes his sole mission—protect his comrades—to heart and becomes one of the most lethal snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Despite grave danger and his struggle to be a good husband and father to his family back in the States, Kyle serves four tours of duty in Iraq. However, when he finally returns home, he finds that he cannot leave the war behind.',133,3.31),(1000946,'Alice in Wonderland',1951,'A world of wonders in One Great Picture','On a golden afternoon, young Alice follows a White Rabbit, who disappears down a nearby rabbit hole. Quickly following him, she tumbles into the burrow - and enters the merry, topsy-turvy world of Wonderland! Memorable songs and whimsical escapades highlight Alice\'s journey, which culminates in a madcap encounter with the Queen of Hearts - and her army of playing cards!',75,3.74),(1000947,'Saw II',2005,'Oh Yes... There Will Be Blood.','When a new murder victim is discovered with all the signs of Jigsaw\'s hand, Detective Eric Matthews begins a full investigation and apprehends Jigsaw with little effort. But for Jigsaw, getting caught is just another part of his plan. Eight more of his victims are already fighting for their lives and now it\'s time for Matthews to join the game.',93,3.16),(1000948,'Taylor Swift: The Eras Tour',2023,'It’s been a long time coming.','The cultural phenomenon continues on the big screen! Immerse yourself in this once-in-a-lifetime concert film experience with a breathtaking, cinematic view of the history-making tour.',169,4.31),(1000949,'The Descent',2005,'Scream your last breath.','After a tragic accident, six friends reunite for a caving expedition. Their adventure soon goes horribly wrong when a collapse traps them deep underground and they find themselves pursued by bloodthirsty creatures. As their friendships deteriorate, they find themselves in a desperate struggle to survive the creatures and each other.',99,3.6),(1000950,'Renfield',2023,'Sucks to be him.','Having grown sick and tired of his centuries as Dracula\'s lackey, Renfield finds a new lease on life — and maybe even redemption — when he falls for feisty, perennially angry traffic cop Rebecca Quincy.',93,2.87),(1000951,'Hush',2016,'Silence can be killer','A deaf woman is stalked by a psychotic killer in her secluded home.',82,3.21),(1000952,'Over the Garden Wall',2014,'Will you take a peek?','Two brothers, Wirt and Greg, find themselves lost in the Unknown; a strange forest adrift in time. With the help of a wise old Woodsman and a foul-tempered bluebird movie_named Beatrice, Wirt and Greg must travel across this strange land, in hope of finding their way home. Join them as they encounter surprises and obstacles on their journey through the wood.',109,4.61),(1000953,'Ocean\'s Twelve',2004,'Twelve is the new eleven.','Danny Ocean reunites with his old flame and the rest of his merry band of thieves in carrying out three huge heists in Rome, Paris and Amsterdam – but a Europol agent is hot on their heels.',125,3.29),(1000954,'Blue Beetle',2023,'Jaime Reyes is a superhero whether he likes it or not.','Recent college grad Jaime Reyes returns home full of aspirations for his future, only to find that home is not quite as he left it. As he searches to find his purpose in the world, fate intervenes when Jaime unexpectedly finds himself in possession of an ancient relic of alien biotechnology: the Scarab.',128,2.93),(1000955,'Million Dollar Baby',2004,'Beyond his silence, there is a past. Beyond her dreams, there is a feeling. Beyond hope, there is a memory. Beyond their journey, there is a love.','Despondent over a painful estrangement from his daughter, trainer Frankie Dunn isn\'t prepared for boxer Maggie Fitzgerald to enter his life. But Maggie\'s determined to go pro and to convince Dunn and his cohort to help her.',132,3.98),(1000956,'Creep',2014,'Tubby time!','Looking for work, Aaron comes across a cryptic online ad: “$1,000 for the day. Filming service. Discretion is appreciated.” Low on cash and full of naiveté, he decides to go for it. He drives to a cabin in a remote mountain town where he meets Josef, his cinematic subject for the day. Josef is sincere and the project seems heartfelt, so Aaron begins to film. But as the day goes on, it becomes clear that Josef is not who he says, and his intentions are not at all pure.',82,3.34),(1000957,'Solaris',1972,NULL,'A psychologist is sent to a space station orbiting a planet called Solaris to investigate the death of a doctor and the mental problems of cosmonauts on the station. He soon discovers that the water on the planet is a type of brain which brings out repressed memories and obsessions.',167,4.24),(1000958,'Night of the Living Dead',1968,'If it doesn\'t scare you, you\'re already dead!','A group of people try to survive an attack of bloodthirsty zombies while trapped in a rural Pennsylvania farmhouse.',96,3.97),(1000959,'Pirates of the Caribbean: Dead Men Tell No Tales',2017,'All pirates must die.','Thrust into an all-new adventure, a down-on-his-luck Capt. Jack Sparrow feels the winds of ill-fortune blowing even more strongly when deadly ghost sailors led by his old nemesis, the evil Capt. Salazar, escape from the Devil\'s Triangle. Jack\'s only hope of survival lies in seeking out the legendary Trident of Poseidon, but to find it, he must forge an uneasy alliance with a brilliant and beautiful astronomer and a headstrong young man in the British navy.',128,2.63),(1000960,'Sausage Party',2016,'Always use condiments','Frank leads a group of supermarket products on a quest to discover the truth about their existence and what really happens when they become chosen to leave the grocery store.',89,2.28),(1000961,'Nosferatu',1922,'A symphony of horror','Vampire Count Orlok is interested in a new residence and in his real estate agent’s young wife. F. W. Murnau’s unauthorized adaptation of Bram Stoker’s “Dracula.”',95,3.89),(1000962,'Life of Brian',1979,'He wasn\'t the messiah. He was a very naughty boy.','Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he\'s not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python\'s signature absurdity, the tale finds Brian\'s life paralleling Biblical lore, albeit with many more laughs.',94,3.97),(1000963,'King Richard',2021,'Venus, Serena and a plan for greatness.','Richard Williams serves as a coach to his daughters Venus and Serena, who will soon become two of the most legendary tennis players in history.',144,3.69),(1000964,'The Hangover Part II',2011,'The Wolfpack Is Back','The Hangover crew heads to Thailand for Stu\'s wedding. After the disaster of a bachelor party in Las Vegas last year, Stu is playing it safe with a mellow pre-wedding brunch. However, nothing goes as planned and Bangkok is the perfect setting for another adventure with the rowdy group.',102,2.91),(1000965,'The Guilty',2021,'Listen carefully.','A demoted police officer assigned to a call dispatch desk is conflicted when he receives an emergency phone call from a kidnapped woman.',91,2.88),(1000966,'The 400 Blows',1959,'Angel faces hell-bent for violence.','For young Parisian boy Antoine Doinel, life is one difficult situation after another. Surrounded by inconsiderate adults, including his neglectful parents, Antoine spends his days with his best friend, Rene, trying to plan for a better life. When one of their schemes goes awry, Antoine ends up in trouble with the law, leading to even more conflicts with unsympathetic authority figures.',99,4.32),(1000967,'Yi Yi',2000,NULL,'Each member of a family in Taipei asks hard questions about life\'s meaning as they live through everyday quandaries.',174,4.54),(1000968,'The Interview',2014,'The Film Hackers Tried To Get Banned','Dave Skylark and his producer Aaron Rapaport run the celebrity tabloid show \"Skylark Tonight\". When they land an interview with a surprise fan, North Korean dictator Kim Jong-un, they are recruited by the CIA to turn their trip to Pyongyang into an assassination mission.',113,2.95),(1000969,'Crimson Peak',2015,'Love makes monsters of us all.','In the aftermath of a family tragedy, an aspiring author is torn between love for her childhood friend and the temptation of a mysterious outsider. Trying to escape the ghosts of her past, she is swept away to a house that breathes, bleeds… and remembers.',119,3.34),(1000970,'Final Destination',2000,'No accidents. No coincidences. No escapes. You can\'t cheat death.','After a teenager has a terrifying vision of him and his friends dying in a plane crash, he prevents the accident only to have Death hunt them down, one by one.',98,3.14),(1000971,'Road House',2024,'Take it outside.','Ex-UFC fighter Dalton takes a job as a bouncer at a Florida Keys roadhouse, only to discover that this paradise is not all it seems.',121,2.62),(1000972,'Now You See Me 2',2016,'You Haven\'t Seen Anything Yet','One year after outwitting the FBI and winning the public’s adulation with their mind-bending spectacles, the Four Horsemen resurface only to find themselves face to face with a new enemy who enlists them to pull off their most dangerous heist yet.',129,2.93),(1000973,'Candyman',2021,'Dare to say his movie_name.','Anthony and his partner move into a loft in the now gentrified Cabrini. After a chance encounter with an old-timer exposes Anthony to the true story behind Candyman, he unknowingly opens a door to a complex past that unravels his own sanity and unleashes a terrifying wave of violence.',91,3.07),(1000974,'Breathless',1960,NULL,'A small-time thief steals a car and impulsively murders a motorcycle policeman. Wanted by the authorities, he attempts to persuade a girl to run away to Italy with him.',90,3.93),(1000975,'The Aviator',2004,'For some men, the sky was the limit. For him, it was just the beginning.','A biopic depicting the life of filmmaker and aviation pioneer Howard Hughes from 1927 to 1947, during which time he became a successful film producer and an aviation magnate, while simultaneously growing more unstable due to severe obsessive-compulsive disorder.',170,3.74),(1000976,'Mystic River',2003,'We bury our sins, we wash them clean.','The lives of three men who were childhood friends are shattered when one of them has a family tragedy.',138,3.83),(1000977,'What\'s Eating Gilbert Grape',1993,'Life is a terrible thing to sleep through.','Gilbert Grape is a small-town young man with a lot of responsibility. Chief among his concerns are his mother, who is so overweight that she can\'t leave the house, and his mentally impaired younger brother, Arnie, who has a knack for finding trouble. Settled into a job at a grocery store and an ongoing affair with local woman Betty Carver, Gilbert finally has his life shaken up by the free-spirited Becky.',118,3.8),(1000978,'Hotel Transylvania',2012,'Even monsters need a vacation','Welcome to Hotel Transylvania, Dracula\'s lavish five-stake resort, where monsters and their families can live it up and no humans are allowed. One special weekend, Dracula has invited all his best friends to celebrate his beloved daughter Mavis\'s 118th birthday. For Dracula catering to all of these legendary monsters is no problem but the party really starts when one ordinary guy stumbles into the hotel and changes everything!',91,3.23),(1000979,'Fantastic Planet',1973,'A sublime trip to a fine new world','On the planet Ygam, the Draags, extremely technologically and spiritually advanced blue humanoids, consider the tiny Oms, human beings descendants of Terra\'s inhabitants, as ignorant animals. Those who live in slavery are treated as simple pets and used to entertain Draag children; those who live hidden in the hostile wilderness of the planet are periodically hunted and ruthlessly slaughtered as if they were vermin.',72,4.02),(1000980,'Labyrinth',1986,'Where everything seems possible and nothing is what it seems.','When teen Sarah is forced to babysit her half-brother Toby, she summons Jareth the Goblin King to take him away. When he is actually kidnapped, Sarah is given just thirteen hours to solve a labyrinth and rescue him.',102,3.69),(1000981,'Suzume',2022,'On the other side of the door, was time in its entirety.','Suzume, 17, lost her mother as a little girl. On her way to school, she meets a mysterious young man. But her curiosity unleashes a calamity that endangers the entire population of Japan, and so Suzume embarks on a journey to set things right.',123,3.84),(1000982,'Women Talking',2022,'Do nothing. Stay and fight. Leave.','A group of women in an isolated religious colony struggle to reconcile their faith with a string of sexual assaults committed by the colony\'s men.',104,3.78),(1000983,'Blue Is the Warmest Color',2013,NULL,'Adèle\'s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire, to assert herself as a woman and as an adult. In front of others, Adele grows, seeks herself, loses herself, finds herself.',180,3.29),(1000984,'The Wolverine',2013,'When he\'s most vulnerable, he\'s most dangerous.','Wolverine faces his ultimate nemesis - and tests of his physical, emotional, and mortal limits - in a life-changing voyage to modern-day Japan.',126,2.96),(1000985,'Fantastic Beasts: The Secrets of Dumbledore',2022,'Return to the magic.','In an effort to thwart Grindelwald\'s plans of raising pure-blood wizards to rule over all non-magical beings, Albus Dumbledore enlists his former student Newt Scamander, who agrees to help, though he\'s unaware of the dangers that lie ahead. Lines are drawn as love and loyalty are tested, even among the truest friends and family, in an increasingly divided wizarding world.',142,2.53),(1000986,'Crimes of the Future',2022,'Enter the heart of darkness.','As the human species adapts to a synthetic environment, the body undergoes new transformations and mutations. With his partner Caprice, celebrity performance artist Saul Tenser publicly showcases the metamorphosis of his organs in avant-garde performances. Timlin, an investigator from the National Organ Registry, obsessively tracks their movements, which is when a mysterious group is revealed. Their mission – to use Saul’s notoriety to shed light on the next phase of human evolution.',107,3.29),(1000987,'Happy Together',1997,NULL,'A couple take a trip to Argentina in search of a new beginning, but instead find themselves drifting ever further apart.',96,4.22),(1000988,'Hustle',2022,'Are you obsessed with this game?','After discovering a once-in-a-lifetime player with a rocky past abroad, a down on his luck basketball scout takes it upon himself to bring the phenom to the States without his team\'s approval. Against the odds, they have one final shot to prove they have what it takes to make it in the NBA.',117,3.54),(1000989,'Coherence',2013,'Nothing is random.','On the night of an astronomical anomaly, eight friends at a dinner party experience a troubling chain of reality bending events.',89,3.75),(1000990,'Bolt',2008,'Fully Awesome. Ridonculous. Let It Begin.','Bolt is the star of the biggest show in Hollywood. The only problem is, he thinks it\'s real. After he\'s accidentally shipped to New York City and separated from Penny, his beloved co-star and owner, Bolt must harness all his \"super powers\" to find a way home.',98,3.07),(1000991,'Godzilla: King of the Monsters',2019,'Long live the king.','Follows the heroic efforts of the crypto-zoological agency Monarch as its members face off against a battery of god-sized monsters, including the mighty Godzilla, who collides with Mothra, Rodan, and his ultimate nemesis, the three-headed King Ghidorah. When these ancient super-species - thought to be mere myths - rise again, they all vie for supremacy, leaving humanity\'s very existence hanging in the balance.',132,2.79),(1000992,'Shrek Forever After',2010,'It ain\'t Ogre... Til it\'s Ogre','A bored and domesticated Shrek pacts with deal-maker Rumpelstiltskin to get back to feeling like a real ogre again, but when he\'s duped and sent to a twisted version of Far Far Away—where Rumpelstiltskin is king, ogres are hunted, and he and Fiona have never met—he sets out to restore his world and reclaim his true love.',93,2.85),(1000993,'127 Hours',2010,'There is no force more powerful than the will to live.','The true story of mountain climber Aron Ralston\'s remarkable adventure to save himself after a fallen boulder crashes on his arm and traps him in an isolated canyon in Utah.',94,3.49),(1000994,'The Fast and the Furious: Tokyo Drift',2006,'On the streets of Tokyo, speed needs no translation...','In order to avoid a jail sentence, Sean Boswell heads to Tokyo to live with his military father. In a low-rent section of the city, Shaun gets caught up in the underground world of drift racing',104,3.1),(1000995,'Shark Tale',2004,'Behind every little fish is a great white lie.','Oscar is a small fish whose big aspirations often get him into trouble. Meanwhile, Lenny is a great white shark with a surprising secret that no sea creature would guess: He\'s a vegetarian. When a lie turns Oscar into an improbable hero and Lenny becomes an outcast, the two form an unlikely friendship.',90,2.85),(1000996,'Chef',2014,'Starting from scratch never tasted so good.','When Chef Carl Casper suddenly quits his job at a prominent Los Angeles restaurant after refusing to compromise his creative integrity for its controlling owner, he is left to figure out what\'s next. Finding himself in Miami, he teams up with his ex-wife, his friend and his son to launch a food truck. Taking to the road, Chef Carl goes back to his roots to reignite his passion for the kitchen -- and zest for life and love.',114,3.68),(1000997,'Moon',2009,'The last place you\'d ever expect to find yourself.','With only three weeks left in his three year contract, Sam Bell is getting anxious to finally return to Earth. He is the only occupant of a Moon-based manufacturing facility along with his computer and assistant, GERTY. When he has an accident however, he wakens to find that he is not alone.',97,3.86),(1000998,'Lion',2016,'The search begins','A five-year-old Indian boy gets lost on the streets of Calcutta, thousands of kilometers from home. He survives many challenges before being adopted by a couple in Australia; 25 years later, he sets out to find his lost family.',118,3.88),(1000999,'The Tragedy of Macbeth',2021,NULL,'Macbeth, the Thane of Glamis, receives a prophecy from a trio of witches that one day he will become King of Scotland. Consumed by ambition and spurred to action by his wife, Macbeth murders his king and takes the throne for himself.',105,3.78),(1001000,'The Prince of Egypt',1998,'The Power Is Real.','This is the extraordinary tale of two brothers movie_named Moses and Ramses, one born of royal blood, and one an orphan with a secret past. Growing up the best of friends, they share a strong bond of free-spirited youth and good-natured rivalry. But the truth will ultimately set them at odds, as one becomes the ruler of the most powerful empire on earth, and the other the chosen leader of his people! Their final confrontation will forever change their lives and the world.',99,4);
